(57, 74, '1148'),
(57, 75, 'Brand new for the 2017 season, Graphite Design introduces the latest in the Tour AD premium line of golf shafts, the Graphite Design Tour AD F-Series Fairway metal-wood specific shafts. Designed and manufactured at the Graphite Design Japan factory headquarters, Pro&rsquo;s Choice Golf Shafts offers the new Tour AD F-Series Fairway shafts in 65g SR (Stiff Regular) flex, 75g S and X flex and 85g S and X flex. The Tour AD F-Series Fairway shafts are designed with a softer tip and stiffer butt profile and feature a Low Kick Point for higher launch conditions into the air and mid-ball spin. Manufactured under the same tight tolerances and with premium, aerospace quality 40t carbon-fiber materials, the Tour AD F-Series of shafts fall directly in line with all of the other high quality Graphite Design shafts as a complementing Fairway wood shaft. Should you be searching for a new Fairway shaft that is designed to provide maximum distance and extra forgiveness off the fairways, then a new Tour AD F-Series Fairway graphite shaft may be the answer to what you are looking for in a high performance golf shaft for your Fairway metal-woods. Specifications: Shaft TypePart NumberFlexLengthWt.Tip ODTip Para.Butt ODTorqueKick ptLaunchSpin Tour AD F-65 SR ADFW6-SR Stiff Regular 44&Prime; 68g .335&Prime; 3.0&Prime; .604&Prime; 3.3 LOW HIGH MID Tour AD F-75 S ADFW7-S Stiff 44&Prime; 77g .335&Prime; 3.0&Prime; .598&Prime; 3.2 LOW HIGH MID Tour AD F-75 X ADFW7-X X-Stiff 44&Prime; 79g .335&Prime; 3.0&Prime; .602&Prime; 3.2 LOW HIGH MID Tour AD F-85 S ADFW8-S Stiff 44&Prime; 88g .335&Prime; 3.0&Prime; .602&Prime; 2.8 LOW HIGH MID Tour AD F-85 X ADFW8-X X-Stiff 44&Prime; 90g .335&Prime; 3.0&Prime; .604&Prime; 2.8 LOW HIGH MID &nbsp;'),
(57, 76, 'This is for a new Graphite Design TOUR AD F Fairway Shaft built to your specs. This will include the shaft, tip, grip and a free gift! Keep in mind everything we sell comes with a full warranty and satisfaction guarantee.'),
