(58, 75, 'The Raijin (Rie-gene) features a design utilizing multiple composite materials. Designed using exotic 40T carbon fiber pre-preg materials from Japan coupled with a design that is unprecedented in the golf industry. The Raijin is a very versatile shaft that fits a wide variety of players. The S and X flexes feature mid-to-high launch characteristics coupled with low spin. The L, A, and R flexes feature high launch and low-to-mid spin characteristics. The Raijin features a torque range from 2.8 to 5.6 degrees, depending on the weight and flex category. This shaft has a slightly higher balance point which helps with better balance and swing weight control. VA Composites is redefining the golf shaft and we are taking performance to an entirely new level! &nbsp;'),
