(212, 74, 'miura-tc201'),
(212, 75, 'The Miura TC-201 golf irons offer the performance of a muscle back with the increased forgiveness of a cavity back. The progressive weighting in the sole provides a lower center of gravity in the long irons for added height and higher trajectory on longer shots. Slightly changing to a higher center of gravity in the short irons creates a lower trajectory and more control on shorter shots. Constant weight towards the heel and toe helps with off center shots. The sole design contributes significantly to the playability and forgiveness of this club and the minimal offset paired with the top line at address inspires confidence. The Miura TC-201 is a player&rsquo;s iron that acts as a replacement for the CB-1008 and perfectly complements the MB-101. &nbsp; These will come built to your specs in house by one our trained master club builders. &nbsp;These will also come with the shafts and grips of your choice. &nbsp;We also have demos available in these, email us to discuss your next build.&nbsp; At The Peoples Clubs, we guarantee your satisfaction. If you want to work on a custom build please message us, we specialize in custom tour issue and retail builds.'),
