(244, 75, 'For the first time ever, KBS is adding a Driver/Wood shaft to the KBS product line. The KBS TD is a lighter and stiffer Driver/Wood shaft with characteristics of the original KBS feel. It is the perfect complement to our already proven performance-driven line of golf shafts now fitting your entire golf bag. As always this will come built to your desired specifications in house by a trained member of our staff. &nbsp;This price includes the adapter and grip of your choice.&nbsp;'),
(244, 76, '&lt;p&gt;&lt;span style="font-size: medium;"&gt;This is for a new KBS TD Driver/Wood Shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.&lt;/span&gt;&lt;/p&gt;'),
(244, 83, 'KBS'),
(244, 97, 'Enabled'),
(244, 123, 'kbstd'),
(244, 137, 'Taxable Goods'),
(245, 73, 'Fujikura Motore X Shaft (F1 or F3)'),
(245, 74, 'fujikura-motorex'),
(245, 75, 'Engineered for speed and backed by stability, Motore X features a reinforced bias core with a torsionally stiffened handle section that promotes faster ball speeds combined with thin layers of full-length bias plies that create a balanced torsional strength for stability. The result &ndash; a core paired with an accelerated taper that transfers more energy, boosting ball speeds for more distance while maintaining stability for tighter shot control. The new Fujikura Motore X has been very well received both on and off tour. &nbsp; They are currently being used by several top pros including Branden Grace, Xinjun Zhang,&nbsp;Rhein Gibson&nbsp;and many more.&nbsp; As always this will come fully built to your specifications by a trained member of our staff. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Motore X please ask!'),
(245, 76, 'This is for a new Fujikura Motore X shaft of your choice built to your specs. As always everything we sell comes with a full satisfaction guarantee.'),
(245, 83, 'Fujikura'),
(245, 97, 'Enabled'),
(245, 123, 'fujikura-motorex'),
(245, 137, 'Taxable Goods'),
(266, 0, 'Select Your Fairway Wood | Select Your Shaft'),
(266, 73, 'Cobra Speedzone Fairway w/ Shaft of your choice! | Speedzone RH 3/14.5 | Speedzone LH 3/14.5 | Speedzone RH 5/18.5 | Speedzone LH 5/18.5 | Speedzone RH 7/22.5 | Speedzone LH 7/22.5 | Speedzone Tour RH 3/14.0 | Speedzone Tour RH 5/17.5 | Speedzone Big Tour RH 3/13.5 | Speedzone Big Tour LH 3/13.5 | Accra TZ5 or TZ6 | Fujikura Atmos | Fujikura Evolution 3,4,5 or 6 | Fujikura Ventus (Black, Blue or Red) | Fujikura Motore X (F1 or F3) | Graphite Design Tour AD DI (Black Included) | Graphite Design Tour AD IZ | Graphite Design Tour AD VR | Graphite Design Tour AD XC | Mitsubishi D+, ZF, DF or BF | Mitsubishi Tensei (White, Blue or Red) | Mitsubishi Tensei Orange | Oban Kiyoshi | Project X HZRDUS (Black or Yellow) | Project X Smoke (Black or Yellow) | Project X T1100 or HULK | VA Drago | VA Raijin (Black Included) | VA Slay | VA Vylyn | VA Nemesys'),
(266, 74, 'cobraszfairwaybundle'),
(266, 75, 'This is for a new Cobra Speedzone Fairway built to your specs with the shaft of your choice. This will come custom built in house by one of our trained master club builders. It will come fully built to your desired specifications and also comes with a grip of your choice.&nbsp; A headcover and wrench will also be included. If you would like to discuss a build please email us.&nbsp; The website will not take the build specs, we will email you after purchasing to obtain this info, please have the specs ready to provide or email them after purchasing.&nbsp; These are our recommended shafts for 2020.&nbsp; If you want a different shaft please email us for a quote.&nbsp; We can get pretty much anything.&nbsp; If you need a recommendation as to which shaft would best fit you please email us.'),
(266, 76, 'YOU ARE PURCHASING A BRAND NEW RETAIL FAIRWAY FULLY CUSTOMIZED WITH A SHAFT OF YOUR CHOICE. THIS CLUB WILL BE CUSTOM BUILT FOR YOU BASED ON A CONSULTATION ANALYZING YOUR SPECIFIC NEEDS.'),
(266, 97, 'Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled | Enabled'),
(266, 123, 'cobra-speedzone-fw-w-shaft-of-your-choice | speedzone-rh-3-14-5 | speedzone-rh-3-14-6 | speedzone-rh-3-14-7 | speedzone-rh-3-14-8 | speedzone-rh-3-14-9 | speedzone-rh-3-14-10 | speedzone-rh-3-14-11 | speedzone-rh-3-14-12 | speedzone-rh-3-14-13 | speedzone-rh-3-14-14 | accra-tz5-or-tz6 | accra-tz5-or-tz6-1 | accra-tz5-or-tz6-2 | accra-tz5-or-tz6-3 | accra-tz5-or-tz6-4 | accra-tz5-or-tz6-5 | accra-tz5-or-tz6-6 | accra-tz5-or-tz6-7 | accra-tz5-or-tz6-8 | accra-tz5-or-tz6-9 | accra-tz5-or-tz6-10 | accra-tz5-or-tz6-11 | accra-tz5-or-tz6-12 | accra-tz5-or-tz6-13 | accra-tz5-or-tz6-14 | accra-tz5-or-tz6-15 | accra-tz5-or-tz6-16 | accra-tz5-or-tz6-17 | accra-tz5-or-tz6-18 | accra-tz5-or-tz6-19 | accra-tz5-or-tz6-20'),
