ight. &nbsp;These are only offered in X-Stiff, they come at 132g weight.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">If you have any questions please message us. We can also install these. The installed price of $150 is for the whole set and includes grips.  For a single install it would be cheaper. </span></p>'),
(158, 76, 0, 53, '<p>This is for a set of Tour Issue Dynamic Gold X Seven X7 Iron Shafts. As always everything we sell comes with a free gift, full warranty and a satisfaction guarantee.</p>'),
(159, 85, 0, 53, NULL),
(161, 75, 0, 54, '<p><span style="font-size: medium;">NEW Fujikura ATMOS Tour Spec Hybrid Shaft. &nbsp;These are new for 2017, they are a revamp of the wildy successful Motore Speeder line. &nbsp;These have been picking up a ton of play on tour. &nbsp;They come in three different unique profiles. &nbsp;They are Black, Blue, and Red. The Black is low launching and spinning. The Blue is mid launch and spin. &nbsp;Then the Red is high launch and spin. &nbsp;</span></p>\r\n<p><span style="font-size: medium;">Included is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Fujikura Atmos please ask!&nbsp;</span></p>\r\n<p><br /><span style="font-size: medium;"> Here are some reviews on the Fujikura Atmos.</span></p>\r\n<p><span style="font-size: medium;"><a title="ATMOS" href="http://www.golfwrx.com/forums/topic/1427888-fujikura-atmos/">GolfWRX&nbsp;Discussion</a></span></p>\r\n<p><span style="font-size: medium;"><a title="ATMOS" href="http://www.golfwrx.com/422898/fujikura-launches-new-atmos-tour-spec-shafts-on-pga-tour/">GolfWRX Review</a></span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>'),
(162, 76, 0, 54, '<p>This is for a new Fujikura ATMOS Tour Spec Hybrid Shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</p>'),
(163, 85, 0, 54, 'Fujikura ATMOS Tour Spec Hybrid Shaft '),
(164, 75, 0, 55, '<p><span style="font-size: medium;">Dynamic Gold Tour Issue shafts provide the same&nbsp;power, control and the trademark penetrating ball flight associated with the entire series of Dynamic Gold irons shafts. The Tour Issue steel shafts have a Tour Only weight tolerance for custom precision fitting. These are taper tip, .355 only. We also have the Tour Issue Black Onyx but only for wedges.  &nbsp;</span></p>\r\n<p><span style="font-size: medium;">If you have any questions please message us. We can also install these. The installed price of $150 is for the whole set and includes grips.  For a single install it would be cheaper. </span></p>'),
(165, 76, 0, 55, '<p>This is for a set of Tour Issue Dynamic Gold Iron or Wedge Shafts As always everything we sell comes with a free gift, full warranty and a satisfaction guarantee.</p>'),
(166, 85, 0, 55, 'Tour Issue Dynamic Gold 3-PW Iron Shafts'),
(167, 75, 0, 56, '<p><span style="font-size: medium;">The new Dynamic Gold 120 shaft delivers the tour-caliber accuracy of Dynamic Gold in a lighter weight steel shaft. Stronger players will experience the exact same profile and launch as Dynamic Gold with slightly lower spin and a shaft that is easier to swing. True Temper has spent the past 15 years focused on two specific performance categories&mdash;Tour-caliber designs for the best players in the world and lightweight steel shafts. Dynamic Gold 120 represents the best performance benefits of both of these categories in one radically new design. Dynamic Gold 120 is available exclusively through True Temper Performance Fitting Centers.</span></p>\r\n<p><span style="font-size: medium;">If you have any questions please message us. We can also install these. The installed price of $150 is for the whole set and includes grips.  For a single install it would be cheaper. </span></p>'),
(168, 76, 0, 56, '<p>This is for a set of Tour Issue Dynamic Gold 120 3-PW Iron Shafts. As always everything we sell comes with a free gift, full warranty and a satisfaction guarantee.</p>'),
(169, 85, 0, 56, NULL),
(171, 75, 0, 57, '<p><span style="font-size: medium;">Brand new for the 2017 season, Graphite Design introduces the latest in the Tour AD premium line of golf shafts, the Graphite Design Tour AD F-Series Fairway metal-wood specific shafts. Designed and manufactured at the Graphite Design Japan factory headquarters, Pro&rsquo;s Choice Golf Shafts offers the new Tour AD F-Series Fairway shafts in 65g SR (Stiff Regular) flex, 75g S and X flex and 85g S and X flex.</span></p>\r\n<p><span style="font-size: medium;">The Tour AD F-Series Fairway shafts are designed with a softer tip and stiffer butt profile and feature a Low Kick Point for higher launch conditions into the air and mid-ball spin. Manufactured under the same tight tolerances and with premium, aerospace quality 40t carbon-fiber materials, the Tour AD F-Series of shafts fall directly in line with all of the other high quality Graphite Design shafts as a complementing Fairway wood shaft.</span></p>\r\n<p><span style="font-size: medium;">Should you be searching for a new Fairway shaft that is designed to provide maximum distance and extra forgiveness off the fairways, then a new Tour AD F-Series Fairway graphite shaft may be the answer to what you are looking for in a high performance golf shaft for your Fairway metal-woods.</span></p>\r\n<h3><span style="font-size: medium;">Specifications:</span></h3>\r\n<div class="specs">\r\n<table class="specs">\r\n<tbody>\r\n<tr><th><span style="font-size: medium;">Shaft Type</span></th><th><span style="font-size: medium;">Part Number</span></th><th><span style="font-size: medium;">Flex</span></th><th><span style="font-size: medium;">Length</span></th><th><span style="font-size: medium;">Wt.</span></th><th><span style="font-size: medium;">Tip OD</span></th><th><span style="font-size: medium;">Tip Para.</span></th><th><span style="font-size: medium;">Butt OD</span></th><th><span style="font-size: medium;">Torque</span></th><th><span style="font-size: medium;">Kick pt</span></th><th><span style="font-size: medium;">Launch</span></th><th><span style="font-size: medium;">Spin</span></th></tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Tour AD F-65 SR</span></td>\r\n<td><span style="font-size: medium;">ADFW6-SR</span></td>\r\n<td><span style="font-size: medium;">Stiff Regular</span></td>\r\n<td><span style="font-size: medium;">44&Prime;</span></td>\r\n<td><span style="font-size: medium;">68g</span></td>\r\n<td><span style="font-size: medium;">.335&Prime;</span></td>\r\n<td><span style="font-size: medium;">3.0&Prime;</span></td>\r\n<td><span style="font-size: medium;">.604&Prime;</span></td>\r\n<td><span style="font-size: medium;">3.3</span></td>\r\n<td><span style="font-size: medium;">LOW</span></td>\r\n<td><span style="font-size: medium;">HIGH</span></td>\r\n<td><span style="font-size: medium;">MID</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Tour AD F-75 S</span></td>\r\n<td><span style="font-size: medium;">ADFW7-S</span></td>\r\n<td><span style="font-size: medium;">Stiff</span></td>\r\n<td><span style="font-size: medium;">44&Prime;</span></td>\r\n<td><span style="font-size: medium;">77g</span></td>\r\n<td><span style="font-size: medium;">.335&Prime;</span></td>\r\n<td><span style="font-size: medium;">3.0&Prime;</span></td>\r\n<td><span style="font-size: medium;">.598&Prime;</span></td>\r\n<td><span style="font-size: medium;">3.2</span></td>\r\n<td><span style="font-size: medium;">LOW</span></td>\r\n<td><span style="font-size: medium;">HIGH</span></td>\r\n<td><span style="font-size: medium;">MID</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Tour AD F-75 X</span></td>\r\n<td><span style="font-size: medium;">ADFW7-X</span></td>\r\n<td><span style="font-size: medium;">X-Stiff</span></td>\r\n<td><span style="font-size: medium;">44&Prime;</span></td>\r\n<td><span style="font-size: medium;">79g</span></td>\r\n<td><span style="font-size: medium;">.335&Prime;</span></td>\r\n<td><span style="font-size: medium;">3.0&Prime;</span></td>\r\n<td><span style="font-size: medium;">.602&Prime;</span></td>\r\n<td><span style="font-size: medium;">3.2</span></td>\r\n<td><span style="font-size: medium;">LOW</span></td>\r\n<td><span style="font-size: medium;">HIGH</span></td>\r\n<td><span style="font-size: medium;">MID</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Tour AD F-85 S</span></td>\r\n<td><span style="font-size: medium;">ADFW8-S</span></td>\r\n<td><span style="font-size: medium;">Stiff</span></td>\r\n<td><span style="font-size: medium;">44&Prime;</span></td>\r\n<td><span style="font-size: medium;">88g</span></td>\r\n<td><span style="font-size: medium;">.335&Prime;</span></td>\r\n<td><span style="font-size: medium;">3.0&Prime;</span></td>\r\n<td><span style="font-size: medium;">.602&Prime;</span></td>\r\n<td><span style="font-size: medium;">2.8</span></td>\r\n<td><span style="font-size: medium;">LOW</span></td>\r\n<td><span style="font-size: medium;">HIGH</span></td>\r\n<td><span style="font-size: medium;">MID</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Tour AD F-85 X</span></td>\r\n<td><span style="font-size: medium;">ADFW8-X</span></td>\r\n<td><span style="font-size: medium;">X-Stiff</span></td>\r\n<td><span style="font-size: medium;">44&Prime;</span></td>\r\n<td><span style="font-size: medium;">90g</span></td>\r\n<td><span style="font-size: medium;">.335&Prime;</span></td>\r\n<td><span style="font-size: medium;">3.0&Prime;</span></td>\r\n<td><span style="font-size: medium;">.604&Prime;</span></td>\r\n<td><span style="font-size: medium;">2.8</span></td>\r\n<td><span style="font-size: medium;">LOW</span></td>\r\n<td><span style="font-size: medium;">HIGH</span></td>\r\n<td><span style="font-size: medium;">MID</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>'),
(172, 76, 0, 57, '<p><span style="font-size: medium;">This is for a new Graphite Design TOUR AD F Fairway Shaft built to your specs. This will include the shaft, tip, grip and a free gift! Keep in mind everything we sell comes with a full warranty and satisfaction guarantee. </span></p>'),
(173, 85, 0, 57, 'Graphite Design TOUR AD F Fairway Shaft'),
(174, 75, 0, 58, '<p><span style="font-size: medium;">The Raijin (Rie-gene) features a design utilizing multiple composite materials. Designed using exotic 40T carbon fiber pre-preg materials from Japan coupled with a design that is unprecedented in the golf industry.   The Raijin is a very versatile shaft that fits a wide variety of players. The S and X flexes feature mid-to-high launch characteristics coupled with low spin. The L, A, and R flexes feature high launch and low-to-mid spin characteristics. The Raijin features a torque range from 2.8 to 5.6 degrees, depending on the weight and flex category.   This shaft has a slightly higher balance point which helps with better balance and swing weight control. VA Composites is redefining the golf shaft and we are taking performance to an entirely new level!\r\n<p><span style="font-size: medium;">&nbsp;</span></p>'),
(175, 76, 0, 58, '<p><span style="font-size: medium;">This is for a new VA Composites Raijin shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.</span></p>'),
(176, 85, 0, 58, 'VA Composites Raijin Shaft '),
(177, 75, 0, 59, '<p><span style="font-size: medium;">The Raijin (Rie-gene) features a design utilizing multiple composite materials.   Designed using exotic 40T carbon fiber pre-preg materials from Japan coupled with a design that is unprecedented in the golf industry.   The Raijin is a very versatile shaft that fits a wide variety of players.   The S and X flexes feature mid-to-high launch characteristics coupled with low spin.   The L, A, and R flexes feature high launch and low-to-mid spin characteristics.   The Raijin features a torque range from 2.8 to 5.6 degrees, depending on the weight and flex category.   This shaft has a slightly higher balance point which helps with better balance and swing weight control.    VA Composites is redefining the golf shaft and we are taking performance to an entirely new level!\r\n<p><span style="font-size: medium;">&nbsp;</span></p>'),
(178, 76, 0, 59, '<p><span style="font-size: medium;">This is for a new VA Composites Tour Issue Raijin Hybrid shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.</span></p>'),
(179, 85, 0, 59, 'VA Composites Tour Issue Raijin Hybrid Shaft '),
(180, 75, 0, 60, '<p><span style="font-size: medium;">ACCRA’s most technologically advanced golf shaft ever. The new RPG shaft joins the Tour Z family of shafts as a standalone product designed for Tour yet playable for a wide variety of golfers.\r\n\r\nThe Tour Z RPG is available in three distinct weights, yet all feature a similar profile that promotes maximum energy transfer. The smooth transition from an extremely stable butt section to a responsive tip section is unique due to the addition of its radial strength and resistance to ovaling.\r\n\r\nThe Tour Z RPG features 9 of the most advanced composite materials using less resin content of any shaft the ACCRA has ever developed. ACCRA has incorporated only Aerospace grade prepreg from Torey Japan to ensure the perfect symmetry of strength and power. Making the Tour Z RPG the smoothest feeling, maximum stability shaft in the industry.\r\n\r\nAlong with the high modulus materials a 360-degree quad weave that stretches the entire length of the shaft has been incorporated to maximize torsional strength and increase the speed in which the shaft recovers.\r\n\r\nACCRA looked at the needs of PGA Tour players and discerning golfers given the playability of the latest driver and fairway wood heads. The Tour Z RPG enables golfer to control launch and spin while increasing clubhead speed through its counter balanced design and material difference.\r\n\r\nThe Tour Z RPG incorporates ACCRA’s proprietary technologies such as a Uniform taper design (UTT) to maximize energy transfer and Constant flex technology to add consistency to the fitting process.\r\nThe Tour Z RPG needs to be tested to understand it’s unique characteristics and to understand the “real” material and design benefits.\r\n<p><span style="font-size: medium;">&nbsp;</span></p>'),
(181, 76, 0, 60, '<p><span style="font-size: medium;">This is for a new Accra Golf TourZ RPG shaft of your choice built to your specs. As always everything we sell comes with a satisfaction back guarantee.</span></p>'),
(182, 85, 0, 60, 'Accra Golf TourZ RPG Shaft'),
(183, 75, 0, 61, '<p><span style="font-size: medium;">ACCRA introduces an all new series of shafts using proprietary technologies and a fitting philosophy that is  industry leading. The DyMatch and Fx lines of shafts laid the groundworks and now ACCRA has taken performance and customization to a new level.</span></p>\r\n<p><span style="font-size: medium;">Fx 2.0 features a new profile, new updated high modulus materials, and better fitting capabilities than any series of shafts in golf.</span></p>\r\n<p><span style="font-size: medium;">ACCRA is synonymous with professional fitting, as only the world&rsquo;s best club fitters are chosen to be certified dealers. ACCRA performance golf shafts are not available &ldquo;off the rack&rdquo; because we truly believe that a &ldquo;fit&rdquo; golf club will always out perform a &ldquo;stock&rdquo; golf club. The Fx 2.0 series offers an unsurpassed army of fitting options, combining unique profiles, weights, flexes and performance characteristics carrying on a</span><br /><span style="font-size: medium;">tradition of delivering club fitters all of the tools to fit any golfer.</span></p>\r\n<p><span style="font-size: medium;">The Fx 2.0 offers 3 unique launch conditions, utilizing S3 shaft blueprinting technologies:</span></p>\r\n<p><span style="font-size: medium;">Fx 2.0 100 Series = High launch</span><br /><span style="font-size: medium;">Fx 2.0 200 Series = Mid Launch</span><br /><span style="font-size: medium;">Fx 2.0 300 Series = Low Launch</span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs with a tip and grip of your choice.&nbsp;</span></p>'),
(184, 76, 0, 61, '<p><span style="font-size: medium;">This is for a new Accra Golf FX200 series shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</span></p>'),
(185, 85, 0, 61, 'Accra Golf TourZ RPG Shaft'),
(187, 75, 0, 62, '<p><span style="font-size: medium;">ACCRA introduces an all new series of shafts using proprietary technologies and a fitting philosophy that is industry leading. The DyMatch and Fx lines of shafts laid the groundworks and now ACCRA has taken performance and customization to a new level.</span></p>\r\n<p><span style="font-size: medium;">Fx 2.0 features a new profile, new updated high modulus materials, and better fitting capabilities than any series of shafts in golf.</span></p>\r\n<p><span style="font-size: medium;">ACCRA is synonymous with professional fitting, as only the world&rsquo;s best club fitters are chosen to be certified dealers. ACCRA performance golf shafts are not available &ldquo;off the rack&rdquo; because we truly believe that a &ldquo;fit&rdquo; golf club will always out perform a &ldquo;stock&rdquo; golf club. The Fx 2.0 series offers an unsurpassed army of fitting options, combining unique profiles, weights, flexes and performance characteristics carrying on a</span><br /><span style="font-size: medium;">tradition of delivering club fitters all of the tools to fit any golfer.</span></p>\r\n<p><span style="font-size: medium;">The Fx 2.0 offers 3 unique launch conditions, utilizing S3 shaft blueprinting technologies:</span></p>\r\n<p><span style="font-size: medium;">Fx 2.0 100 Series = High launch</span><br /><span style="font-size: medium;">Fx 2.0 200 Series = Mid Launch</span><br /><span style="font-size: medium;">Fx 2.0 300 Series = Low Launch</span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs with the tip and grip of your choice.&nbsp;</span></p>'),
(188, 76, 0, 62, '<p><span style="font-size: medium;">This is for a new Accra Golf FX 2.0 100 series shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</span></p>'),
(191, 75, 0, 63, '<p><span style="font-size: medium;">ACCRA introduces an all new series of shafts using proprietary technologies and a fitting philosophy that is industry leading. The DyMatch and Fx lines of shafts laid the groundworks and now ACCRA has taken performance and customization to a new level.</span></p>\r\n<p><span style="font-size: medium;">Fx 2.0 features a new profile, new updated high modulus materials, and better fitting capabilities than any series of shafts in golf.</span></p>\r\n<p><span style="font-size: medium;">ACCRA is synonymous with professional fitting, as only the world&rsquo;s best club fitters are chosen to be certified dealers. ACCRA performance golf shafts are not available &ldquo;off the rack&rdquo; because we truly believe that a &ldquo;fit&rdquo; golf club will always out perform a &ldquo;stock&rdquo; golf club. The Fx 2.0 series offers an unsurpassed army of fitting options, combining unique profiles, weights, flexes and performance characteristics carrying on a</span><br /><span style="font-size: medium;">tradition of delivering club fitters all of the tools to fit any golfer.</span></p>\r\n<p><span style="font-size: medium;">The Fx 2.0 offers 3 unique launch conditions, utilizing S3 shaft blueprinting technologies:</span></p>\r\n<p><span style="font-size: medium;">Fx 2.0 100 Series = High launch</span><br /><span style="font-size: medium;">Fx 2.0 200 Series = Mid Launch</span><br /><span style="font-size: medium;">Fx 2.0 300 Series = Low Launch</span></p>\r\n<p><span style="font-size: medium;">This shaft will come built to your specs with the tip and grip of your choice.&nbsp;</span></p>'),
(192, 76, 0, 63, '<p><span style="font-size: medium;">This is for a new Accra Golf FX 2.0 300 series shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</span></p>'),
(194, 75, 0, 64, '<p><span style="font-size: medium;">The ACCRA iSeries features the same high modulus composite materials to ensure a smooth feel and enhanced performance. We have engineered a shaft that offers unsurpassed stability for tight dispersion without sacrificing feel. The iSeries proprietary constant taper design adds to the overall stability while maximizing energy transfer. The tip technology enables ACCRA fitters to mix weights and kick points to create “flighted” sets. Whether you are an accomplished golfer or a weekend warrior, the ACCRA iSeries can be customized to help you reach your potential.\r\n\r\niSeries iron shafts come in 40, 50, 60, 70 & 80 weight\r\n\r\nACCRA iSeries iron shafts feature many aspects of previous ACCRA iSeries shafts, but most importantly, ACCRA engineers have added a added weight as a fitting variable. Once a weight is selected, each weight can be adjusted to, up to, five different flexes. A certified ACCRA fitter also possesses to ability to create a set of flighted iron shafts by mixing two to three different weights within a set.\r\n\r\nThe new ACCRA iSeries features the same high modulus composite materials to ensure a smooth feel and enhanced performance. We have engineered a shaft that offers unsurpassed stability for tight dispersion without sacrificing feel. The iSeries proprietary constant taper design adds to the overall stability while maximizing energy transfer.\r\n\r\nThe ACCRA iSeries tip technology enables ACCRA fitters to mix weights and kick points. Whether you are an accomplished golfer or a weekend warrior, the ACCRA iSeries can be customized to help you reach your potential.  This is for 1 shaft only!\r\n<p><span style="font-size: medium;">&nbsp;</span></p>'),
(195, 76, 0, 64, '<p><span style="font-size: medium;">This is for a new Accra Golf Iron shaft of your choice built to your specs. As always everything we sell comes with a satisfaction  guarantee.</span></p>'),
(196, 85, 0, 64, 'Accra Golf Iron Shaft'),
(197, 75, 0, 65, '<p><span style="font-size: medium;">NEW Graphite Design Tour AD IZ Shaft. These are graphite designs newest shaft, they were just released. &nbsp;The <i>Tour AD IZ</i>, like all of the premium Tour AD wood shafts, utilizes premium, aerospace quality 50t carbon-fiber materials in order to deliver the best feeling and performing shaft available to golfers. &nbsp;&nbsp;The new <i>Tour AD IZ </i>shaft has a firm stiffness starting at the handle, and medium center section and a firm+ tip profile to promote a high launch angle and low ball spin rates. The new <i>Tour AD IZ </i>also utilizes TORAYCA&reg; T1100G carbon-fiber pre-preg with NANOALLOY&reg; technology in the tip section of the shaft for additional shaft stability, exceptional feel and precise ball control. &nbsp;Additionally, Graphite Design will offer a 50 gram X Flex within the IZ model line-up for the first time.</span></p>\r\n<p><span style="font-size: medium;">These are similar to the very popular DI shaft, they are slightly softer in the tip but then slightly stiffer in the butt versus the DI and TP. &nbsp;They come finished in an amazing looking Matte Black finish with Orange and Silver accents. &nbsp;We are an authorized Graphite Design dealer, every shaft we sell is guaranteed 100% legit and comes with a full warranty and satisfaction guarantee! This shaft will come installed in any tip of your choice as well as a grip. These are very popular shafts on tour.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: medium;"><a title="Blog " href="https://thepeoplesclubs.com/blog/IZ/">Make sure you check out our blog for more information and reviews.&nbsp;</a></span></p>\r\n<p><a title="GOLFWRX" href="http://www.golfwrx.com/523544/the-8-hottest-driver-shafts-of-2018-on-the-pga-tour/?utm_source=Front&amp;utm_medium=Featured_Trending&amp;utm_campaign=GolfWRX_OnSite&amp;utm_content=unused"><span style="font-size: medium;">Check out our friends at GOLFWRX for their opinions on the IZ. </span></a></p>'),
(198, 76, 0, 65, '<p><span style="font-size: medium;">This is for a new Graphite Design TOUR AD IZ shaft built to your specs. This will include the shaft, tip, grip and a free gift! Keep in mind everything we sell comes with a full warranty and satisfaction guarantee. </span></p>'),
(199, 85, 0, 65, 'Graphite Design TOUR AD IZ'),
(200, 75, 0, 66, '<p>&lt;p&gt;&lt;span style="font-size: medium;"&gt;NEW Project X Even Flow Shaft. These come in two different shafts a Black and a Blue. The Black is low launch and spin and then the blue is mid/high launch and mid spin. This shaft is hand made in San Diego, CA. The Even Flow has an amazing feel, one of the best feeling shafts Project X has ever made. The blue is the fastest growing shaft on tour currently, they are getting 3 to 1 play over the black. &amp;nbsp;These are being played by several top pros including Adam Scott, Ernie Els, and several others.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;<br />&lt;p&gt;&amp;nbsp;&lt;/p&gt;<br />&lt;p&gt;&lt;a title="Even Flow " href="http://www.golfwrx.com/451286/a-focus-on-feel-project-x-launches-new-even-flow-shafts/"&gt;&lt;span style="font-size: medium;"&gt;See what our friends at GolfWRX have to say about them.&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;</p>'),
(201, 76, 0, 66, '<p>This is for a NEW Project X Even Flow with a tip and grip of your choice.</p>'),
(202, 85, 0, 66, 'Project X Even Flow Shaft'),
(203, 75, 0, 67, '<p><span style="font-size: medium;">The SLAY Series is the newest addition to VA Composites’ line of high performance composite golf shafts. SLAY features a multi-material design made with the industries most exotic materials from Japan. By utilizing these materials, VA Composites is able to offer the most advanced and versatile shafts in golf. SLAY’s unique design fits a wide variety of golfers and is offered in various weights and torques ranging from 55 grams to 85 grams. SLAY boasts high launch and low spin playing characteristics allowing golfers to achieve tighter dispersion and more distance. VA Composites is redefining the golf shaft and we are taking performance to an entirely new level!\r\n<p><span style="font-size: medium;">&nbsp;</span></p>'),
(204, 76, 0, 67, '<p><span style="font-size: medium;">This is for a new VA Composites Slay shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.</span></p>'),
(205, 85, 0, 67, 'VA Composites Slay Shaft '),
(206, 75, 0, 68, '<p>&nbsp;</p>\r\n<p><span style="font-size: medium;">The newest in a long line of Speeders, the&nbsp;<strong>Speeder Evolution IV</strong>, is developed with the most advanced technologies in the graphite shaft industry. Building on the performance, engineering and material integrations of the Evo II and Evo III, the Evo IV sets the new standard. The IV is based on the profile of the II (low launch and low spin), but has a slightly softer mid to tip section to increase launch angle while maintaining low torque/spin with added high-strength materials.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: medium;">The materials and engineering processes that make up the IV are more advanced than any Speeder that came before. New technologies include a new High-strength intermediate modulus (IM) material, for lightweight stability and a new &ldquo;Engineered Outer Bias Technology&rdquo; that creates smoother loading feel. Technologies that carry over from previous Evolution shafts include MCT (Metal Composite Technology), 90 Ton Carbon Fiber for ultra-lightweight stability and Maximum Carbon Fiber Content (MCFC) pre-preg material.</span></p>\r\n<p><span style="font-size: medium;">Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Evo 4 please ask! </span><br /><br /><span style="font-size: medium;"> Here are some reviews on the Evo 4.</span></p>\r\n<p><span style="font-size: medium;"><a title="GolfWRX" href="http://www.golfwrx.com/471568/fujikura-officially-introduces-speeder-evolution-iv-shafts/">GolfWRX</a></span></p>\r\n<p><a title="Golf Digest" href="https://www.golfdigest.com/story/fujikura-speeder-evolution-iv-continues-shaft-platform-that-been-a-presence-on-tour-since-the-1990s"><span style="font-size: medium;">Golf Digest</span></a></p>\r\n<p>&nbsp;</p>'),
(207, 76, 0, 68, '<p><span style="font-size: medium;">This is for a new Fujikura Speeder EVOLUTION 4 shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</span></p>'),
(208, 85, 0, 68, 'Fujikura Speeder EVOLUTION 4'),
(209, 75, 0, 69, '<p><span style="font-size: medium;">NEW Fujikura ATMOS Tour Spec Patriot Edition Shaft. &nbsp;New for 2018, these are a completely redesigned proffile based off the black however with a softer tip resulting in a slightly higher launch and increased feel. &nbsp;</span></p>\r\n<p><span style="font-size: medium;">Included is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Fujikura Atmos please ask!&nbsp;</span></p>\r\n<p><br /><span style="font-size: medium;"> Here are some reviews on the Fujikura Atmos.</span></p>\r\n<p><span style="font-size: medium;"><a title="ATMOS" href="http://www.golfwrx.com/forums/topic/1427888-fujikura-atmos/">GolfWRX&nbsp;Discussion</a></span></p>\r\n<p><span style="font-size: medium;"><a title="ATMOS" href="http://www.golfwrx.com/422898/fujikura-launches-new-atmos-tour-spec-shafts-on-pga-tour/">GolfWRX Review</a></span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>'),
(210, 76, 0, 69, '<p><span style="font-size: medium;">This is for a new Fujikura ATMOS Tour Spec Patriot Edition shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</span></p>'),
(211, 85, 0, 69, NULL),
(213, 75, 0, 70, '<p><span style="font-size: medium;">The Tensei Hybrid now comes in four different profiles, white, orange, blue and red. This shaft will be brand new and built to your specs. This will come with a tip of your choice and a grip of your choice. &nbsp;If you have any questions please ask. </span></p>\r\n<p><span style="font-size: medium;"><strong>TENSEI&trade; CK Series Pro Orange</strong> Hybrid profile is the first high-balance point hybrid shaft to be developed by MCA GOLF and the final profile in the CK Pro Series Hybrid offerings. The multi-material design includes an extended Carbon Fiber/DuPont&trade; Kevlar&reg; (CK) weave in the butt-section, Tungsten Infused Prepreg to provide a higher-balance point, and a reinforced tip-section to provide superior stability, control, and feel.</span></p>\r\n<p><span style="font-size: medium;"><strong>TENSEI&trade; CK Pro White</strong> Hybrid expands the TENSEI&trade; CK Pro Series &ndash; which features a multi-material design that incorporates more performance-oriented materials than we&rsquo;ve ever used in a hybrid shaft. Building off of the same tour proven low launching, low spinning profile, used in TENSEI&trade; CK Pro White, TENSEI&trade; CK Pro White Hybrid incorporates three times the Carbon Fiber/DuPont&trade; Kevlar&reg; (CK) weave in the butt-section &ndash; providing extreme control, enhanced stability, and maximum feel.</span></p>\r\n<p><span style="font-size: medium;"><strong>TENSEI&trade; CK Pro Blue</strong> Hybrid expands the TENSEI&trade; CK Pro Series &ndash; which features a multi-material design that incorporates more performance-oriented materials than we&rsquo;ve ever used in a hybrid shaft. Building off of the same tour proven classic, smooth bend profile, used in TENSEI&trade; CK Pro Blue, TENSEI&trade; CK Pro Blue Hybrid incorporates three times the Carbon Fiber/DuPont&trade; Kevlar&reg; (CK) weave in the butt-section &ndash; providing extreme versatility, enhanced stability and maximum feel.</span></p>\r\n<p><span style="font-size: medium;"><strong>TENSEI&trade; CK Pro Red</strong> Hybrid expands the TENSEI&trade; CK Pro Series &ndash; which features a multi-material design that incorporates more performance-oriented materials than we&rsquo;ve ever used in a hybrid shaft. Building off of the higher launching, performance oriented profile, used in TENSEI&trade; CK Pro Red, TENSEI&trade; CK Pro Red Hybrid incorporates three times the Carbon Fiber/DuPont&trade; Kevlar&reg; (CK) weave in the butt-section &ndash; providing extreme playability, enhanced stability, and maximum feel. </span></p>'),
(214, 76, 0, 70, 'This is for a NEW Prototype Mitsubishi Tensei CK Hybrid. This will come built to your specs with the tip and grip of your choice.  As always everything we sell comes with a satisfaction guarantee. '),
(215, 85, 0, 70, 'NEW Prototype Mitsubishi Tensei CK Pro Hybrid '),
(216, 75, 0, 71, '<p><span style="font-size: medium;">NEW for 2018, we&rsquo;re excited to introduce the higher launching and softer profile ATMOS. The ATMOS has a similar design profile to the Tour Spec version, but is geared towards fitting a wider spectrum of golfers. The ATMOS has a consistent, smooth feel and is available only in the red and blue launch profile to signify the higher flight and spin. &nbsp;</span></p>\r\n<p><span style="font-size: medium;">Included is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Fujikura Atmos please ask!&nbsp;</span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>'),
(217, 76, 0, 71, '<p><span style="font-size: medium;">This is for a new Fujikura ATMOS shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</span></p>'),
(218, 85, 0, 71, 'Fujikura ATMOS'),
(219, 75, 0, 72, '<p><span style="font-size: medium;">The PRO Series is Fujikura’s most popular, playable and easy-to-fit line of performance shafts. Using proprietary enso® technology, the PRO 2.0 features a lower loading section to increase launch, lower torque to reduce spin and a bold, modernized design to turn heads. It’s ideal for golfers of all skill levels, and available in Tour Spec for more aggressive swing tempos to deliver lower ball flight and spin. &nbsp;</span></p>\r\n<p><span style="font-size: medium;">Included is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Fujikura Atmos please ask!&nbsp;</span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>'),
(220, 76, 0, 72, '<p><span style="font-size: medium;">This is for a New Fujikura Pro 2.0 shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</span></p>'),
(223, 75, 0, 73, '<p><span style="font-size: medium;">Miura&rsquo;s MC Collection MC-501 irons were created to improve ball contact and control to appeal beyond the low handicapped player. </span></p>\r\n<p><span style="font-size: medium;">Compared to its traditional blade irons, the MC-501 is the longest blade model ever produced by Miura for blade and cavity back players who want to improve off-center strikes.</span></p>\r\n<p><span style="font-size: medium;">The MC-501 irons are available in 3-PW however we can do any set make up you want. These will come built to your specs with the shafts and grips of your choice which is included in the price. Graphite shafts would be slightly more. &nbsp;Email us to discuss your next build.&nbsp;</span></p>\r\n<p><span style="font-size: medium;"><a title="Black 501" href="https://thepeoplesclubs.com/miurablack501.html">We now have these in Black!</a>&nbsp;</span><a title="MC 501 RAW" href="https://thepeoplesclubs.com/miurablack501-1637.html"><span style="font-size: medium;">As well as RAW!&nbsp;</span></a></p>'),
(224, 76, 0, 73, 'This is for a set of Miura MC-501 3-PW Irons. These will come built to your specs and come with our satisfaction guarantee. '),
(225, 85, 0, 73, 'miura, miura golf, forged, MC-501, MB-101, MB-001 MC 501, MB 101, MB 001, MC501, MB101, MB001, Japan Forged, Hand Made, Katsuhiro Miura, JDM'),
(226, 75, 0, 74, '<p>The team in the R&amp;D lab at Graphite Design Japan went all out when designing the new Graphite Design MAD wood shafts. A challenge was issued to them to design a shaft that would alleviate the ill-fated golf ball flight issues that results in a lack of Maximum Accuracy and Distance. Accepting the challenge, they went to work in an effort to develop a cure. The new Graphite Design MAD shaft is their response. Available in two strengths, the Graphite Design MAD Standard strength wood shafts are available in a 45g A and R Flex, 55g R and S Flex, 65g R and S Flex and a 70g S Flex and is designed for the intermediate to advance players. The Graphite Design MAD PRO strength wood shafts are available in 65g S and X Flex and 75g X Flex and is designed for the advanced to professional players with higher swing speeds.</p>'),
(227, 76, 0, 74, '<p><span style="font-size: medium;">This is for a New Graphite Design MAD shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</span></p>'),
(228, 85, 0, 74, 'Graphite Design MAD'),
(229, 75, 0, 75, '<p><span style="font-size: medium;">Brand new for 2018, the new PRO iron shafts are able to achieve steel shaft weighted swing weights. This shaft is able to hold a consistent swing weight throughout the set when trimmed to length. This should allow you to benefit from the feel and vibration dampening that graphite shafts offer, while maintaining swing weights. </span></p>\r\n\r\n<p><span style="font-size: medium;">Made using Fujikura''s High Density Composite Core (HDCC), the shaft provides an optimum club swing weight throughout the iron set. Unlike heavier composite irons, the PRO uses lighter weight composite in the shafts structure for improved feedback to the golfer. This equates to more Power, Accuracy and Control on all your shots.</span></p>'),
(230, 76, 0, 75, '<p>The Fujikura Pro Iron is built with 40 ton carbon fiber and Fujikura''s HDCC throughout the shaft''s core.</p>'),
(231, 85, 0, 75, 'Fujikura PRO Iron'),
(232, 85, 0, 76, 'Hot Melt Golf Services'),
(233, 75, 0, 76, '<p><span style="font-size: medium;">Hot Melt treatment is used in touring professionals clubs to add weight, create a bias, repair or prevent rattles, promote a better feel and also to mute the sound. The Peoples Clubs can do this tour service for you for $50. This is done on any new club purchase from us for free. We will email you the instructions after purchasing. <strong><br /></strong></span></p>\r\n<p><iframe style="border: none; overflow: hidden;" src="https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2Fthepeoplesclubs%2Fvideos%2F1558579200882506%2F&amp;show_text=0&amp;width=267" width="267" height="476"></iframe></p>\r\n<p> </p>\r\n<p><span style="font-size: medium;"><strong>Here is what a few of our customers thought:</strong></span></p>\r\n<p><span style="font-size: medium;">"I got to get out and hit my rogue with that SLDR head you hot melted for me. I really like both of them. The Rogue feels awesome and I love the sound of that hot melted head. Thanks again!" - Ryan in New England.</span></p>\r\n<p><span style="font-size: medium;">"I once thought that hot melting was a luxury only for professional golfers. Now I can''t imagine hitting a driver without it. The amazing feel and sound of the hot melted club inspire confidence with each swing" -Jason in Tennessee</span></p>'),
(234, 76, 0, 76, '<p><span style="font-size: medium;">Hot Melt is a process of adding an adhesive to the inside of a golf club head. We are the best at performing this service. After purchasing we will email you the instructions.</span></p>'),
(235, 75, 0, 77, '<p><span style="font-size: medium;">The new Miura Tour Series Wedge provides the legendary Miura feel that golfers covet. This wedge does not chase distance, but rather the precision and control necessary for scoring. It is the first from Miura to use CNC milling for the face and grooves, allowing for ultimate spin control. The Miura Tour Wedge is designed with a hollow back shape to create a higher center of gravity. The unique distribution of weight produces a stable trajectory while still allowing the player the ability to flight the shot, if necessary. </span></p>\r\n<p><span style="font-size: medium;">Like all clubs forged by Miura, the grain structure within the club head is the tightest in the industry. This creates less dispersion on off-center hits, as well as provides control from all lies and conditions. The head design of the Tour Wedge will match any Miura model. Its size and shape is best suited for the CB57, MB-001, CB-1008, and the new MC-501.</span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs and will include any necessary bending, as well as the shaft and grip of your choice. &nbsp;Stamping and paint fill options available as well. &nbsp;If you have any questions please <a href="mailto:info@thepeoplesclubs.com%20" title="Email Us ">email us</a> to discuss. &nbsp;</span></p>\r\n<p><span style="font-size: medium;">'),
(236, 76, 0, 77, '<p><span style="font-size: medium;">These new Miura Tour Series Wedge will come built to your specs, and with the shaft and grip of your choice.</span></p>'),
(237, 85, 0, 77, 'Miura Tour Series Wedge'),
(238, 75, 0, 78, '<p><span style="font-size: medium;">In the new XD shaft, Mitsubishi has taken the TiNi Wire and increased its length by 1.5 times along the outer layer. The design lowers launch and spin, and delivers a new level of stability and control. The KURO KAGE&trade; XD comes in a premium ion plated finish.</span></p>\r\n<p><span style="font-size: medium;">If you have any questions please ask. These will come with a tip and grip of your choice.&nbsp;</span></p>'),
(239, 76, 0, 78, '<p>NEW Mitsubishi Kuro Kage XD Shaft</p>'),
(240, 85, 0, 78, 'NEW Mitsubishi Kuro Kage XD Shaft'),
(241, 75, 0, 79, '<p><span style="font-size: medium;">Inspired by the smooth and effortless power of a crashing wave, EvenFlow features an even bend profile that transfers shaft load more efficiently for maximum energy release on impact. EvenFlow Max Carry has the softest tip and highest launching/spinning profile in the EvenFlow family and is ideal for players looking for increased carry and distance. EvenFlow Max Carry features a high-spin and high-launch profile.</span></p>'),
(242, 76, 0, 79, '<p><span style="font-size: medium;">This is for a Project X Even Flow Max Carry shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</span></p>'),
(243, 85, 0, 79, 'Project X Even Flow Max Carry'),
(244, 75, 0, 80, '<p><span style="font-size: medium;">Introducing New Fujikura Speeder TR Shaft which born from tour player request. It is a new lower launch and lower spin speeder series shaft.</span></p>\r\n<p><span style="font-size: medium;">Fujikura pursued a new and improved EI profile for the top players in the world to maximize their power through improved kick speed. By stiffening the middle section of the shaft and providing the proper bending on Butt and Tip side, it achieves more carry and total distance with a Mid-low launch and low spin. New multi-plied hoop layers and 90-ton carbon fiber provide better stability and clubhead speed.</span></p>\r\n<p><span style="font-size: medium;">TR was developed with Tour players in mind. Fujikura Tour rep was looking for a shaft profile to give the players more control and consistency. Extensive testing with Tour players took place until Fujikura Tour reps achieved the results they were looking for.</span></p>\r\n<p><span style="font-size: medium;">The goal of TR was to generate kick speed through a new EI profile with a stiff mid section, but softer butt and tip for extra acceleration of the clubhead to the ball. This new EI resulted in better speed at impact combined with lower launch and spin to suit Tour player swings.</span></p>\r\n<p><span style="font-size: medium;">Compared to Speeder Evolution TS (which has a similar kick point), The Speeder TR has a more effective loading zone (softer handle) to store more energy in the downswing translating to more clubhead speed and better launch.</span></p>\r\n<p><span style="font-size: medium;">By applying multi hoop plied structure technology and 90tons carbon sheet, it balances better stability and driving performance.</span></p>'),
(245, 76, 0, 80, '<p>This is for a new Fujikura Speeder TR , this will come built to your specs and also comes with our satisfaction guarantee.</p>'),
(246, 85, 0, 80, 'Fujikura Speeder TR '),
(247, 75, 0, 81, '<p>When comparing graphite shafts with steel shafts, graphite&rsquo;s center of gravity is located on the butt side of the club which affects the ability to achieve a desirable swing balance. In order to improve this, additional materials are wound on the tip side to add weight. This creates greater balance, but also higher rigidity overall. In the new MCI (Metal Composite Irons), Metal Composite Technology was developed to combine the best attributes of steel and graphite into one revolutionary composite shaft. Increased hitting ability, even weight distribution, and individual length brings perfect flow of frequency and torque within your swing.</p>\r\n<p>We can also get the black however please note these are custom ordered from Japan and will take longer. &nbsp;Email us to discuss.&nbsp;</p>\r\n<p>This is for 1 shaft. Included in the auction is the install of this shaft in your club with a free grip. &nbsp;We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the MCIs please ask!</p>\r\n<p><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
(248, 76, 0, 81, '<p>This is for a new MCI shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.</p>'),
(251, 75, 0, 82, '<p><span style="font-size: medium;">New Miura Golf Hat. These are brand new, never used. These are made by Imperial, these come in one size fits all and have a velcro back. We also have them in several different colors. </span></p>'),
(252, 76, 0, 82, '<p><span style="font-size: medium;">Miura Golf Hat </span></p>'),
(253, 85, 0, 82, 'Miura Golf Hat');
file to provide unmatched feel and maximum energy transfer. Riptide features Torsional Stability Optimization which allows for an extremely stable shaft while maintaining the signature smooth EvenFlow feel.</span></p>\r\n<p><span style="font-size: medium;">EvenFlow Riptide CB brings a counter-balanced design to the EvenFlow family. With similar playability characteristics to the non counter-balanced Riptide, Riptide CB is designed with improved stability that builds on the widely successful &ldquo;even bend&rdquo; profile to provide unmatched feel and maximum energy transfer. Riptide CB also features Torsional Stability Optimization which allows for an extremely stable shaft while maintaining the signature smooth EvenFlow feel.</span></p>\r\n<p><span style="font-size: medium;">As always this will come built in house by a trained member of our staff and will come with the tip and grip of your choice as well as a full satisfaction guarantee.&nbsp;</span></p>\r\n<p>&nbsp;</p>'),
(580, 76, 0, 210, '<p>This is for a NEW Project X Even Flow Riptide with a tip and grip of your choice.</p>'),
(581, 85, 0, 210, 'Project X Even Flow Riptide Shaft'),
(582, 85, 0, 211, 'VA Composites NEMESYS Shaft '),
(583, 75, 0, 212, '<p><span style="font-size: medium;">The Miura TC-201 golf irons offer the performance of a muscle back with the increased forgiveness of a cavity back. The progressive weighting in the sole provides a lower center of gravity in the long irons for added height and higher trajectory on longer shots. Slightly changing to a higher center of gravity in the short irons creates a lower trajectory and more control on shorter shots. Constant weight towards the heel and toe helps with off center shots. </span></p>\r\n<p><span style="font-size: medium;">The sole design contributes significantly to the playability and forgiveness of this club and the minimal offset paired with the top line at address inspires confidence. The Miura TC-201 is a player&rsquo;s iron that acts as a replacement for the CB-1008 and perfectly complements the MB-101. &nbsp;</span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs in house by one our trained master club builders. &nbsp;These will also come with the shafts and grips of your choice. &nbsp;We also have demos available in these, <a href="mailto:will@peoples.golf" title="Email Us ">email us</a> to discuss your next build.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">At The Peoples Clubs, we guarantee your satisfaction. If you want to work on a custom build please message us, we specialize in custom tour issue and retail builds.</span></p>'),
(584, 76, 0, 212, '<p>&lt;p&gt;&lt;span style="font-size: medium;"&gt;Miura TC-201 3-PW Irons with shafts and grips of your choice&lt;/span&gt;&lt;/p&gt;</p>'),
(585, 85, 0, 212, 'Miura TC-201 3-PW '),
(586, 75, 0, 213, '<p><span style="font-size: medium;">T//World golf clubs are beautifully crafted performance products that deliver precision and power. T//World Rose Proto Irons provide PGA Tour validated looks and performance in a pure muscle back forged iron designed specifically for Justin Rose. &nbsp;</span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs in house by one our trained master club builders. &nbsp;These will also come with the shafts and grips of your choice. &nbsp;</span></p>'),
(587, 76, 0, 213, '<p><span style="font-size: medium;">Honma T//World Rose Proto MB 3-PW Irons with shafts and grips of your choice</span></p>'),
(588, 85, 0, 213, 'Honma T//World Rose Proto MB 3-PW Irons '),
(589, 75, 0, 214, '<p><span style="font-size: medium;">T//World golf clubs are beautifully crafted performance products that deliver precision and power. T//World 747 V Irons are pure cavity back forged blade iron that provide distance with solid feel and controlled ball flight. &nbsp;</span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs in house by one our trained master club builders. &nbsp;These will also come with the shafts and grips of your choice. &nbsp;</span></p>'),
