(640, 75, 0, 239, '<p><span style="font-size: medium;">This is for a new Honma XP-1 Driver built to your specs with the shaft of your choice. This will come custom built in house by one of our trained master club builders. It will come fully built to your desired specifications and also comes with a grip of your choice.&nbsp; A headcover and wrench will also be included. If you would like to discuss a build <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a>&nbsp; The website will not take the build specs, we will email you after purchasing to obtain this info, please have the specs ready to provide or email them after purchasing.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">These are our recommended shafts for 2020.&nbsp; If you want a different shaft please email us for a quote.&nbsp; We can get pretty much anything.&nbsp; If you need a recommendation as to which shaft would best fit you <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a></span></p>'),
(641, 76, 0, 239, '<p><span style="font-size: medium;">YOU ARE PURCHASING A BRAND NEW HONMA DRIVER FULLY CUSTOMIZED WITH A SHAFT OF YOUR CHOICE. THIS CLUB WILL BE CUSTOM BUILT FOR YOU BASED ON A CONSULTATION ANALYZING YOUR SPECIFIC NEEDS.</span></p>'),
