(645, 75, 0, 243, '<div class="txtNew" id="comp-jml4lnpz1" data-packed="false" data-min-height="30">\r\n<p><span style="font-size: medium;">While you were obsessing over every aspect of your game, we were meticulously improving the all-new P790 with forged hollow body construction, SpeedFoam; and a redesigned tungsten weight for optimal CG performance.</span></p>\r\n<p><span style="font-size: medium;">These are being sold as 3-PW however we can do a different set makeup, just email us to discuss.&nbsp; &nbsp;Please allow 2 weeks for us to assemble these. &nbsp;As always everything is built in house by our staff and built to absolute best quality possible. We can also get the Titanium model,&nbsp;<a href="mailto:will@peoples.golf" title="email us">email us to discuss your next build</a>.</span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n</div>'),
(646, 76, 0, 243, '<p>This is for a set of New Taylormade P790 Irons 3-PW, these will come built to your specs and come with our satisfaction guarantee.</p>'),
(647, 85, 0, 243, 'Taylormade P790 Irons 3-PW '),
(648, 75, 0, 244, '<p><span style="font-size: medium;">For the first time ever, KBS is adding a Driver/Wood shaft to the KBS product line. The KBS TD is a lighter and stiffer Driver/Wood shaft with characteristics of the original KBS feel. It is the perfect complement to our already proven performance-driven line of golf shafts now fitting your entire golf bag.</span></p>\r\n<p><span style="font-size: medium;">As always this will come built to your desired specifications in house by a trained member of our staff. &nbsp;This price includes the adapter and grip of your choice.&nbsp;</span></p>'),
(649, 76, 0, 244, '<p>&lt;p&gt;&lt;span style="font-size: medium;"&gt;This is for a new KBS TD Driver/Wood Shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.&lt;/span&gt;&lt;/p&gt;</p>'),
(650, 85, 0, 244, 'KBS TD Driver/Wood Shaft '),
(651, 75, 0, 245, '<p><span style="font-size: medium;"><span>Engineered for speed and backed by stability, Motore X features a reinforced bias core with a torsionally stiffened handle section that promotes faster ball speeds combined with thin layers of full-length bias plies that create a balanced torsional strength for stability. The result &ndash; a core paired with an accelerated taper that transfers more energy, boosting ball speeds for more distance while maintaining stability for tighter shot control.</span></span></p>\r\n<p><span style="font-size: medium;">The new Fujikura Motore X has been very well received both on and off tour. &nbsp; They are currently being used by several top pros including Branden Grace, <span>Xinjun Zhang,&nbsp;<span>Rhein Gibson</span></span>&nbsp;and many more.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">As always this will come fully built to your specifications by a trained member of our staff. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Motore X please ask!</span></p>'),
(652, 76, 0, 245, 'This is for a new Fujikura Motore X shaft of your choice built to your specs. As always everything we sell comes with a full satisfaction guarantee.'),
