(881, 75, 0, 359, '<p><span style="font-size: medium;">NEW TOUR ISSUE Taylormade SIM Driver 8.0* with a Fujikura Ventus Blue 6S. This is new never used. These are extremely rare and very popular on tour right now. This is shafted with a Fujikura Ventus Blue 6S, we can do a different Ventus shaft if you would prefer. These tour heads are hand picked for tour use, based on better specs or a hotter face. Finally hot melted on the tour van. Almost every pro has already changed over to these. No headcover included with this one. The specs are 45", D2, 8.5, 1.25 open, TV 360. If you need a different lofted head or a different weight or flex shaft just let us know.  As always we are more than willing to accommodate the needs of our customers. We have all of the new 2020 heads available so if you would like to discuss a custom build <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a> As always everything we sell is 100% legit and comes with a satisfaction guarantee. </span></p>'),
