(893, 85, 0, 362, 'Honma TR20 V 4-PW Irons '),
(894, 75, 0, 363, '<p><span style="font-size: medium;">TR20 Irons deliver beautifully crafted performance with hand-shaped profiles and tour level performance.  Honma’s experienced Takumi combine traditional blade shapes with modern topline and sole proportions, and high performance back designs. &nbsp;</span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs in house by one our trained master club builders. &nbsp;These will also come with the shafts and grips of your choice. &nbsp;</span></p>'),
(895, 76, 0, 363, '<p><span style="font-size: medium;">Honma TR20 P 4-PW Irons with shafts and grips of your choice.</span></p>'),
(896, 85, 0, 363, 'Honma TR20 P 4-PW Irons '),
(897, 75, 0, 364, '<div class="txtNew" id="comp-jml4lnpz1" data-packed="false" data-min-height="30">\r\n<p><span style="font-size: medium;"><span>Taylormade added V Steel&trade; to a Rescue&trade; for the first time in TaylorMade history, giving you improved turf interaction and better performance from difficult lies.</span>.</span></p>\r\n<p><span style="font-size: medium;">These are being sold fully built to your specs with the shaft and grip of your choice. &nbsp; Please allow 2 weeks for us to assemble these. &nbsp;As always everything is built in house by our staff and built to absolute best quality possible. <a href="mailto:will@peoples.golf" title="email us">Email us to discuss your next build</a>.</span></p>\r\n<p></p>\r\n</div>'),
(898, 76, 0, 364, 'This is for a new Taylormade SIM Max Hybrid, these will come built to your specs and come with our satisfaction guarantee. '),
(899, 85, 0, 364, 'Taylormade SIM Max Hybrid '),
(900, 75, 0, 365, '<p><span style="font-size: medium;">Now available from TPC is the new Nippon GOST Hybrid shaft. </span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs with the desired adapter and grip of your choice. We can also install these in your hybrid, this is included in the price.&nbsp;</span></p>'),
(901, 76, 0, 365, '<p><span style="font-size: medium;">Nippon NS Pro Modus 3 GOST Hybrid Shaft </span></p>'),
(902, 85, 0, 365, 'Nippon NS Pro Modus 3 GOST Hybrid Shaft '),
(903, 75, 0, 366, '<p><span style="font-size: medium;">ALDILA&reg; RIPX&reg; marks the return of one of ALDILA&reg; Golf&rsquo;s most revolutionary and iconic brands. Integrating the Reverse Inter-Laminar Placement (R.I.P.) Technology, RIPX&reg;&nbsp; takes stability to a whole new level. An innovative profile balances an even stiffer butt section with an increase in torque to create a shaft that feels both incredibly stable in the player&rsquo;s hands and highly responsive at impact. A MICRO MAMBA&reg;&nbsp;TECHNOLOGY&nbsp;&ndash; 50% thinner and 50% lighter than the original MAMBA&reg; TECHNOLOGY &shy;&ndash;&nbsp;is applied from the tip into the mid-section for improved stability and feel over the RIP&nbsp;ALPHA. All wrapped in a bold look that declares that RIPX&reg; means business.</span></p>\r\n<p><span style="font-size: medium;">This will come custom built to your desired specs with a tip and grip of your choice. These are custom ordered so please allow for a little extra time, also please note that overnight shipping might be delayed.</span></p>'),
(904, 76, 0, 366, 'This is for a custom built Aldila RIPX Shaft, this will come built to your specs with a tip and grip of your choice.  Everything we sell also comes with a satisfaction guarantee. '),
(905, 85, 0, 366, 'Aldila RIPX Shaft'),
(906, 75, 0, 367, '<p><span style="font-size: medium;">New Fujikura Rope cap. This lightweight cap is made by Imperial and is 97% polyester. One size fits all.&nbsp;</span></p>'),
(907, 76, 0, 367, '<p><span style="font-size: medium;">Fujikura Rope Hat </span></p>'),
(908, 85, 0, 367, 'Fujikura Rope Hat '),
(909, 75, 0, 368, '<p><span style="font-size: medium;">This shaft will be brand new and built to your specs in house by a trained member of our staff. This will come with a tip of your choice and a grip of your choice. &nbsp;If you have any questions please ask.</span></p>\r\n<p><span style="font-size: medium;">TENSEI&trade; AV RAW White blends modern performance with a stiff-tip, low-launch profile. The RAW finish reveals the Aluminum Vapor (AV) Coated Weave in the butt section, a visible cue of the added stability this unique weave provides. Power transfers straight from the hands through the ball for low, piercing flight.</span></p>\r\n<p><span style="font-size: medium;">TENSEI&trade; AV RAW White is best for stronger players who want a stiffer-tipped, lower-launching ball flight with a feeling of greater stability and control throughout the swing.</span></p>\r\n<p><span style="font-size: medium;">TENSEI&trade; AV RAW Orange is a Counter-Balanced shaft that shifts the balance point towards the hands, giving players the opportunity to make specific performance adjustments by altering shaft length or adding weight to the clubhead. The RAW finish reveals the Aluminum Vapor (AV) Coated Weave in the butt section, a visible cue of the added stability this unique weave provides. Power transfers straight from the hands through the ball for consistent, mid-launching flight.</span></p>\r\n<p><span style="font-size: medium;">TENSEI&trade; AV RAW Orange is a Counter-Balanced shaft for players making specific weight adjustments, who want to feel greater stability and control throughout the swing.</span></p>\r\n<p><span style="font-size: medium;">TENSEI&trade; AV RAW Blue blends modern performance with a classic, smooth bend profile. The RAW finish reveals the Aluminum Vapor (AV) Coated Weave in the butt section, a visible cue of the added stability this unique weave provides. Power transfers straight from the hands through the ball for a consistent, mid-launching flight. The 55g option includes our Straight Flight Weighting (SFW) system which makes it easier to turn the club over through impact, reducing the tendency to fade the ball or even promoting a slight draw.</span></p>\r\n<p><span style="font-size: medium;">TENSEI&trade; AV RAW Blue is best for players who want a mid-launching ball flight with a feeling of greater stability and control throughout the swing.</span><br /><br /></p>\r\n<p></p>This is for a Mitsubishi Tensei AV RAW (White, Orange, or Blue.) This will come built to your specs with the tip and grip of your choice.'),
(910, 76, 0, 368, '<p>This is for a Mitsubishi Tensei AV RAW (White, Orange, or Blue.) This will come built to your specs with the tip and grip of your choice.</p>'),
(911, 85, 0, 368, 'Mitsubishi Tensei AV RAW (White, Orange, or Blue)'),
(912, 75, 0, 369, '<p><span style="font-size: medium;">NEW TOUR ISSUE Taylormade SIM Driver 10.5* with a Mitsubishi Tensei Pro White 60 Stiff. This is new never used. These are extremely rare and very popular on tour right now. This is shafted with a Pro Tensei White 60S shaft, these shafts are low launching and spinning.  The tour heads are hand picked for tour use, based on better specs or a hotter face. Finally hot melted on the tour van. Almost every pro has already changed over to these. No headcover included with this one. The specs are 45", D2, 10.6, 1 open, TV BCT. If you need a different lofted head or a different weight or flex shaft just let us know.  As always we are more than willing to accommodate the needs of our customers. We have all of the new 2020 heads available so if you would like to discuss a custom build <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a> As always everything we sell is 100% legit and comes with a satisfaction guarantee. </span></p>'),
(913, 76, 0, 369, '<p><span style="font-size: medium;">This is for a NEW TOUR ISSUE TAYLORMADE SIM 10.5 w/ Mitsubishi Tensei Pro White 60S.  As always everything comes with a satisfaction guarantee.</span></p>'),
(914, 85, 0, 369, 'TOUR ISSUE TAYLORMADE SIM 10.5 w/ Mitsubishi Tensei Pro White 60S'),
(915, 85, 0, 370, 'TOUR ISSUE TAYLORMADE SIM 10.5 w/ Project X EvenFlow White T1100 65X X-Stiff'),
(916, 75, 0, 371, '<p><span style="font-size: medium;">SIM Max Driver 8* with a Tensei AV White 65 Tour X-Stiff. This is new never used. These are extremely rare and very popular on tour right now. This is shafted with a Tensei White AV Raw 65TX shaft, these shafts are low launching and spinning.  The tour heads are hand picked for tour use, based on better specs or a hotter face. Finally hot melted on the tour van. Almost every pro has already changed over to these. No headcover included with this one. The specs are 45", D2, 8.2, 1 open, Midsize Black Tour Wrap (logo down.) If you need a different lofted head or a different weight or flex shaft just let us know.  As always we are more than willing to accommodate the needs of our customers. We have all of the new 2020 heads available so if you would like to discuss a custom build <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a> As always everything we sell is 100% legit and comes with a satisfaction guarantee. </span></p>'),
(917, 76, 0, 371, '<p><span style="font-size: medium;">This is for a NEW TOUR ISSUE TAYLORMADE SIM MAX 8.0 w/ Tensei AV RAW White 65 Tour X-Stiff.  As always everything comes with a satisfaction guarantee.</span></p>'),
(918, 85, 0, 371, 'TOUR ISSUE TAYLORMADE SIM MAX 8.0 w/ Tensei AV RAW White 65 Tour X-Stiff'),
(919, 75, 0, 372, '<div class="txtNew" id="comp-jml4lnpz1" data-packed="false" data-min-height="30">\r\n<p><span style="font-size: medium;"><span>Taylormade added V Steel&trade; to a Rescue&trade; for the first time in TaylorMade history, giving you improved turf interaction and better performance from difficult lies.</span>.</span></p>\r\n<p><span style="font-size: medium;">These are being sold fully built to your specs with the shaft and grip of your choice or as head only. &nbsp;These are in stock and ready to ship! &nbsp;As always everything is built in house by our staff and built to absolute best quality possible. <a href="mailto:will@peoples.golf" title="email us">Email us to discuss your next build</a>.</span></p>\r\n<p></p>\r\n</div>'),
(920, 76, 0, 372, '<p>This is for a new Taylormade SIM Max Hybrid, these will come built to your specs and come with our satisfaction guarantee.</p>'),
(921, 85, 0, 372, 'New Tour Issue Taylormade SIM Max 3 Hybrid '),
(922, 85, 0, 373, 'TOUR ISSUE TAYLORMADE SIM MAX 9.0 w/ Mitsubishi D+ LTD 70TX '),
(923, 75, 0, 374, '<p><span style="font-size: medium;">SIM Max Driver 9* with a Vylyn 65 Stiff. This is new never used. These are extremely rare and very popular on tour right now. This is shafted with a VA Vylyn 65 Stiff shaft, these shafts are low launching and spinning.  The tour heads are hand picked for tour use, based on better specs or a hotter face. Finally hot melted on the tour van. Almost every pro has already changed over to these. Headcover included with this one. The specs are 45", D1.5, 9.4, .5 open, Tour Velvet (logo down.) If you need a different lofted head or a different weight or flex shaft just let us know.  As always we are more than willing to accommodate the needs of our customers. We have all of the new 2020 heads available so if you would like to discuss a custom build <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a> As always everything we sell is 100% legit and comes with a satisfaction guarantee. </span></p>'),
(924, 76, 0, 374, '<p><span style="font-size: medium;">This is for a NEW TOUR ISSUE TAYLORMADE SIM MAX 9.0 w/ VA Vylyn 65 Stiff.  As always everything comes with a satisfaction guarantee.</span></p>'),
(925, 85, 0, 374, 'TOUR ISSUE TAYLORMADE SIM MAX 9.0 w/ VA Vylyn 65 Stiff '),
(926, 75, 0, 373, '<p><span style="font-size: medium;">SIM Max Driver 9* with a Mitsubishi D+ LTD 70 Tour X-Stiff. This is new never used. These are extremely rare and very popular on tour right now. This is shafted with a Mitsubishi Diamana D+ 70 TX shaft, these shafts are low launching and spinning.  The tour heads are hand picked for tour use, based on better specs or a hotter face. Finally hot melted on the tour van. Almost every pro has already changed over to these. Headcover included with this one. The specs are 45", D2, 9.5, .75 open, Tour Velvet (logo down.) If you need a different lofted head or a different weight or flex shaft just let us know.  As always we are more than willing to accommodate the needs of our customers. We have all of the new 2020 heads available so if you would like to discuss a custom build <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a> As always everything we sell is 100% legit and comes with a satisfaction guarantee. </span></p>'),
(927, 76, 0, 373, '<p><span style="font-size: medium;">This is for a NEW TOUR ISSUE TAYLORMADE SIM MAX 9.0 w/ Mitsubishi D+ LTD 70TX.  As always everything comes with a satisfaction guarantee.</span></p>');

