INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES
(1, 4, '2020-07-13 16:54:03', 'Deprecation Notice', 'Catalog Search is currently configured to use the MySQL engine, which has been deprecated. Consider migrating to one of\nthe Elasticsearch engines now to ensure there are no service interruptions during your next upgrade.', '', 0, 0),
(2, 4, '2020-07-13 16:54:15', 'Disable Notice', 'To improve performance, collecting statistics for the Magento Report module is disabled by default. \nYou can enable it in System Config.', '', 0, 0),
(3, 4, '2020-07-21 15:55:36', 'Meet the Magento Commerce Interactive Product Experience.', 'Meet the world’s most flexible eCommerce platform by immersing yourself in the Magento Commerce Interactive Product Experience. This interactive simulation demonstrates the powerful functionality helping merchants sustain – and grow – their business. Start Product Tour: https://adobe.ly/3eR7kZ3', 'https://adobe.ly/3eR7kZ3', 0, 0),
(4, 4, '2020-07-28 16:12:12', 'Tell us about your experience with Magento', 'We want to hear from you! Please take a short survey about your experience using Magento Admin. Your feedback will help us improve our products and develop new features.  http://selfserve.decipherinc.com/survey/selfserve/9d5/200508?list=1', 'http://selfserve.decipherinc.com/survey/selfserve/9d5/200508?list=1', 0, 0),
(5, 1, '2020-07-28 16:17:11', 'Magento Open Source 2.4 delivers important security updates and features to accelerate your business in the changing commerce landscape – 7/28/2020', 'The latest releases of Magento Open Source – 2.4 and 2.3.5-p2 – are now available. The latest release of Magento Open Source includes important security enhancements along with new functionality and platform quality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. Learn how this release can help you adapt to the changing commerce landscape at Magento.com/blog.', 'https://devdocs.magento.com/guides/v2.4/release-notes/bk-release-notes.html', 0, 0),
(6, 4, '2020-07-31 16:37:31', 'Is Your Website Selling as Much as It Can? Join our upcoming webinar and learn how to turn your website into a conversion machine.', 'Join us on August 13 for our webinar: Is Your Website Selling As Much As It Can? Digital Strategist Ereika Stimley and eCommerce Consultant Corey Gelato will walk you through a website self-assessment and live demo that will help you uncover opportunities to increase conversions and grow revenues. Register now: https://bit.ly/2PcjcL3', 'https://bit.ly/2PcjcL3', 0, 0);
