INSERT INTO `catalogsearch_fulltext_scope1` (`entity_id`, `attribute_id`, `data_index`) VALUES
(1, 73, 'Fujikura Speeder Tour Spec Hybrid'),
(1, 74, '12'),
(1, 75, 'This will be a custom installed Fujikura Speeder Tour Spec Hybrid shaft of your choice. The Speeder is one of the most popular shafts on tour. A bunch of pros are playing these including Ernie Els, Jim Furyk, Harrington, Zach Johnson, Vijay, these are everywhere. Fujikura shafts have been dominating the driver shaft count this year, mostly in part to the extremely successful Speeder line. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. This auction does not include the tip. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full warranty. If you have any questions please ask.'),
(1, 76, 'New Tour Issue Fujikura Speeder TS Hybrid Shaft'),
(1, 83, 'Fujikura'),
(1, 97, 'Enabled'),
(1, 123, 'tour-issue-fujikura-motore-speeder-tour-spec-hb-hybrid-8-8-9-8-stiff-x-stiff'),
(1, 137, 'Taxable Goods'),
(2, 73, 'Fujikura Motore Speeder Tour Spec 6.2 or 7.2'),
(2, 74, '13'),
(2, 75, 'This will be a custom installed Fujikura Speeder Tour Spec shaft of your choice. The Tour Spec is picking up popularity on tour. Its the lower torque, lower launching, slightly heavier version of the widely popular Speeder VC Series. A bunch of pros are playing these including Mickelson, Michael Bradley, and several others. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. &amp;nbsp;We have all of the tips in stock, all of them! This wil include the labor and a free grip. We are an authroized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full warranty. If you have any questions please ask.'),
(2, 76, 'Fujikura Speeder Tour Spec'),
(2, 83, 'Fujikura'),
