(40, 74, '1013'),
(40, 75, 'NEW Fujikura Speeder Evolution 3. The Evolution 3 is mid launch and spin, they were designed for the golfer looking for tour-level feel and performance, but with flighting and spin that will keep the ball in the air a bit longer. They utilize a metal composite technology, similar to the Evo 2. This allows the wall to be thinner resulting in a better feel without sacrificing the stiffness of the shaft. In our testing we have seen increased ball speed, higher launch, lower spin and best of all more distance! Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Evo 3 please ask! Here are some reviews on the Evo 3. Our Blog GolfWRX Evo 3 Spotted on Tour Plugged In Golf- 661 Plugged In Golf- 757&nbsp;'),
