(42, 75, 'New Tour Issue Mitsubishi Diamana Tensei Shaft. We currently have the Pro Orange, Pro Blue and Pro White in stock. These shafts are getting tons of play both on and off tour. Tiger Woods, Rory McIlroy, Jason Day, Justin Rose, and several others. &nbsp;This shaft will be brand new and built to your specs. This will come with a tip of your choice and a grip of your choice. &nbsp;If you have any questions please ask. &nbsp; &nbsp; Check out our friends at GOLFWRX for their opinions on the Tensei Orange.'),
