(43, 75, 'NEW Graphite Design TP Shaft. These are graphite designs newest shaft. These have the new FTT Fast Taper Technology, resulting in an overall feeling of greater club head control at impact and an increase in club head speed through the swing. They are made with 50T carbon and the new Toray T1100G Graphite, for additional shaft stability, exceptional feel and precise ball control. They are mid to high launch with low spin. Some are calling these a new and improved DI. We are an authorized Graphite Design dealer, every shaft we sell is guaranteed 100% legit and comes with a full warranty and money back guarantee! This shaft will come installed in any tip of your choice as well as a grip. These are very popular shafts on tour. &nbsp; Go here to see our blog on these.&nbsp; Or click here to see what our friends at GOLFWRX though.&nbsp;'),
