(45, 73, 'Tour Only Project X HZRDUS T1100 Shaft'),
(45, 74, '1064'),
(45, 75, 'This is for a New Tour Issue Project X HZRDUS T1100 Shaft. These have been blowing up on tour, they were one of the hottest shafts on tour last year and we''re sure they will be again this year. These have been the number 1 shaft on tour for several weeks. They are made of the Ultra High End T1100 Toray Graphite. This new graphite results in a much better feeling shaft while still being low launching and spinning. These are one of the only golf shafts that are made in the USA. The T1100 shafts are "HandCrafted" in their California manufacturing facility, which ensures the tightest of tolerances. They are finished in a sweet Mirror finish that looks amazing in person. Please email us with any questions.&nbsp; We now have a few of the Tour Only 85 6.5 available.&nbsp; Check out our new blog post on the T1100! Check out our friends at GOLFWRX for their opinions on the T1100.'),
