(46, 75, 'NEW Fujikura ATMOS Tour Spec Shaft. &nbsp;These are new for 2017, they are a revamp of the wildy successful Motore Speeder line. &nbsp;These have been picking up a ton of play on tour. &nbsp;They come in three different unique profiles. &nbsp;They are Black, Blue, and Red. The Black is low launching and spinning. The Blue is mid launch and spin. &nbsp;Then the Red is high launch and spin. &nbsp; Included is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Fujikura Atmos please ask!&nbsp; Here are some reviews on the Fujikura Atmos. GolfWRX&nbsp;Discussion GolfWRX Review Check out our friends at GOLFWRX for their opinions on the Atmos.'),
