(48, 74, '1079'),
(48, 75, 'NEW Fujikura Speeder Platinum. The Platinum Speeder is designed for the skilled golfer who is looking increase swing speed through lighter weight while keeping spin to a minimum. These are made of 90T carbon and Toray 1100G, one of very few shafts using this high end space grade materials. This results in a stable shaft with low spin. These shafts are getting tons of play on tour, they are currently being used by Matt Kuchar, Colt Knost, Justin Hicks, Freddie Jacobson, Scott Brown, and several others. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Speeder Platinum please ask! Here are some reviews on the Platinum Speeder. PGATOUR.com &nbsp;'),
