(49, 73, 'Fujikura MCI Iron Shaft'),
(49, 74, '1080'),
(49, 75, 'When comparing graphite shafts with steel shafts, graphite&rsquo;s center of gravity is located on the butt side of the club which affects the ability to achieve a desirable swing balance. In order to improve this, additional materials are wound on the tip side to add weight. This creates greater balance, but also higher rigidity overall. In the new MCI (Metal Composite Irons), Metal Composite Technology was developed to combine the best attributes of steel and graphite into one revolutionary composite shaft. Increased hitting ability, even weight distribution, and individual length brings perfect flow of frequency and torque within your swing. We can also get the black however please note these are custom ordered from Japan and will take longer. &nbsp;Email us to discuss.&nbsp; This is for 1 shaft. Included in the auction is the install of this shaft in your club with a free grip. &nbsp;We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the MCIs please ask! &nbsp; &nbsp;'),
