(51, 74, '1119'),
(51, 75, 'The KBS Tour Hybrid Graphite Prototype is here. Inspired and designed from the KBS Tour shaft, the most popular steel shaft in the KBS Golf Shaft line, the KBS Tour Graphite Hybrid Prototype offers KBS signature feel, but finally in a graphite shaft model. Offering performance and stability throughout the entire make of the shaft which lets the player hit more aggressive, longer, and consistent shots for hybrid clubs. KBS will be the first shaft brand to create seamless performance transition from your Graphite Hybrid shafts, to your KBS Iron and KBS Wedge shafts.'),
