(52, 73, 'KBS $-Taper Iron Shafts (3-PW)'),
(52, 74, '1122'),
(52, 75, 'The KBS Tour $-Taper has finally arrived! This will be the newest steel shaft in the KBS Golf Shafts line after continually delivering the best steel shafts on the market for ten years. Head of research and development and the brain behind the best steel shafts in golf, longtime KBS designer Kim Braly wanted the KBS Tour $-Taper to provide superior feel while maintaining shot work-ability for players seeking a mid-launch and low spin shaft. The KBS Tour $-Taper shares the same bend profile as the KBS TOUR with elongated step patterns for spin, generating a stable performance throughout the swing. &nbsp; KBS is proud to offer the KBS Tour $-Taper in 2 finishes: Black PVD and Classic KBS Chrome, KBS Tour $-Taper will come in the following Flex and Weights, R 110g, R+ 115g, S 120g, S+ 125g and X 130g. And Innovated for the KBS Tour $-Taper is our first ever 360&deg; cured decal for a one of a kind look on your equipment. &nbsp; This shaft has already been adopted on Tour by some of the games biggest names and will continue to grow as the performance and word spreads throughout Golf. Finally you have, Tour Feel and Money Performance. If you have any questions please message us. We can also install these. The installed price of $150 is for the whole set and includes grips. For a single install it would be cheaper.'),
(52, 76, 'This is for a set of KBS $-Taper Iron Shafts (3-PW.) As always everything we sell comes with a free gift, full warranty and a satisfaction guarantee.'),
