(53, 73, 'Dynamic Gold X Seven X7 Iron Shafts'),
(53, 74, '1124'),
(53, 75, 'Dynamic Gold X7 golf shafts are the newest addition to the Dynamic Gold family. Based on the tour-proven design of Dynamic&nbsp;Gold, the new X7 shaft is extremely low-launching and low-spinning. Dynamic Gold X7&nbsp;is the irons shaft of choice for today&rsquo;s stronger, faster swingers who are&nbsp;seeking a low ball flINSERT INTO `catalogsearch_fulltext_scope1` (`entity_id`, `attribute_id`, `data_index`) VALUES
(60, 75, 'ACCRA’s most technologically advanced golf shaft ever. The new RPG shaft joins the Tour Z family of shafts as a standalone product designed for Tour yet playable for a wide variety of golfers. The Tour Z RPG is available in three distinct weights, yet all feature a similar profile that promotes maximum energy transfer. The smooth transition from an extremely stable butt section to a responsive tip section is unique due to the addition of its radial strength and resistance to ovaling. The Tour Z RPG features 9 of the most advanced composite materials using less resin content of any shaft the ACCRA has ever developed. ACCRA has incorporated only Aerospace grade prepreg from Torey Japan to ensure the perfect symmetry of strength and power. Making the Tour Z RPG the smoothest feeling, maximum stability shaft in the industry. Along with the high modulus materials a 360-degree quad weave that stretches the entire length of the shaft has been incorporated to maximize torsional strength and increase the speed in which the shaft recovers. ACCRA looked at the needs of PGA Tour players and discerning golfers given the playability of the latest driver and fairway wood heads. The Tour Z RPG enables golfer to control launch and spin while increasing clubhead speed through its counter balanced design and material difference. The Tour Z RPG incorporates ACCRA’s proprietary technologies such as a Uniform taper design (UTT) to maximize energy transfer and Constant flex technology to add consistency to the fitting process. The Tour Z RPG needs to be tested to understand it’s unique characteristics and to understand the “real” material and design benefits. &nbsp;'),
(60, 76, 'This is for a new Accra Golf TourZ RPG shaft of your choice built to your specs. As always everything we sell comes with a satisfaction back guarantee.'),
(60, 83, 'Accra'),
(60, 97, 'Enabled'),
(60, 123, 'accra-tourz-rpg'),
(60, 137, 'Taxable Goods'),
(61, 73, 'Accra Golf FX 2.0 200 Series Shaft'),
(61, 74, '1187'),
(61, 75, 'ACCRA introduces an all new series of shafts using proprietary technologies and a fitting philosophy that is industry leading. The DyMatch and Fx lines of shafts laid the groundworks and now ACCRA has taken performance and customization to a new level. Fx 2.0 features a new profile, new updated high modulus materials, and better fitting capabilities than any series of shafts in golf. ACCRA is synonymous with professional fitting, as only the world&rsquo;s best club fitters are chosen to be certified dealers. ACCRA performance golf shafts are not available &ldquo;off the rack&rdquo; because we truly believe that a &ldquo;fit&rdquo; golf club will always out perform a &ldquo;stock&rdquo; golf club. The Fx 2.0 series offers an unsurpassed army of fitting options, combining unique profiles, weights, flexes and performance characteristics carrying on atradition of delivering club fitters all of the tools to fit any golfer. The Fx 2.0 offers 3 unique launch conditions, utilizing S3 shaft blueprinting technologies: Fx 2.0 100 Series = High launchFx 2.0 200 Series = Mid LaunchFx 2.0 300 Series = Low Launch These will come built to your specs with a tip and grip of your choice.&nbsp;'),
(61, 76, 'This is for a new Accra Golf FX200 series shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.'),
