(64, 75, 'The ACCRA iSeries features the same high modulus composite materials to ensure a smooth feel and enhanced performance. We have engineered a shaft that offers unsurpassed stability for tight dispersion without sacrificing feel. The iSeries proprietary constant taper design adds to the overall stability while maximizing energy transfer. The tip technology enables ACCRA fitters to mix weights and kick points to create “flighted” sets. Whether you are an accomplished golfer or a weekend warrior, the ACCRA iSeries can be customized to help you reach your potential. iSeries iron shafts come in 40, 50, 60, 70 & 80 weight ACCRA iSeries iron shafts feature many aspects of previous ACCRA iSeries shafts, but most importantly, ACCRA engineers have added a added weight as a fitting variable. Once a weight is selected, each weight can be adjusted to, up to, five different flexes. A certified ACCRA fitter also possesses to ability to create a set of flighted iron shafts by mixing two to three different weights within a set. The new ACCRA iSeries features the same high modulus composite materials to ensure a smooth feel and enhanced performance. We have engineered a shaft that offers unsurpassed stability for tight dispersion without sacrificing feel. The iSeries proprietary constant taper design adds to the overall stability while maximizing energy transfer. The ACCRA iSeries tip technology enables ACCRA fitters to mix weights and kick points. Whether you are an accomplished golfer or a weekend warrior, the ACCRA iSeries can be customized to help you reach your potential. This is for 1 shaft only! &nbsp;'),
(64, 76, 'This is for a new Accra Golf Iron shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.'),
