(65, 73, 'Graphite Design TOUR AD IZ'),
(65, 74, '1222'),
(65, 75, 'NEW Graphite Design Tour AD IZ Shaft. These are graphite designs newest shaft, they were just released. &nbsp;The Tour AD IZ, like all of the premium Tour AD wood shafts, utilizes premium, aerospace quality 50t carbon-fiber materials in order to deliver the best feeling and performing shaft available to golfers. &nbsp;&nbsp;The new Tour AD IZ shaft has a firm stiffness starting at the handle, and medium center section and a firm+ tip profile to promote a high launch angle and low ball spin rates. The new Tour AD IZ also utilizes TORAYCA&reg; T1100G carbon-fiber pre-preg with NANOALLOY&reg; technology in the tip section of the shaft for additional shaft stability, exceptional feel and precise ball control. &nbsp;Additionally, Graphite Design will offer a 50 gram X Flex within the IZ model line-up for the first time. These are similar to the very popular DI shaft, they are slightly softer in the tip but then slightly stiffer in the butt versus the DI and TP. &nbsp;They come finished in an amazing looking Matte Black finish with Orange and Silver accents. &nbsp;We are an authorized Graphite Design dealer, every shaft we sell is guaranteed 100% legit and comes with a full warranty and satisfaction guarantee! This shaft will come installed in any tip of your choice as well as a grip. These are very popular shafts on tour. &nbsp; Make sure you check out our blog for more information and reviews.&nbsp; Check out our friends at GOLFWRX for their opinions on the IZ.'),
(65, 76, 'This is for a new Graphite Design TOUR AD IZ shaft built to your specs. This will include the shaft, tip, grip and a free gift! Keep in mind everything we sell comes with a full warranty and satisfaction guarantee.'),
