(66, 74, '1223'),
(66, 75, '&lt;p&gt;&lt;span style="font-size: medium;"&gt;NEW Project X Even Flow Shaft. These come in two different shafts a Black and a Blue. The Black is low launch and spin and then the blue is mid/high launch and mid spin. This shaft is hand made in San Diego, CA. The Even Flow has an amazing feel, one of the best feeling shafts Project X has ever made. The blue is the fastest growing shaft on tour currently, they are getting 3 to 1 play over the black. &amp;nbsp;These are being played by several top pros including Adam Scott, Ernie Els, and several others.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;a title="Even Flow " href="http://www.golfwrx.com/451286/a-focus-on-feel-project-x-launches-new-even-flow-shafts/"&gt;&lt;span style="font-size: medium;"&gt;See what our friends at GolfWRX have to say about them.&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;'),
