(67, 75, 'The SLAY Series is the newest addition to VA Composites’ line of high performance composite golf shafts. SLAY features a multi-material design made with the industries most exotic materials from Japan. By utilizing these materials, VA Composites is able to offer the most advanced and versatile shafts in golf. SLAY’s unique design fits a wide variety of golfers and is offered in various weights and torques ranging from 55 grams to 85 grams. SLAY boasts high launch and low spin playing characteristics allowing golfers to achieve tighter dispersion and more distance. VA Composites is redefining the golf shaft and we are taking performance to an entirely new level! &nbsp;'),
