(68, 73, 'Fujikura Speeder EVOLUTION 4'),
(68, 74, '1241'),
(68, 75, '&nbsp; The newest in a long line of Speeders, the&nbsp;Speeder Evolution IV, is developed with the most advanced technologies in the graphite shaft industry. Building on the performance, engineering and material integrations of the Evo II and Evo III, the Evo IV sets the new standard. The IV is based on the profile of the II (low launch and low spin), but has a slightly softer mid to tip section to increase launch angle while maintaining low torque/spin with added high-strength materials. &nbsp; The materials and engineering processes that make up the IV are more advanced than any Speeder that came before. New technologies include a new High-strength intermediate modulus (IM) material, for lightweight stability and a new &ldquo;Engineered Outer Bias Technology&rdquo; that creates smoother loading feel. Technologies that carry over from previous Evolution shafts include MCT (Metal Composite Technology), 90 Ton Carbon Fiber for ultra-lightweight stability and Maximum Carbon Fiber Content (MCFC) pre-preg material. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Evo 4 please ask! Here are some reviews on the Evo 4. GolfWRX Golf Digest &nbsp;'),
(68, 76, 'This is for a new Fujikura Speeder EVOLUTION 4 shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.'),
