(70, 74, '1275'),
(70, 75, 'The Tensei Hybrid now comes in four different profiles, white, orange, blue and red. This shaft will be brand new and built to your specs. This will come with a tip of your choice and a grip of your choice. &nbsp;If you have any questions please ask. TENSEI&trade; CK Series Pro Orange Hybrid profile is the first high-balance point hybrid shaft to be developed by MCA GOLF and the final profile in the CK Pro Series Hybrid offerings. The multi-material design includes an extended Carbon Fiber/DuPont&trade; Kevlar&reg; (CK) weave in the butt-section, Tungsten Infused Prepreg to provide a higher-balance point, and a reinforced tip-section to provide superior stability, control, and feel. TENSEI&trade; CK Pro White Hybrid expands the TENSEI&trade; CK Pro Series &ndash; which features a multi-material design that incorporates more performance-oriented materials than we&rsquo;ve ever used in a hybrid shaft. Building off of the same tour proven low launching, low spinning profile, used in TENSEI&trade; CK Pro White, TENSEI&trade; CK Pro White Hybrid incorporates three times the Carbon Fiber/DuPont&trade; Kevlar&reg; (CK) weave in the butt-section &ndash; providing extreme control, enhanced stability, and maximum feel. TENSEI&trade; CK Pro Blue Hybrid expands the TENSEI&trade; CK Pro Series &ndash; which features a multi-material design that incorporates more performance-oriented materials than we&rsquo;ve ever used in a hybrid shaft. Building off of the same tour proven classic, smooth bend profile, used in TENSEI&trade; CK Pro Blue, TENSEI&trade; CK Pro Blue Hybrid incorporates three times the Carbon Fiber/DuPont&trade; Kevlar&reg; (CK) weave in the butt-section &ndash; providing extreme versatility, enhanced stability and maximum feel. TENSEI&trade; CK Pro Red Hybrid expands the TENSEI&trade; CK Pro Series &ndash; which features a multi-material design that incorporates more performance-oriented materials than we&rsquo;ve ever used in a hybrid shaft. Building off of the higher launching, performance oriented profile, used in TENSEI&trade; CK Pro Red, TENSEI&trade; CK Pro Red Hybrid incorporates three times the Carbon Fiber/DuPont&trade; Kevlar&reg; (CK) weave in the butt-section &ndash; providing extreme playability, enhanced stability, and maximum feel.'),
