(73, 74, 'mc5013pw'),
(73, 75, 'Miura&rsquo;s MC Collection MC-501 irons were created to improve ball contact and control to appeal beyond the low handicapped player. Compared to its traditional blade irons, the MC-501 is the longest blade model ever produced by Miura for blade and cavity back players who want to improve off-center strikes. The MC-501 irons are available in 3-PW however we can do any set make up you want. These will come built to your specs with the shafts and grips of your choice which is included in the price. Graphite shafts would be slightly more. &nbsp;Email us to discuss your next build.&nbsp; We now have these in Black!&nbsp;As well as RAW!&nbsp;'),
