(74, 73, 'Graphite Design MAD'),
(74, 74, 'grphdesmad'),
(74, 75, 'The team in the R&amp;D lab at Graphite Design Japan went all out when designing the new Graphite Design MAD wood shafts. A challenge was issued to them to design a shaft that would alleviate the ill-fated golf ball flight issues that results in a lack of Maximum Accuracy and Distance. Accepting the challenge, they went to work in an effort to develop a cure. The new Graphite Design MAD shaft is their response. Available in two strengths, the Graphite Design MAD Standard strength wood shafts are available in a 45g A and R Flex, 55g R and S Flex, 65g R and S Flex and a 70g S Flex and is designed for the intermediate to advance players. The Graphite Design MAD PRO strength wood shafts are available in 65g S and X Flex and 75g X Flex and is designed for the advanced to professional players with higher swing speeds.'),
