(75, 74, 'fujiproiron'),
(75, 75, 'Brand new for 2018, the new PRO iron shafts are able to achieve steel shaft weighted swing weights. This shaft is able to hold a consistent swing weight throughout the set when trimmed to length. This should allow you to benefit from the feel and vibration dampening that graphite shafts offer, while maintaining swing weights. Made using Fujikura''s High Density Composite Core (HDCC), the shaft provides an optimum club swing weight throughout the iron set. Unlike heavier composite irons, the PRO uses lighter weight composite in the shafts structure for improved feedback to the golfer. This equates to more Power, Accuracy and Control on all your shots.'),
(75, 76, 'The Fujikura Pro Iron is built with 40 ton carbon fiber and Fujikura''s HDCC throughout the shaft''s core.'),
