(76, 73, 'Hot Melt Golf Services'),
(76, 74, 'hotmelt'),
(76, 75, 'Hot Melt treatment is used in touring professionals clubs to add weight, create a bias, repair or prevent rattles, promote a better feel and also to mute the sound. The Peoples Clubs can do this tour service for you for $50. This is done on any new club purchase from us for free. We will email you the instructions after purchasing. Here is what a few of our customers thought: "I got to get out and hit my rogue with that SLDR head you hot melted for me. I really like both of them. The Rogue feels awesome and I love the sound of that hot melted head. Thanks again!" - Ryan in New England. "I once thought that hot melting was a luxury only for professional golfers. Now I can''t imagine hitting a driver without it. The amazing feel and sound of the hot melted club inspire confidence with each swing" -Jason in Tennessee'),
(76, 76, 'Hot Melt is a process of adding an adhesive to the inside of a golf club head. We are the best at performing this service. After purchasing we will email you the instructions.'),
