(77, 74, 'MiuraTourWedge'),
(77, 75, 'The new Miura Tour Series Wedge provides the legendary Miura feel that golfers covet. This wedge does not chase distance, but rather the precision and control necessary for scoring. It is the first from Miura to use CNC milling for the face and grooves, allowing for ultimate spin control. The Miura Tour Wedge is designed with a hollow back shape to create a higher center of gravity. The unique distribution of weight produces a stable trajectory while still allowing the player the ability to flight the shot, if necessary. Like all clubs forged by Miura, the grain structure within the club head is the tightest in the industry. This creates less dispersion on off-center hits, as well as provides control from all lies and conditions. The head design of the Tour Wedge will match any Miura model. Its size and shape is best suited for the CB57, MB-001, CB-1008, and the new MC-501. These will come built to your specs and will include any necessary bending, as well as the shaft and grip of your choice. &nbsp;Stamping and paint fill options available as well. &nbsp;If you have any questions please email us to discuss. &nbsp;'),
