(80, 73, 'Fujikura Speeder TR'),
(80, 74, 'FujikuraSpeederTR'),
(80, 75, 'Introducing New Fujikura Speeder TR Shaft which born from tour player request. It is a new lower launch and lower spin speeder series shaft. Fujikura pursued a new and improved EI profile for the top players in the world to maximize their power through improved kick speed. By stiffening the middle section of the shaft and providing the proper bending on Butt and Tip side, it achieves more carry and total distance with a Mid-low launch and low spin. New multi-plied hoop layers and 90-ton carbon fiber provide better stability and clubhead speed. TR was developed with Tour players in mind. Fujikura Tour rep was looking for a shaft profile to give the players more control and consistency. Extensive testing with Tour players took place until Fujikura Tour reps achieved the results they were looking for. The goal of TR was to generate kick speed through a new EI profile with a stiff mid section, but softer butt and tip for extra acceleration of the clubhead to the ball. This new EI resulted in better speed at impact combined with lower launch and spin to suit Tour player swings. Compared to Speeder Evolution TS (which has a similar kick point), The Speeder TR has a more effective loading zone (softer handle) to store more energy in the downswing translating to more clubhead speed and better launch. By applying multi hoop plied structure technology and 90tons carbon sheet, it balances better stability and driving performance.'),
(80, 76, 'This is for a new Fujikura Speeder TR , this will come built to your specs and also comes with our satisfaction guarantee.'),
