(92, 73, 'Graphite Design TOUR AD VR'),
(92, 74, 'graphite-desgn-tour-ad-VR'),
(92, 75, 'The Tour AD VR, like the other premium Tour AD wood shafts, utilizes premium, aerospace quality 50t carbon-fiber materials and it has a slightly higher balance point than the other current Tour AD wood shaft profiles. The Tour AD VR shaft also utilizes FTT - Fast Taper Technology, which incorporates a faster taper rate from the grip to the lower mid-section of the shaft, providing the overall feeling of greater club head control at impact and an increase in club head speed The Tour AD VR shaft profile is firm to stiff starting at the handle, medium/firm in the center section and has a firm tip to promote a mid/high launch angle and low ball spin rates. The Tour AD VR also utilizes TORAYCA&reg; T1100G carbon-fiber prepreg with NANOALLOY&reg; technology in the tip section of the shaft for additional shaft stability, exceptional feel and precise ball control. See a Graphite Design authorized Golf Club Fitting professional and come to the tee box ready with your new Tour AD VR wood shaft and &ldquo;Vanquish all Rivals&rdquo; from tee to green. &nbsp;The VR has already had several wins on tour. &nbsp;These will definitely be one of the hottest shafts this year. &nbsp;As always these will come built to your specs with a tip and grip of your choice. &nbsp; Check out our friends at GOLFWRX for their opinions on the&nbsp;VR.'),
