(99, 75, 'These parallel tip .370 Custom LA Golf Matte Finish TP Putter Shafts can be used in any putter that uses a straight steel shaft with a standard hosel with a .370 tip. These come in a beautiful matte black finish or White. These are offered in 135g, and 185g.'),
