(100, 74, 'peoplesgolfhat'),
(100, 75, 'New Peoples Golf Trucker cap. This lightweight cap is made of twill with mesh back panels for maximum breathability. This will be your favorite everyday grab and go hat. The front features a retro woven patch with our logo in red white and blue that complements the rest of the cap. OSFM adjustable plastic strap for maximum comfort and durability. Better yet, get it free with the purchase of $1,000 or more.'),
(100, 76, '&lt;p&gt;&lt;span style="font-size: medium;"&gt;Peoples Golf Hat /span&gt;&lt;/p&gt;'),
