(100, 137, 'Taxable Goods'),
(101, 73, 'NEW Mitsubishi Diamana DF Series Shaft'),
(101, 74, 'NEW Mitsubishi Diamana DF Series Shaft'),
(101, 75, 'We&rsquo;ve taken two our most proven, time tested tour proven profiles &ndash; Blue Board and White Board, and Mitsubishi Chemical&rsquo;s latest design and material innovations, to create the Diamana&trade; DF-Series. The Diamana&trade; DF-Series uses strategically positioned DIALEAD&trade; Pitch Fiber, and an incredibly strong hybrid prepreg that combines Mitsubishi Chemical&rsquo;s MR70 &ndash; a carbon fiber material that is 20% stronger and has 10% higher modulus than conventional carbon fibers, with boron fibers to create our newest lower launching, stiff-tip profile. Strength, stability, and performance has a new name &ndash; Diamana&trade; DF-Series. &nbsp;If you have any questions please ask. These will come with a tip and grip of your choice.&nbsp;'),
(101, 76, 'NEW Mitsubishi DF Shaft with a tip and grip of your choice, satisfaction guarantee.'),
(101, 83, 'Mitsubishi'),
(101, 97, 'Enabled'),
(101, 123, 'mitsubishi-df'),
(101, 137, 'Taxable Goods'),
(102, 73, 'Project X HZRDUS SMOKE Shaft (Black, Yellow, or GREEN!)'),
(102, 74, 'PXHZRDUSSMOKE'),
(102, 75, 'HZRDUS Smoke Black is the next generation of HZRDUS. Featuring a low-spin and low-launch profile that maintains the HZRDUS reputation, Smoke Black is designed for today''s aggressive swingers while providing new optimized material placement to promote an improved feel and an increase in playability. HZRDUS Smoke Yellow is a low launch/spin shaft that features a counterbalanced design allowing for mass to be added to the head for maximum ball speeds and higher MOI. Smoke Yellow also boasts a tapered grip section and firmer mid section, when compared to the original HZRDUS Yellow, for improved stability throughout the shaft for today&rsquo;s aggressive swingers. Smoke Green is the latest engineering marvel in the HZRDUS Universe. Being the stiffest HZRDUS shaft yet, Smoke Green is designed to reduce spin for the strongest swingers and is the first major shaft introduced using Hexcel&rsquo;s HexTow HM63 fiber. This allows Smoke Green to maintain maximum stability and keep up with even the fastest swings. These will come custom built to your specs in house with the tip and grip of your choice. We are only stocking the PVD Finish in the green, however we can order the Black Finish if you prefer it, just put something in the build notes and we will get it taken care of.&nbsp; Check out what our friends at GolfWRX have to say about the new HZRDUS Smoke.'),
(102, 76, 'This is for a Project HZRDUS Smoke Shaft with a tip and grip of your choice. As always everything we sell comes with a satisfaction guarantee.'),
(102, 83, 'Project X'),
(102, 97, 'Enabled'),
(102, 123, 'pxhzrdussmoke'),
