(143, 73, 'New Level Golf M Type Wedge'),
(143, 74, 'newlevelMtypeWedge'),
(143, 75, 'M Type Wedges Irons&nbsp; The M-Type forged wedges offer pinpoint accuracy and unsurpassed playability in a tour inspired shape and size. &nbsp;The 1020 Carbon Steel offers the perfect blend of performance and plenty of feedback for those all important scoring shots within 100 yards.&nbsp; Higher initial bounce angles and added heel relief allow this wedge to be very versatile off of virtually any type of turf.&nbsp;The reduced heel to toe sole contour allows the leading edge and sole to lay very flat and is far more user-friendly than most tour type wedge designs. These will come built to your specs with the shafts and grips of your choice which is included in the price. Graphite shafts would be slightly more. &nbsp;&nbsp;Email us to discuss your next build.'),
(143, 76, 'This is for a New Level Golf M Type Wedge, these will come built to your specs and come with our satisfaction guarantee.'),
(143, 97, 'Enabled'),
(143, 123, 'newlevelmtypewedge'),
(143, 137, 'Taxable Goods'),
(144, 73, 'Project X Catalyst Graphite Iron Shaft'),
(144, 74, 'pxcatalyst'),
(144, 75, 'Catalyst is the next step in graphite iron design. Featuring our new Iso-6 material technology, Catalyst is engineered to replicate steel alloy properties over 100% better than traditional graphite laminates. This allows for an extremely stable shaft that maximizes constancy and distance control while providing the benefits of a graphite body design.&nbsp; Catalyst also features a reinforced tip section which, unlike traditional graphite, delivers torsional resistance comparable to that of steel&mdash;improving stability during turf interaction for better impact on less than perfect shots. This is for 1 shaft, please indicate which shaft you want as well as what they are going in. &nbsp;We can mix and match between the weights.&nbsp; Check out what our friends at GolfWRX have to say about the new Project X Catalyst.'),
(144, 76, 'This is for a Project X Catalyst Graphite Iron Shaft . As always everything we sell comes with a satisfaction guarantee.'),
(144, 83, 'Project X'),
(144, 97, 'Enabled'),
(144, 123, 'pxcatalyst'),
(144, 137, 'Taxable Goods'),
(145, 73, 'Fujikura Diamond Speeder'),
(145, 74, 'fujikura-diamond-speeder'),
(145, 75, 'Designed and developed by Fujikura Composites Japan, the Diamond Speeder is an ultra-premium offering as part of the Jewel Line. The Jewel line is for the golfer looking to optimize swing speed through lighter weight shafts, but keeping spin way down due to incredibly low torque. Utilizing extremely high-grade, high-strength, lightweight materials, there is no expense spared to make these the ultimate Speeder shafts. The Diamond Speeder, specifically, has the lowest torque of any shaft we&rsquo;ve ever produced. A new design technology in Diamond is the Outer Bias Layer, also in Evolution IV. Our engineers have moved the bias layer from the traditional innermost layer and put it in between straight layers (0 degree layers) which provides a much smoother loading and feel to the shaft. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Speeder Diamond please ask! &nbsp;'),
(145, 76, 'This is for a new Fujikura Diamond Speeder shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.'),
(145, 83, 'Fujikura'),
(145, 97, 'Enabled'),
(145, 123, 'pxcatalyst-1'),
(145, 137, 'Taxable Goods'),
(146, 73, 'Stability Putter Shaft'),
(146, 74, 'Stability'),
(146, 75, 'Breakthrough Golf uses a scientifically advanced multi-material design with new geometries never used in putter shaft design before. A shaft that has the same look, solid feel and weight as traditional steel putter shafts. The Stability Shaft delivers the face squarer at impact for improved accuracy and solid feel and has a lower launch for a predictable roll, resulting in better distance control. The install option will include installing the shaft on your putter. Simply mail it to us, we will install a new shaft and ship it back. This will also include a free loft and lie adjustment and a free lamkin deep etch grip, additional grips available for purchase. If you need help figuring out which shaft you need please email us.'),
(146, 76, 'This is for a brand new custom installed Stability putter shaft.'),
(146, 97, 'Enabled'),
(146, 123, 'stability'),
(146, 137, 'Taxable Goods'),
(147, 73, 'Miura Left Hand CB-801 3-PW'),
(147, 74, 'miura-cb801'),
(147, 75, 'Based on the success of the LH Tournament Blade Miura Golf looked to expand its LH offering to appeal to more golfers. The CB-801 was a creation that took the design ideas and concepts of the TB and expanded the forgiveness and playability. One key feature that was incorporated was the distinct Y-Grind perfected by Miura Master Craftsman Yoshitaka Miura. A grind that started out as a concept in wedges has now become a signature feature in the Miura product line. Until now, this innovation was not available to our loyal left handed golfers. The Y-Grind, although most visible on the sole and leading edge, actually encompasses many more subtle changes to the club head. This is necessary to maintain the integrity of the head, including head weight, density and overall balance. These refinements elevate the Left Handed Y-Grind irons to another level. More efficient turf interaction is made possible through the subtle leading edge and sole modifications. This includes the appropriate bounce angles on each specific irons while maintaining desired lie angles. The Miura family commitment to detail is evident in the Y-Grind, specifically at the address position. Subtle changes to the top line and toe profile work in concert with the sole grind delivering a new level of confidence to the golfer. The CB-801 irons are available in 3-PW, however we can do any set make up you want. These will come built to your specs with the shafts and grips of your choice. &nbsp;Email us to discuss your next build.&nbsp;'),
(147, 76, 'This is for a set of Miura CB-801 3-PW, these will come built to your specs and come with our satisfaction guarantee.'),
(147, 83, 'Miura'),
(147, 97, 'Enabled'),
(147, 123, 'miura-cb801'),
(147, 137, 'Taxable Goods'),
(149, 73, 'VA Composites Tour Issue Raijin Iron Shafts 3-PW'),
(149, 74, 'va-raijin-iron'),
(149, 75, 'The Raijin (Rie-gene) features a design utilizing multiple composite materials. Designed using exotic 40T carbon fiber pre-preg materials from Japan coupled with a design that is unprecedented in the golf industry. The Raijin is a very versatile shaft that fits a wide variety of players. This shaft has a slightly higher balance point which helps with better balance and swing weight control. VA Composites is redefining the golf shaft and we are taking performance to an entirely new level! &nbsp;'),
(149, 76, 'This is for a new VA Composites Tour Issue Raijin Iron Shafts 3-PW of your choice built to your specs. As always everything we sell comes with a full money back guarantee.'),
(149, 83, 'VA Composites'),
(149, 97, 'Enabled'),
(149, 123, 'va-raijin-iron'),
(149, 137, 'Taxable Goods'),
(150, 73, 'New Taylormade P760 Irons 3-PW'),
(150, 74, 'TMP760'),
(150, 75, 'This is for a set of new Taylormade P760 Irons. &nbsp;These will come built to your specs with the heads, shafts and grips of your choice. &nbsp;They will also be built to your desired specs.&nbsp; These are being sold as 3-PW however we can do a different set makeup, just email us to discuss.&nbsp; &nbsp;Please allow 2 weeks for us to assemble these. &nbsp;As always everything is built in house by our staff and built to absolute best quality possible. &nbsp;&nbsp;Email us to discuss your next build.'),
(150, 76, 'This is for a set of New Taylormade P760 Irons 3-PW, these will come built to your specs and come with our satisfaction guarantee.'),
(150, 83, 'Taylormade'),
(150, 97, 'Enabled'),
(150, 123, 'tmp760'),
(150, 137, 'Taxable Goods'),
(151, 73, 'Miura Left Hand Tour Series Wedge'),
(151, 74, 'miura-tour-wedge-series-LH'),
(151, 75, 'The new Miura Tour Series Wedge provides the legendary Miura feel that golfers covet. This wedge does not chase distance, but rather the precision and control necessary for scoring. It is the first from Miura to use CNC milling for the face and grooves, allowing for ultimate spin control. The Miura Tour Wedge is designed with a hollow back shape to create a higher center of gravity. The unique distribution of weight produces a stable trajectory while still allowing the player the ability to flight the shot, if necessary. Like all clubs forged by Miura, the grain structure within the club head is the tightest in the industry. This creates less dispersion on off-center hits, as well as provides control from all lies and conditions. The head design of the Tour Wedge will match any Miura model. Its size and shape is best suited for the Tournament Series Blade and the new CB-801. These will come built to your specs and will include any necessary bending, as well as the shaft and grip of your choice. &nbsp;Stamping and paint fill options available as well. &nbsp;If you have any questions please email us to discuss. &nbsp;'),
(151, 76, 'These new Miura Tour Series Wedge will come built to your specs, and with the shaft and grip of your choice.'),
(151, 83, 'Miura'),
(151, 97, 'Enabled'),
(151, 123, 'miura-tour-wedge-series-lh'),
(151, 137, 'Taxable Goods'),
(152, 73, 'Miura CB-301 4-PW'),
(152, 74, 'miura-cb301'),
(152, 75, 'Introducing the Miura Golf CB-301, the longest full forged cavity back iron Miura Golf has ever produced. The CB-301 takes Miura&rsquo;s world-renowned forging process and blends it seamlessly with a Tour inspired shape. The CB-301 combines the feel and playability of a player&rsquo;s iron with the forgiveness and distance to improve golfers of all skill levels. The full cavity-back design is engineered with a larger sweet spot to ensure greater control and improved performance on all shots. Each club is engineered with a variable sole and cavity thickness designed to optimize center of gravity. This design technique enables the CB-301 to deliver more forgiveness while maintaining our trademark level of superior quality and feel The CB-301 &ndash; the Miura model you&rsquo;ve been waiting for Longest full forged cavity back iron produced by Miura Golf Hand forged using Miura Golf&rsquo;s 14-step manufacturing process Tour inspired shape that is slightly larger footprint than the MC-501 Precision-placed center of gravity location that enhances feel and performance, resulting in higher, straighter and longer shots The CB-301 irons are available in 4-PW, however we can do any set make up you want. Gap Wedges are also available in the 301. These will come built to your specs with the shafts and grips of your choice. &nbsp;Email us to discuss your next build.&nbsp;'),
(152, 76, 'This is for a set of Miura CB-301 4-PW, these will come built to your specs and come with our satisfaction guarantee.'),
(152, 83, 'Miura'),
(152, 97, 'Enabled'),
(152, 123, 'miura-cb301'),
(152, 137, 'Taxable Goods'),
(153, 73, 'Accra Golf TZ Series Shaft'),
(153, 74, 'accra-TZseries'),
(153, 75, 'The new Accra TZ has been dominating on tour with several top pros now using these including Jason Day, Cameron Champ, Pat Perez, Martin Kaymer, and countless others. &nbsp;This shaft is offered in 2 distinct profiles. Utilizing the proprietary blue printing capabilities of the ACCRA S3 &ldquo;Shaft Simulation System&rdquo;, ACCRA has developed a higher launching TZ6 series version and a lower launching TZ5 series each with lower spin results than ever before. TZ5 The new TZ5 series line of shafts takes all the best attributes of the past Tour Z models and incorporates the latest high modulus materials to create a smoother &ldquo;feel&rdquo; than ever before while maintaining the low launch/low spin characteristics that the Tour Z brand has been known for. You will notice a slightly smoother mid section and lower balance point to promote &ldquo;feel&rdquo; combined with a lower torque than previous Tour Z series models to maintain the low spin that Tour Z shafts are renowned for. Once again ACCRA has developed an industry leading low launching, low spinning shaft for all levels of golfers utilizing the latest in advanced composite materials to enhance performance and playability. TZ6 The new TZ6 series shaft will be available in 4 different weights (45, 55, 65, &amp; 75) and a matching hybrid shafts (85H) with multiple flex options. This is a unique design that will appeal to the average golfer in the M3 and M4 flexes as a mid/high launching driver shaft that will control spin and add power with an active tip section. Where this shaft really shines is as a mid/high launching shaft in M4 and M5 flexes for the accomplished golfer. Already in the bag of 8 PGA Tour players, this is a spin killing machine that feature 2.0 torque combined with the explosive tip section. New high modulus composite materials now available enable ACCRA to maintain &ldquo;feel&rdquo; while introducing extremely low torque. Stability is achieved in the combination of ACCRA&rsquo;s proprietary design in the butt section for unparalleled strength without effecting &ldquo;feel&rdquo; and the addition of a new material technology in the tip section creating an unequaled torsional strength along with a faster recovery speed than any shaft ACCRA has ever produced.'),
(153, 76, 'This is for a new Accra Golf TZ Series Shaft shaft of your choice built to your specs. As always everything we sell comes with a full satisfaction guarantee.'),
(153, 83, 'Accra'),
(153, 97, 'Enabled'),
(153, 123, 'accra-tzseries'),
(153, 137, 'Taxable Goods'),
(154, 73, 'VA Composites Raijin Black Shaft'),
(154, 74, 'va-raijin-black'),
(154, 75, 'RAIJIN&nbsp;Black&nbsp;features an exotic aeronautical grade 4-Axis weave prepreg material throughout the shaft. When coupled with our multi-material design, this 4-Axis prepreg enhances performance during the entire golf swing. The RAIJIN&nbsp;Black&nbsp;should not to be compared to RAIJIN, as it boasts a completely different design pattern and performance capabilities. The RAIJIN&nbsp;Black&nbsp;proves to have the stiffest bend profile throughout all the VA shaft series, making it better suited for players with faster tempo or players with high load. The 4-Axis material reduces shaft ovalization throughout the entire swing, allowing for a more stable and efficient shaft. The RAIJIN&nbsp;Black&nbsp;cosmetics were inspired by a mythical dragon which is showcased in the beautiful artwork on the shaft. From the matte black graphite finish to the rose gold accents to the true performance of the shaft, the RAIJIN&nbsp;Black&nbsp;proves to be a work of art. &nbsp;'),
(154, 76, 'This is for a new VA Composites Raijin Black shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.'),
(154, 83, 'VA Composites'),
(154, 97, 'Enabled'),
(154, 123, 'va-raijin-black'),
(154, 137, 'Taxable Goods'),
(155, 73, 'Fujikura Ventus Shaft (Black, Blue or Red)'),
(155, 74, 'fujikura-ventus'),
(155, 75, 'The exceptionally engineered Ventus is designed to significantly tighten shot dispersion and maximize ball speed especially on off-center shots. Ventus is a Tour-inspired profile and the first to include Fujikura&rsquo;s all-new VeloCore Technology in a straight taper, ultra tip-stiff profile. Maximum energy transfer from the tip section boosts the clubhead&rsquo;s performance and a straight taper design enhances loading and feel. The new Fujikura Ventus has been very well received both on and off tour. &nbsp;We hit these at the PGA Show and were very impressed. &nbsp;They are currently being used by several top pros including Branden Grace, Peter Uihlein, Michael Block, Cody Gribble, Adam Landry, Colt Knost, Sung Kang, Austin Cook, and many more.&nbsp; Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Ventus please ask! Update as of 1/26 we have several of the tour only heavier 90g and 100g shafts available for a limited time.&nbsp; &nbsp;'),
(155, 76, 'This is for a new Fujikura Ventus shaft of your choice built to your specs. As always everything we sell comes with a full satisfaction guarantee.'),
