(156, 73, 'Graphite Design IZ Hybrid'),
(156, 74, 'gd-IZ-Hybrid'),
(156, 75, 'Brand new for the 2019 season, Graphite Design introduces the latest in the Tour AD premium line of hybrid golf shafts, the Graphite Design Tour AD IZ &ndash; &ldquo;Into the Zone&rdquo; Hybrid. Designed and manufactured at the Graphite Design Japan factory headquarters, the new Tour AD IZ hybrid shaft are available in 65g R2 (Lite) and R1 (Regular) flex, 75g R and S flex, 85g R, S and X flex and 95g S and X.&nbsp; The Tour AD IZ Hybrid, like all of the premium Tour AD shafts, utilizes premium, aerospace quality carbon-fiber materials in order to deliver the best feeling and performing shaft available to golfers.&nbsp; The Tour AD IZ 65g and 75g hybrid shaft has a medium stiffness starting at the handle, and firm center section and a firm tip profile to promote a mid/high launch angle and mid ball spin rates.&nbsp; The Tour AD IZ 85g and 95g hybrid shaft has a firm stiffness starting at the handle, and firm center section and a stiff tip profile to promote a mid-launch angle and lower ball spin rates.&nbsp; These will come built to your specs with the desired adapter and grip of your choice. We can also install these in your hybrid, this is included in the price.&nbsp;'),
(156, 76, 'New Tour Issue Graphite Design IZ Hybrid Shaft'),
