(176, 73, 'SuperSpeed Golf Training System – Men’s'),
(176, 74, 'SuperSpeedGolfMens'),
(176, 75, 'After thoroughly testing the SuperSpeed Golf system we are excited to now be carrying this awesome training aid, the first in our new training aid line.&nbsp;&nbsp;&nbsp;We have these in stock and ready to ship today.&nbsp;&nbsp;These have been getting awesome results both on tour and off.&nbsp;These are currently being used on tour by Phil Mickelson, Dustin Johnson, Paul Casey, Ian Poulter, Alen Noren, Byrson DeChameau, Beau Hossler, Sam Saunders, Hideko Matsuyama, Miguel Angel Jimenez, Scott Stallings, CT Pan, Adam Hadwin, Graeme McDowell, Brian Gay and several others. As always we stand behind everything we sell with a full satisfaction.&nbsp; "We believe that every player deserves and is capable of hitting the ball farther. Whether you are an accomplished competitive player or a weekend warrior, adding distance to your tee shots will help you lower your scores and have more fun on the golf course. Everyone wants to bomb it off the tee and take that walk to 30 yards ahead of your nearest playing companion. For many golfers this sounds far too good to be possible. With all of the gimmicks and false claims of many training aids on the market, we understand! That is one of the primary reasons that our team of expert coaches and fitness professionals at SuperSpeed Golf decided to launch this training system to the public. Our team has been working with the concepts of overspeed training for many years with our own private clients. We have found that using lighter weight clubs in specific training can help every golf increase swing speed, maximize biomechanical efficiency of the swing, improve consistency in ball striking, and reduce many common swing flaws caused by inefficient sequencing of the golf swing. We spent years determining the optimal weighting breakdown of our SuperSpeed Golf Clubs and the most effective training protocols to maximize our player&rsquo;s progress. The result is the SuperSpeed Golf Men&rsquo;s Training System. This training system is optimized for players who play a standard weight men&rsquo;s driver with an overall weight between 300 and 325 grams. This set includes the Green (light), Blue (medium), and Red (Heavy) weighted SuperSpeed Clubs. Our players will swing all three of these clubs in a light to heavy progression during our overspeed training protocols. We find that players typically gain between 5% and 8% additional swing speed over the first 4-6 weeks of regular practice. Each training session only takes about 10 minutes to complete. We recommend 3 training sessions per week for optimal results. So, if you have an additional 30 minutes a week, wouldn&rsquo;t you like to add 30 yards to your tee shots? Purchase your SuperSpeed Golf Training System today to get started!" What&rsquo;s in the box: SuperSpeed Golf Green &ldquo;Light&rdquo; Training Club SuperSpeed Golf Blue &ldquo;Medium&rdquo; Training Club SuperSpeed Golf Red &ldquo;Heavy&rdquo; Training Club Introduction and instruction card &nbsp; Technical Specifications: ItemLengthOverall Weight Green &ldquo;Light&rdquo; Club 45&Prime; 255 Grams Blue &ldquo;Medium&rdquo; Club 45&Prime; 290 Grams Red &ldquo;Heavy&rdquo; Club 45&Prime; 335 Grams'),
