(178, 73, 'SuperSpeed Golf Training System – Senior'),
(178, 74, 'superspeedgolfsenior'),
(178, 75, 'After thoroughly testing the SuperSpeed Golf system we are excited to now be carrying this awesome training aid, the first in our new training aid line.&nbsp;&nbsp;&nbsp;We have these in stock and ready to ship today.&nbsp;&nbsp;These have been getting awesome results both on tour and off.&nbsp;These are currently being used on tour by Phil Mickelson, Dustin Johnson, Paul Casey, Ian Poulter, Alen Noren, Byrson DeChameau, Beau Hossler, Sam Saunders, Hideko Matsuyama, Miguel Angel Jimenez, Scott Stallings, CT Pan, Adam Hadwin, Graeme McDowell, Brian Gay and several others. As always we stand behind everything we sell with a full satisfaction.&nbsp; "It is a true fact that as our bodies age it becomes increasingly difficult to create a powerful and consistent golf swing. We are in the market to help curb this trend by offering a simple and easy to use training system to help you regain range of motion, stability, and power. This will help you hit the ball farther, higher, and more consistently than you thought possible. Join many Champions Tour players who have found great success with the SuperSpeed Golf Training System. Our team has been working with the concepts of overspeed training for many years with our own private clients. We have found that using lighter weight clubs in specific training can help every golf increase swing speed, maximize biomechanical efficiency of the swing, improve consistency in ball striking, and reduce many common swing flaws caused by inefficient sequencing of the golf swing. With our senior population specifically, we have found that adding SuperSpeed Golf has had a great effect in helping players improve range of motion, stability, and power in their swings. This has helped some players add over 30 yards to their drives and begin to be able to hit mid and long irons with confidence. We have spent years determining the optimal weighting breakdown of our SuperSpeed Golf Clubs and the most effective training protocols to maximize our player&rsquo;s progress. The result is the SuperSpeed Golf Men&rsquo;s Training System. This training system is optimized for players who play a standard weight men&rsquo;s driver with an overall weight between 275 and 300 grams. This set includes the Yellow (Superlight), Green (light), Blue (medium), weighted SuperSpeed Clubs. Our players will swing all three of these clubs in a light to heavy progression during our overspeed training protocols. We find that players typically gain between 5% and 8% additional swing speed over the first 4-6 weeks of regular practice. Each training session only takes about 10 minutes to complete. We recommend 3 training sessions per week for optimal results. So, if you have an additional 30 minutes a week, wouldn&rsquo;t you like to add 30 yards to your tee shots? Purchase your SuperSpeed Golf Training System today to get started!" What&rsquo;s in the box: SuperSpeed Golf Yellow &ldquo;SuperLight&rdquo; Training Club SuperSpeed Golf Green &ldquo;Light&rdquo; Training Club SuperSpeed Golf Blue &ldquo;Medium&rdquo; Training Club Introduction and instruction card Technical Specifications: ItemLengthOverall Weight Yellow &ldquo;Superlight&rdquo; Club 45&Prime; 225 Grams Green &ldquo;Light&rdquo; Club 45&Prime; 255 Grams Blue &ldquo;Medium&rdquo; Club 45&Prime; 290 Grams'),
