(179, 73, 'SuperSpeed Golf Training System – Junior'),
(179, 74, 'superspeedgolfjunior'),
(179, 75, 'After thoroughly testing the SuperSpeed Golf system we are excited to now be carrying this awesome training aid, the first in our new training aid line.&nbsp;&nbsp;&nbsp;We have these in stock and ready to ship today.&nbsp;&nbsp;These have been getting awesome results both on tour and off.&nbsp;These are currently being used on tour by Phil Mickelson, Dustin Johnson, Paul Casey, Ian Poulter, Alen Noren, Byrson DeChameau, Beau Hossler, Sam Saunders, Hideko Matsuyama, Miguel Angel Jimenez, Scott Stallings, CT Pan, Adam Hadwin, Graeme McDowell, Brian Gay and several others. As always we stand behind everything we sell with a full satisfaction.&nbsp; "We believe that a major cornerstone is playing high level competitive golf is distance derived from swing speed. Many collegiate programs these days place a huge premium on recruiting players who have more power. The reasons are pretty obvious. Players with more swing speed have the potential to shoot much lower scores as the rest of their games develop. Players that make it to college without up to par power statistics tend to struggle and grind through rounds much more than those than can bomb it down the fairway and take advantage of many more scoring opportunities. Our team at SuperSpeed Golf has seen this happen time and time again with many of our players who have gone on to have successful collegiate careers. Integrating the concepts of overspeed training with these players has helped them get a competitive advantage over the players they are competing against for collegiate scholarships. During the development of SuperSpeed Golf, we have found that using lighter weight clubs in specific training can help every golf increase swing speed, maximize biomechanical efficiency of the swing, improve consistency in ball striking, and reduce many common swing flaws caused by inefficient sequencing of the golf swing. We spent years determining the optimal weighting breakdown of our SuperSpeed Golf Clubs and the most effective training protocols to maximize our player&rsquo;s progress. The result is the SuperSpeed Golf Junior Training System. This training system is optimized for players who play a lightweight driver with an overall weight between 270 and 300 grams. This set includes the Yellow (superlight), Green (light), and Blue (medium) weighted SuperSpeed Clubs. Our players will swing all three of these clubs in a light to heavy progression during our overspeed training protocols. We find that players typically gain between 5% and 8% additional swing speed over the first 4-6 weeks of regular practice. Each training session only takes about 10 minutes to complete. We recommend 3 training sessions per week for optimal results. Adding overpseed training to your swing and physical programs will surely help you gain speed and an even greater edge over the competition!" What&rsquo;s in the box: SuperSpeed Golf Yellow &ldquo;Superlight&rdquo; Training Club SuperSpeed Golf Green &ldquo;Light&rdquo; Training Club SuperSpeed Golf Blue &ldquo;Medium&rdquo; Training Club Introduction and instruction card Technical Specifications: ItemLengthOverall Weight Yellow &ldquo;Superlight&rdquo; Club 41&Prime; 220 Grams Green &ldquo;Light&rdquo; Club 41&Prime; 250 Grams Blue &ldquo;Medium&rdquo; Club 41&Prime; 285 Grams'),
