(180, 75, 'Flexfit Delta is a revolutionary cap that is the lighter, sleeker, smarter and more comfortable choice. It fuses panels with a seamless, stitch-free finish and it couples a lightweight visor fabrication with a new 3-Layer multifunction sweatband for sweat absorption, stain prevention and quick drying. There&rsquo;s even patent-pending stain block tech that prevents sweat staining on the cap&rsquo;s crown. It also features a water repellent functionality. New lightweight, hard buckram.&nbsp;Full Miura logo on front of hat and signature Miura M on back.&nbsp; 92% Polyester / 8% Spandex Sizes: S/M (6 3/4&rdquo; &ndash; 7 1/4&rdquo;) L/XL (7 1/8&rdquo; &ndash; 7 5/8&rdquo;)'),
