INSERT INTO `catalogsearch_fulltext_scope1` (`entity_id`, `attribute_id`, `data_index`) VALUES
(182, 75, 'The combination of art and design is what truly makes the VYLYN (Vil-lain) stand out among the rest. Inspired by pop-artists Andy Warhol and Roy Lichtenstein, the VYLYN showcases the most eye-catching cosmetics in golf. Beneath the iconic artwork, lies layers of high modulus composite material making VYLYN one of the most advanced composite shafts in the market. The material is hand laid in consistent and multiple directions in order to control torque and bend profile. The result is better feel and higher performance. The VYLYN&rsquo;s bend profile is softer in the butt section of the shaft, while stiffer in the mid and tip sections. This results in low spin with mid-high launch. A player with an average load and smooth swing could benefit from playing the VYLYN. But really, who doesn&rsquo;t want to PLAY THE VILLIAN? These will come built in house to your specifications&nbsp;and will come with the adapter and grip of your choice.&nbsp;'),
(182, 76, 'This is for a new VA Composites Vylyn shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.'),
(182, 83, 'VA Composites'),
