(182, 137, 'Taxable Goods'),
(183, 73, 'NEW Mitsubishi Diamana RF Series Shaft'),
(183, 74, 'mitsubishi-RF'),
(183, 75, 'We&rsquo;ve taken our tour proven, time tested Red Board profile and enhanced it using Mitsubishi Chemical''s latest design and material innovations, to create the next generation Diamana&trade; RF-Series. Strategically positioned DIALEAD&trade; Pitch Fiber, MR70 and boron fiber infused hybrid prepreg deliver unmatched strength, stability and performance from this higher launching profile. The Diamana&trade; RF-Series represents the next generation version of MCA GOLF&rsquo;s signature &ldquo;active&rdquo; bend profile. The new RF-Series, like its most recent predecessor the Diamana&trade; R-Series, incorporates high-strength DIALEAD&trade; Pitch Fiber by Mitsubishi Chemical into the butt-section of the shaft, adding unprecedented strength and control during shaft loading and unloading. The new Diamana&trade; RF-Series incorporates for the first time a new hybrid prepreg developed by the engineers at Mitsubishi Chemical. This new prepreg combines boron fiber and Mitsubishi Chemical&rsquo;s latest carbon fiber innovation MR70. Mitsubishi Chemical&rsquo;s MR70 by is 20% stronger and has 10% higher modulus than conventional carbon fibers. Strategically positioned in the tip-section of the shaft this hybrid prepreg provides unprecedented strength and stability at impact. If you have any questions please ask. These will come with a tip and grip of your choice.&nbsp;'),
(183, 76, 'NEW Mitsubishi RF Shaft with a tip and grip of your choice, satisfaction guarantee.'),
(183, 83, 'Mitsubishi'),
