(184, 73, 'NEW Tour Issue Taylormade M5 Driver Head'),
(184, 74, 'tim5head'),
(184, 75, 'This is for a new Tour Issue Taylormade M5 Head. We currently have all three lofts available. The Tour heads are hand picked for tour use, specs measured, COR tested and approved, then finally hot melted. These have been getting tons of play on tour this year with several top pros using them including Tiger Woods, Rory McIlroy, Justin Rose, Dustin Johnson and several others. Feedback on the M5 has been very good. Head covers and tour adapters are available for purchase. Hot Melt is included in this price. If you would like to hand pick the specs your head or have any questions please email us. Shafted options are available as well.'),
