(187, 73, 'Miura Tour Series HB Wedge'),
(187, 74, 'miura-HB'),
(187, 75, 'The Milled Tour Wedge High Bounce (HB) delivers the legendary soft feel golfers covet. The renowned Miura forging process produces a grain structure within the head that is the tightest in the industry. The wedge does not pursue distance like other clubs, but rather the precision and control necessary for scoring. The tour inspired head shape confidently aligns the golfer allowing for pinpoint accuracy. &nbsp;The Tour Wedge HB boasts a wider sole that tapers from toe to heel. This design allows for a more effective bounce along the middle of the sole. The added C Grind (heel and toe relief) and camber (front to back relief) increases playability and forgiveness. The head design of the Tour Wedge HB will match with any of Miura''s iron models. Lofts are available in 50&deg;-62&deg; in 2 degree increments to configure the perfect set. These will come built to your specs and will include any necessary bending, as well as the shaft and grip of your choice. &nbsp;Stamping and paint fill options available as well. &nbsp;If you have any questions please email us to discuss. &nbsp;'),
(187, 76, 'These new Miura Tour Series HB Wedge will come built to your specs, and with the shaft and grip of your choice.'),
