(190, 73, 'Project X Blackout Iron Shafts (LZ Included)'),
(190, 74, 'pxlzblackout'),
(190, 75, 'This is for a New Limited Edition set of Project X Blackout 4-PW Shafts. These were just released and Peoples Golf is the first to have them. We have these in the LZ and the regular PX. The LZ shafts come in 5.5, 6.0, or 6.5. The regular PX come in 5.5, 6.0, 6.5, and 7.0. If you need these installed please let us know and we will get you a price. We are an authorized True Temper Performance Fitting Center, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the new Project X Blackout shafts please ask!'),
