(192, 73, 'Titleist T Series Irons 3-PW'),
(192, 74, 'Titleist-TSeries'),
(192, 75, 'This is for a set of new Titleist T Series Irons. &nbsp;These will come built to your specs with the heads, shafts and grips of your choice. &nbsp;We can do any of the T Series sets, T100, T200, or T300. We can also do any shaft and grip you want. They will also be built to your desired specs.&nbsp; These are being sold as 3-PW however we can do a different set makeup, just email us to discuss.&nbsp; &nbsp;Please allow 2 weeks for us to assemble these. &nbsp;As always everything is built in house by our staff and built to absolute best quality possible. &nbsp;&nbsp;Email us to discuss your next build.'),
