(193, 73, 'Graphite Design TOUR AD XC'),
(193, 74, 'graphite-desgn-tour-ad-xc'),
(193, 75, 'The Tour AD XC shaft profile is soft in the butt section, stiff in the center section and has a stiff tip to promote low/mid launch angle and low spin with the ball. The Tour AD XC also utilizes the brand new TORAYCA&reg; M40X carbon-fiber pre-preg in the Mid to Tip Section of the shaft as well as the TORAYCA&reg; T1100G carbon-fiber pre-preg with NANOALLOY&reg; technology in the tip section of the shaft for unrivaled shaft stability and precise ball control without the loss of the exceptional feel that Graphite Design shafts are so well known for. These will definitely be one of the hottest shafts this year. &nbsp;As always these will come built to your specs with a tip and grip of your choice. &nbsp; Check out our friends at GOLFWRX for their opinions on the XC.'),
(193, 76, 'This is for a new Graphite Design TOUR AD XC shaft built to your specs. This will include the shaft, tip, grip and a free gift! Keep in mind everything we sell comes with a full warranty and satisfaction guarantee.'),
