(194, 73, 'Mitsubishi Diamana ZF Series Shaft'),
(194, 74, 'mitsubishi-zf'),
(194, 75, 'Diamana&trade; ZF-Series takes the signature &lsquo;smooth&rsquo; bend profile Diamana&trade; BF-Series and pushes it in just the right places. Diamana&trade; ZF shafts feature moderately stronger, more stable butt and tip sections with a slightly softer and more active middle section. This produces a shaft that is incredibly solid during shaft loading and unloading, and at impact, but with smoother energy transfer and easier acceleration throughout the swing. The Diamana&trade; ZF-Series will also offer the first-ever 40g Diamana&trade; Fourth Generation Series shaft option. Diamana&trade; ZF-Series are perfect for any player looking to increase clubhead acceleration while maintaining stability and control through impact. Like all of their Diamana&trade; Fourth Generation Series predecessors, Diamana&trade; ZF shafts owe their carefully calibrated stiffness and stability to two unique technologies: MR70 carbon fiber material, and Boron fiber. If you have any questions please ask. These will come with a tip and grip of your choice.&nbsp;'),
(194, 76, '&lt;p&gt;&lt;span style="font-size: medium;"&gt;NEW Mitsubishi ZF Shaft with a tip and grip of your choice, satisfaction guarantee.&lt;/span&gt;&lt;/p&gt;'),
