(197, 74, 'miura-mb101'),
(197, 75, 'Now available from TPC is the new Miura MB 101. The MB-101 incorporates the best characteristics of early Miura designs and models. The subtle refinements to the sole allow the club to travel effortlessly through the turf. The sole width and face thickness have been optimized (from our MB-001) allowing for heightened feel and feedback. &nbsp;These will come built to your specs in house by one our trained master club builders. &nbsp;These will also come with the shafts and grips of your choice. &nbsp; As of 6/15/20 we now have 2 irons available as well.&nbsp;'),
