(199, 73, 'Fujikura Speeder EVOLUTION 6'),
(199, 74, 'speeder-evo-6'),
(199, 75, '&nbsp;The all-new Speeder Evolution VI continues the cadence of high-performance, premium shafts engineered by Fujikura Japan. Developed on the foundation and heritage of the Speeder Evolution Series, Evolution VI incorporates the latest materials and construction practices available with the advanced learnings from its predecessors. Evo VI is based on the profile of Evo IV, offers exceptional speed and stability for longer and straighter shots off the tee. Evo VI features a low-mid launch and spin that fits perfectly between Evo IV and Evo V. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Evo 5 please ask!'),
