(200, 73, '"Peoples Golf" TemperCraft 22oz Water Bottle'),
(200, 74, 'PG-WATERBOTTLE'),
(200, 75, 'The Peoples Clubs is now offering Stainless Steel Tempercraft Water Bottles. These are a premium water bottle with an insulated double wall thats vacuum sealed. These will keep your drink cold for the entire day, they also feature "Peoples Golf" logo. Best of all they are BPA Free and Condensation Free. They also come with a lifetime warranty. We currently have these in black, white, red, and Turquoise.'),
