(201, 73, 'Mitsubishi MMT Graphite Iron Shaft Set'),
(201, 74, 'mrc-mmt'),
(201, 75, 'Born from more than 30-years of composite shaft mastery, the new MMT&nbsp;Taper Iron&nbsp;utilizes a patent pending Metal Mesh Technology (MMT)&nbsp;to redefine the possibilities for feel and performance in a composite iron shaft. A unique metal mesh &ndash; made from individually braided strands of 304 Stainless Steel &ndash;&nbsp;is integrated into the shaft&rsquo;s prepreg layers towards the tip. This improves density and stability, while also allowing for thinner overall composite wall construction. Together this yields a finely tuned, highly responsive shaft that still provides the consistent launch and spin control needed for effective iron play.&nbsp;We have these in both taper and parallel. Installation options are available as well. The price of $150 is for a full iron set installation. &nbsp;'),
(201, 76, 'This is for a new Mitsubishi MMT Iron Shaft Set, this will come built to your specs and also comes with our satisfaction guarantee.'),
