(202, 73, 'Miura Left Hand Tournament Blade TB-901 3-PW'),
(202, 74, 'miura-lhtb901'),
(202, 75, 'The LH TB-901 has a modified toe profile with a subtle shift in weight from toe to heel, allowing the player to more easily square up the club head at impact. Yoshitaka&rsquo;s infamous &ldquo;Y&rdquo; Grind has allowed Miura to deliver two additional offerings to the left-handed golfer. These will come built to your specs with the shafts and grips of your choice. &nbsp;Email us to discuss your next build.&nbsp;'),
