(203, 75, 'Vessel&rsquo;s #1 bestseller upgraded in a new 2.0 version. New special features added with carbon fiber legs, all waterproof zippers, interchangeable straps, carbon fiber towel ring, and genuine leather handles. Materials:Microsuede Backed Synthetic LeatherKnown for its durability, abrasion and heat resistance, and is easy to clean. Top size:6-way with 3 full-length dividers &ndash; 8.5&Prime; x 6.75&Prime; Weight:5.75 lbs/2.6 kg Dimensions:34.5&Prime;H x 13&Prime;L x 12&Prime;W Features:&bull; Cooler pocket&bull; Velour lined valuables pocket&bull; Large garment pocket&bull; Valuables pocket with lock&bull; Magnetic tee pocket&bull; Ball pocket&bull; Double equilibrium strap&bull; Rotator stand technology base&bull; Towel ring&bull; Umbrella holder&bull; Premium YKK zippers with genuine leather pulls&bull; All-weather rain hood&bull; Pen and tee holder'),
