(206, 73, 'Stability Tour Putter Shaft'),
(206, 74, 'stability-tour'),
(206, 75, 'Introducing the new Stability Tour, a putter shaft with a tour-preferred feel and sleeker look. &nbsp;Stability Tour is the result of feedback from the best golfers and coaches in the world and offers the same state-of-the-art performance as the Original Stability Shaft. Just like the original stability these will balance the same as a traditional steel shaft which means it won''t affect your putters swing weight. The stability tour features a smaller sleeker stability tube as well as a black shaft tip just like our popular&nbsp;stability blackout shafts.&nbsp; As always, we can install this&nbsp;shaft on your putter. Simply mail it to us, we will install a new shaft and ship it back. The installed option will also include a free loft and lie adjustment and a free lamkin deep etch grip, additional grips available for purchase. &nbsp;If you need help figuring out which shaft you need please&nbsp;email us.'),
