(207, 73, 'TOUR ISSUE TAYLORMADE M5 10.5 TOUR w/ Fujikura Ventus Black 7X'),
(207, 74, 'm10.5ventusBlack'),
(207, 75, 'NEW TOUR ISSUE TAYLORMADE M5 Tour 10.5 w/ Fujikura Ventus Black 7X. This is new never used. These are extremely rare and very popular on tour right now. This is shafted with a Fujikura Ventus Black 7X. &nbsp;These tour heads are hand picked for tour use, based on better specs or a hotter face. Finally hot melted on the tour van. Almost every pro has already changed over to these. No headcover included with this one. The specs are 45", D2, 60, 10.8, .4 open, Tour Velvet. If you need a different lofted head or a different weight or flex shaft just let us know. As always we are more than willing to accommodate the needs of our customers. We have all of the new 2019 heads available so if you would like to discuss a custom build please email us. As always everything we sell is 100% legit and comes with a satisfaction guarantee.'),
