(208, 74, 'm10-5tourT1100'),
(208, 75, 'NEW TOUR ISSUE TAYLORMADE M5 Tour 10.5 w/ T1100 65 6.5TX. This is new never used. These are extremely rare and very popular on tour right now. This is shafted with a Project X HZRDUS T1100. &nbsp;These tour heads are hand picked for tour use, based on better specs or a hotter face. Finally hot melted on the tour van. Almost every pro has already changed over to these. No headcover included with this one. The specs are 45.5", D2, 59.7, 10.1, .75 open, W/B Multi Grip. If you need a different lofted head or a different weight or flex shaft just let us know. As always we are more than willing to accommodate the needs of our customers. We have all of the new 2019 heads available so if you would like to discuss a custom build please email us. As always everything we sell is 100% legit and comes with a satisfaction guarantee.'),
