(209, 75, 'This is for a set of new Titleist 620 Series Irons. &nbsp;These will come built to your specs with the heads, shafts and grips of your choice. &nbsp;We can do any of the 620 Series, CB or MB, or we can do a combo set. We can also do any shaft and grip you want. They will also be built to your desired specs.&nbsp; These are being sold as 3-PW however we can do a different set makeup, just email us to discuss.&nbsp; &nbsp;Please allow 2 weeks for us to assemble these. &nbsp;As always everything is built in house by our staff and built to absolute best quality possible. &nbsp;&nbsp;Email us to discuss your next build. The new 620 MB irons stay true to everything players have come to trust from this classic model, with distinct refinements that make them better than ever. Reduced offset for the ultimate player&rsquo;s look Progressive blade length for optimized play throughout the set Tour-refined sole for improved turf interaction The new 620 CB irons stay true to everything players have come to trust from this classic model, with distinct refinements that make them better than ever. Reduced offset and topline for the ultimate player&rsquo;s look Progressive blade length for optimized play throughout the set Co-forged tungsten in 3- and 4-iron for improved balance Tour-refined sole for improved turf interaction'),
