(366, 74, 'AldilaRIPX'),
(366, 75, 'ALDILA&reg; RIPX&reg; marks the return of one of ALDILA&reg; Golf&rsquo;s most revolutionary and iconic brands. Integrating the Reverse Inter-Laminar Placement (R.I.P.) Technology, RIPX&reg;&nbsp; takes stability to a whole new level. An innovative profile balances an even stiffer butt section with an increase in torque to create a shaft that feels both incredibly stable in the player&rsquo;s hands and highly responsive at impact. A MICRO MAMBA&reg;&nbsp;TECHNOLOGY&nbsp;&ndash; 50% thinner and 50% lighter than the original MAMBA&reg; TECHNOLOGY &shy;&ndash;&nbsp;is applied from the tip into the mid-section for improved stability and feel over the RIP&nbsp;ALPHA. All wrapped in a bold look that declares that RIPX&reg; means business. This will come custom built to your desired specs with a tip and grip of your choice. These are custom ordered so please allow for a little extra time, also please note that overnight shipping might be delayed.'),
