(368, 73, 'Mitsubishi Tensei AV RAW (White, Orange, or Blue)'),
(368, 74, 'Mitsubishi Tensei AV RAW (White, Orange, or Blue)'),
(368, 75, 'This shaft will be brand new and built to your specs in house by a trained member of our staff. This will come with a tip of your choice and a grip of your choice. &nbsp;If you have any questions please ask. TENSEI&trade; AV RAW White blends modern performance with a stiff-tip, low-launch profile. The RAW finish reveals the Aluminum Vapor (AV) Coated Weave in the butt section, a visible cue of the added stability this unique weave provides. Power transfers straight from the hands through the ball for low, piercing flight. TENSEI&trade; AV RAW White is best for stronger players who want a stiffer-tipped, lower-launching ball flight with a feeling of greater stability and control throughout the swing. TENSEI&trade; AV RAW Orange is a Counter-Balanced shaft that shifts the balance point towards the hands, giving players the opportunity to make specific performance adjustments by altering shaft length or adding weight to the clubhead. The RAW finish reveals the Aluminum Vapor (AV) Coated Weave in the butt section, a visible cue of the added stability this unique weave provides. Power transfers straight from the hands through the ball for consistent, mid-launching flight. TENSEI&trade; AV RAW Orange is a Counter-Balanced shaft for players making specific weight adjustments, who want to feel greater stability and control throughout the swing. TENSEI&trade; AV RAW Blue blends modern performance with a classic, smooth bend profile. The RAW finish reveals the Aluminum Vapor (AV) Coated Weave in the butt section, a visible cue of the added stability this unique weave provides. Power transfers straight from the hands through the ball for a consistent, mid-launching flight. The 55g option includes our Straight Flight Weighting (SFW) system which makes it easier to turn the club over through impact, reducing the tendency to fade the ball or even promoting a slight draw. TENSEI&trade; AV RAW Blue is best for players who want a mid-launching ball flight with a feeling of greater stability and control throughout the swing. This is for a Mitsubishi Tensei AV RAW (White, Orange, or Blue.) This will come built to your specs with the tip and grip of your choice.'),
(368, 76, 'This is for a Mitsubishi Tensei AV RAW (White, Orange, or Blue.) This will come built to your specs with the tip and grip of your choice.'),
