INSERT INTO `catalog_product_entity_text` (`value_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(1, 75, 0, 1, '<p>This will be a custom installed Fujikura Speeder Tour Spec Hybrid shaft of your choice.  The Speeder is one of the most popular shafts on tour.  A bunch of pros are playing these including Ernie Els, Jim Furyk, Harrington, Zach Johnson, Vijay, these are everywhere.  Fujikura shafts have been dominating the driver shaft count this year, mostly in part to the extremely successful Speeder line.   Included in the auction is the install of this shaft in your club with a free grip.  Or we can install it in a tip of your choice.  We have all of the tips in stock.  This auction does not include the tip.  We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full warranty.  If you have any questions please ask.</p>'),
(2, 76, 0, 1, '<p>New Tour Issue Fujikura Speeder TS Hybrid Shaft</p>'),
(3, 85, 0, 1, 'Fujikura Speeder Tour Spec Hybrid'),
(4, 75, 0, 2, '<p>This will be a custom installed Fujikura Speeder Tour Spec shaft of your choice. The Tour Spec is picking up popularity on tour. Its the lower torque, lower launching, slightly heavier version of the widely popular Speeder VC Series. A bunch of pros are playing these including Mickelson, Michael Bradley, and several others. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. &amp;nbsp;We have all of the tips in stock, all of them! This wil include the labor and a free grip. We are an authroized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full warranty. If you have any questions please ask.</p>'),
(5, 76, 0, 2, '<p>Fujikura Speeder Tour Spec</p>'),
(8, 75, 0, 3, '<p><span>This is for a</span><span>&nbsp;NEW Tour Issue&nbsp;Graphite Design Deep Impact Hybrid Shaft.</span><span>&nbsp; These are very popular shafts on tour, Tiger Woods is playing these shafts. &nbsp;There are several other pros including Lucas Glover, Robert Karlsson, Jesper Parnevick, D.A. Points, Webb Simpson, Tim Clark, Tim Herron, Nick Watney, Kevin Chappell, Darron Stiles, Scott McCarron, Brian Davis, Ben Kohles, Luke Guthrie, Russell Hanley, Justin Hicks, Scott Gardiner, Jimmy Walker, D.H. Lee, Kevin Stadler, Shawn Stefani, Jonas Blixt, Brendon Dejonge, Jon Fiedler, Paul Haley, Justin Hicks, Ryo Ishikaway, Seung-Yol Noh, Sang Moon Bae, Charlie Wi and several others.&nbsp;</span><span>This shaft will come installed in any tip of your choice.&nbsp;</span></p>\r\n<p><strong>Update as of 6/1/20 they have updated the graphics on these, for the time being we have some of both new and old, if you prefer the newer graphics please ask.&nbsp;</strong></p>\r\n<p><span></span></p>'),
(9, 76, 0, 3, '<p>New Tour Issue Graphite Design DI Hybrid Shaft</p>'),
(10, 85, 0, 3, 'New Tour Issue Graphite Design DI (Deep Impact) Hybrid'),
