(24, 85, 0, 8, 'New Dozen of "The Peoples Clubs" Titleist ProV1 '),
(31, 75, 0, 11, '<p><span style="font-size: medium;">This is a New Oban Kiyoshi White Hybrid. This is a brand new uncut tour issue shaft. We can install this in your club or install any tip on it and grip it so its set up and ready to go! Any in stock tip is included with this purchase. The kiyoshi White is a great mid launching low spinning shaft. One of the best shafts available in this category. These are custom ordered and built for you, therefore they might take little longer to get set up. </span></p>'),
(32, 76, 0, 11, '<p>Tour Issue Oban Kiyoshi White Hybrid 95g</p>'),
(33, 85, 0, 11, 'Oban Kiyoshi White Hybrid '),
(34, 75, 0, 12, '<p><span style="font-size: medium;">This is a New Oban Kiyoshi White Hybrid. This is a brand new uncut tour issue shaft. We can install this in your club or install any tip on it and grip it so its set up and ready to go! Any in stock tip is included with this purchase. The kiyoshi White is a great mid launching low spinning shaft. One of the best shafts available in this category. These are custom ordered and built for you, therefore they might take little longer to get set up. </span></p>'),
(35, 76, 0, 12, '<p>Tour Issue Oban Kiyoshi White Hybrid 95g</p>'),
(38, 75, 0, 13, '<p><span style="font-size: medium;">This is a New Oban Kiyoshi Purple Shaft. This is a brand new uncut tour issue shaft. We can install this in your club or install any tip on it and grip it so its set up and ready to go! Any in stock tip is included with this purchase. The kiyoshi White is a great mid launching low spinning shaft. One of the best shafts available in this category. These are custom ordered and built for you, therefore they might take little longer to get set up. </span></p>'),
(39, 76, 0, 13, '<p>Tour Issue Oban Kiyoshi Purple</p>'),
(41, 75, 0, 14, '<p><span style="font-size: medium;">This is a New Oban Kiyoshi Gold Shaft. This is a brand new uncut tour issue shaft. We can install this in your club or install any tip on it and grip it so its set up and ready to go! Any in stock tip is included with this purchase. The kiyoshi White is a great mid launching low spinning shaft. One of the best shafts available in this category. These are custom ordered and built for you, therefore they might take little longer to get set up. </span></p>'),
(42, 76, 0, 14, '<p>Tour Issue Oban Kiyoshi Gold</p>'),
(44, 75, 0, 15, '<p><span style="font-size: medium;">This is a New Oban Kiyoshi Blue Tour Limited Shaft. This is a brand new uncut tour issue shaft. We can install this in your club or install any tip on it and grip it so its set up and ready to go! Any in stock tip is included with this purchase. The kiyoshi White is a great mid launching low spinning shaft. One of the best shafts available in this category. These are custom ordered and built for you, therefore they might take little longer to get set up. </span></p>'),
(45, 76, 0, 15, '<p>Tour Issue Oban Kiyoshi Blue Tour Limited</p>'),
(51, 75, 0, 18, '<p><span style="font-size: medium;">This is a New Oban Kiyoshi Black Shaft. This is a brand new uncut tour issue shaft. We can install this in your club or install any tip on it and grip it so its set up and ready to go! Any in stock tip is included with this purchase. The kiyoshi White is a great mid launching low spinning shaft. One of the best shafts available in this category. These are custom ordered and built for you, therefore they might take little longer to get set up. </span></p>'),
(52, 76, 0, 18, '<p>Tour Issue Oban Kiyoshi Black</p>'),
(53, 85, 0, 18, 'Oban Kiyoshi Black Shaft'),
(54, 75, 0, 19, '<p><span style="font-size: medium;">NEW Tour Issue Graphite Design TOUR AD Iron Shaft. These are amazing iron shafts, the feedback on these has been stellar. Graphite Design just refreshed the graphics on these for 2016. This is for 1 shaft, if you are interested in purchasing a set please message us for a discount. We are an authorized Graphite Design dealer, every shaft we sell is guaranteed 100% legit and comes with a full warranty and satisfaction guarantee! </span></p>'),
(55, 76, 0, 19, '<p>NEW UNCUT TOUR ISSUE Graphite Design TOUR AD Iron Shaft</p>'),
(56, 85, 0, 19, 'Graphite Design TOUR AD Iron Shaft'),
(57, 75, 0, 20, '<p>This will be a custom installed Fujikura Speeder Tour Spec shaft of your choice. The Tour Spec is picking up popularity on tour. Its the lower torque, lower launching, slightly heavier version of the widely popular Speeder VC Series. A bunch of pros are playing these including Mickelson, Michael Bradley, and several others. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. &amp;nbsp;We have all of the tips in stock, all of them! This wil include the labor and a free grip. We are an authroized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full warranty. If you have any questions please ask.</p>'),
(58, 76, 0, 20, '<p>Fujikura Speeder Tour Spec</p>'),
(60, 75, 0, 21, '<p><span style="font-size: medium;">NEW Tour Issue Fujikura Speeder Evolution. The Evolution is a new Shaft in the Speeder Series, these are made of a new Carbon Fiber, never before used, Toray T1100G, the result is a longer better feeling shaft. This will be for a speeder of your choice. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. This will include the labor and a free grip. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full warranty. If you have any questions please ask. </span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: medium;">Please note these have been discontinued once we sell out they will be gone forever.</span></p>'),
(61, 76, 0, 21, '<p>The Motore Speeder 757 is without a doubt the most iconic and sought after shaft brand in history.</p>'),
(63, 85, 0, 22, 'The Peoples Clubs Gift Certificate'),
(64, 75, 0, 22, '<p><span style="font-size: medium;">These come in $25 increments. Give them to you friends and family this holiday season. Or better yet, get your significant other to buy these for your Christmas Gift and use them later. Best of all these never expire. </span></p>'),
(65, 76, 0, 22, '<p>Peoples.Golf Gift Certicate - Use on ThePeoplesClubs.com or TourStockPutters.com. Simply email us and let us know how we can help!</p>'),
(66, 75, 0, 23, '<p><span style="font-size: medium;">NEW Tour Issue Graphite Design MJ Shaft. The Tour MJ utilizes premium aerospace quality 50t carbon-fiber materials to provide the best performing shaft available. Designed with a softer tip and stiffer mid to butt section to promote a higher launch condition and low/mid spin, the Tour AD MJ also utilizes the 3rd generation version of the Toray Nano-alloy material technology known as &ldquo;DI Technology&rdquo; in the tip section of the shaft for additional shaft stability, exceptional feel and precise ball control. Try the new Tour AD MJ, it might just make a major impact on your game today. These shafts are brand new for 2015, they already have a win on the PGA and several pros gaming them. We are an authorized Graphite Design dealer, every shaft we sell is guaranteed 100% legit and comes with a full warranty and money back guarantee! This shaft will come installed in any tip of your choice as well as a grip. These are very popular shafts on tour. For a limited time you will also receive a free gift with the purchase of these shafts!</span></p>'),
(67, 76, 0, 23, '<p>NEW UNCUT TOUR ISSUE Graphite Design MJ Shaft</p>'),
(72, 75, 0, 25, '<p><span style="font-size: medium;">NEW Tour Issue Graphite Design HY Hybrid Shaft. The HY is graphite designs most popular hybrid shaft. They are mid/high launch and mid spin. Click here for more information, reviews, and pictures of these shafts. We are an authorized Graphite Design dealer, every shaft we sell is guaranteed 100% legit and comes with a full warranty and money back guarantee! This shaft will come installed in any tip of your choice as well as a grip. </span></p>'),
(73, 76, 0, 25, '<p>This is for a new Graphite Design TOUR AD HY Hybrid Shaft of your choice.</p>'),
(74, 85, 0, 25, 'Graphite Design TOUR AD HY Hybrid'),
(75, 75, 0, 26, '<p><span style="font-size: medium;"> NEW Tour Issue Graphite Design M9003 Shaft. These are graphite designs newest shaft. They are made with the new Toray T1100G Graphite, resulting in a great feel and a higher ball speed. They are low launch with extremely low spin. We are an authorized Graphite Design dealer, every shaft we sell is guaranteed 100% legit and comes with a full warranty and money back guarantee! This shaft will come installed in any tip of your choice as well as a grip. These are very popular shafts on tour.</span></p>'),
(76, 76, 0, 26, '<p>NEW UNCUT TOUR ISSUE Graphite Design TOUR AD M9003</p>'),
(78, 75, 0, 27, '<p><span style="font-size: medium;">NEW Tour Issue Graphite Design GP Shaft. The GP is graphite designs newest shaft. They are mid launch and low spin. These utilize the new Toray 1100G carbon fiber in the tip section, resulting in a better feel and higher ball speed. These are quite possibly the Greatest Performing shaft graphite design has ever made.</span></p>'),
(79, 76, 0, 27, '<p>NEW UNCUT TOUR ISSUE Graphite Design GP Shaft</p>'),
(81, 75, 0, 28, '<p><span style="font-size: medium;">These are extremely popular on tour right now. They have since changed the graphics on these, they are still handcrafted however now have a black base and then HZRDUS color corresponds to shaft color/model.   This is for 1 shaft, you choose the weight and flex, as well as the adapter and grip.  Please note these are custom ordered and built to your specs, therefore please allow a little extra time to ship, these usually take about a week to get in stock and assembled. If you have any questions please message us.</span></p>'),
(82, 76, 0, 28, '<p>This is for a NEW Tour Issue Project X HZRDUS Black or Yellow Shaft 65 or 75 (5.5, 6.0, or 6.5) with a tip and grip of your choice.</p>'),
(84, 85, 0, 28, 'project x, hzrdus'),
(87, 75, 0, 30, '<p><span style="font-size: medium;">NEW Tour Issue Fujikura Speeder Evolution II. The 2016 Speeder Evolution II was just released, they are very hard to come by right now. These are slightly higher launching and spinning than the blue evolution. They utilize a metal composite technology in the handle to provide even more stability than the already stable evolution. This stability has allowed Fujikura to use a 90 ton fiber to create a lighter stiffer tip section and increase feel and performance throughout the shaft. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. This will include the labor and a free grip. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full warranty. If you have any questions please ask.</span></p>'),
(88, 76, 0, 30, '<p>This is for a new tour issue Fujikura Speeder EVOLUTION 2 shaft of your choice built to your specs.</p>'),
(89, 85, 0, 30, 'Fujikura Speeder EVOLUTION 2 '),
(90, 75, 0, 31, '<p>NEW Uncut Oban Kiyoshi HB. This is a brand new uncut tour issue shaft. We can install this in your club or install any tip on it and grip it so its set up and ready to go! This will come with the tip of your choice. The kiyoshi HB is a great high launching low spinning shaft.</p>'),
(91, 76, 0, 31, '<p>This is for a new tour issue OBAN KIYOSHI HB High Balance shaft of your choice built to your specs with the tip and grip of your choice.</p>'),
(92, 85, 0, 31, 'OBAN KIYOSHI HB High Balance'),
(93, 75, 0, 32, '<p><span style="font-size: medium;">NEW Project X HZRDUS Shaft. These are extremely popular on tour right now, they were just released a few weeks ago and are getting tons of play already. This is for 1 shaft, you choose the weight and flex, as well as the adapter and grip. After purchasing just message us with these details. These are Project X newest shaft, they are low launching and spinning. Please note these are custom ordered and built to your specs, therefore please allow a little extra time to ship. If you have any questions please message us.</span></p>'),
(94, 76, 0, 32, '<p>This is for a NEW Tour Issue Project X HZRDUS BLACK Hybrid Shaft (5.5, 6.0, or 6.5) with a tip and grip of your choice.</p>'),
(95, 85, 0, 32, 'Project X HZRDUS Hybrid Shaft '),
(96, 75, 0, 33, '<p><span style="font-size: medium;">NEW Tour Issue Graphite Design GP Black Shaft. The GP is graphite designs newest shaft. They are mid launch and low spin. These utilize the new Toray 1100G carbon fiber in the tip section, resulting in a better feel and higher ball speed. These are quite possibly the Greatest Performing shaft graphite design has ever made.</span></p>'),
(97, 76, 0, 33, '<p>NEW UNCUT TOUR ISSUE Graphite Design GP Black Shaft</p>'),
(99, 75, 0, 34, '<p><span style="font-size: medium;">NEW Tour Issue Graphite Design TOUR AD Utility/Driving Iron Shaft. These are amazing shafts, the feedback on these has been stellar. The Tour AD Utility Driving Iron shafts were designed to work with the modern Utility Driving Iron heads that have recently become popular. They just released these on tour and they are blowing up already. They come in two color options of orange with white bands or black with white bands. This is for 1 shaft, if you are interested in purchasing a set please message us for a discount. We are an authorized Graphite Design dealer, every shaft we sell is guaranteed 100% legit and comes with a full warranty and money back guarantee!</span></p>'),
(100, 76, 0, 34, '<p>New Tour Issue Graphite Design Tour AD Utility Driving Iron Shaft</p>'),
(102, 75, 0, 35, '<p><span style="font-size: medium;">NEW Project X LZ Shafts. These are extremely popular on tour right now. The LZ technology is borrowed from the company&rsquo;s graphite wood shafts. &nbsp;&ldquo;By reducing the stiffness in the midsection and stiffening the tip and butt section, we created a shaft that is easier to load and has exceptional feel,&rdquo; said Don Brown, director of golf innovation for Project X. &ldquo;The result is a shaft that is stable in the downswing, increases ball speed and produces a mid-launch trajectory with a flat apex for increased distance and soft landings.&rdquo; If you have any questions please message us. We can also install these, message us for price.</span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;">Update as of 2/18/20 we have 5 set of these in the tour only 7.0. &nbsp;These are extremely hard to come by.&nbsp;</span></p>'),
(103, 76, 0, 35, '<p>Project X LZ Loading Zone 5.5, 6.0 or 6.5 Iron Shafts (3-PW)</p>'),
(104, 85, 0, 35, 'Project X LZ Loading Zone Iron Shafts (Tour Only 7.0 Included) '),
(105, 75, 0, 36, '<p><span style="font-size: medium;">NEW Tour Issue Fujikura Speeder Evolution 2.0. This is the tour only shaft thats used by Dustin Johnson. The 2.0 is 69g and 2.8 torque, then the 4.0 is 88g and 2.7 torque. The Peoples Clubs is the only place carrying these. Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. This will include the labor and a free grip. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full warranty. If you have any questions please ask.</span></p>'),
(106, 76, 0, 36, '<p>Fujikura Motore Speeder Evolution 2.0 or 4.0 X (TOUR ONLY DJ Shaft)</p>'),
(107, 85, 0, 36, 'Fujikura Motore Speeder Evolution 2.0 X (TOUR ONLY Dustin Johnson Shaft)'),
(108, 75, 0, 37, '<p><span style="font-size: medium;">New Mitsubishi Diamana BF Shaft. This shaft brand new and built to your specs. This will come with a tip of your choice and a grip of your choice. Please understand these are custom ordered and usually take around a week. The BF is based off the Blueboard, which was extremely popular on tour and off. These are mid/high launching and mid spinning. If you have any questions please ask. </span></p>'),
(109, 76, 0, 37, '<p>NEW Mitsubishi Diamana BF Series Shaft</p>'),
(110, 85, 0, 37, 'New Mitsubishi Diamana BF Series Shaft'),
(111, 75, 0, 38, '<p><span style="font-size: medium;">NEW Tour Issue Modus Iron Shafts. These are extremely popular on tour right now, they are one of the most played iron shaft on tour right now. These have an amazing feel, one of the best iron shafts I have ever hit. If you have any questions please message us. We can also install these, message us for price.</span></p>'),
(112, 76, 0, 38, '<p>Nippon Modus Series Iron Shafts</p>'),
(113, 85, 0, 38, 'Nippon Modus Series Iron Shafts (3-PW)'),
(114, 75, 0, 39, '<p><span style="font-size: medium;">NEW Tour Issue Modus Wedge Shafts. These are extremely popular on tour right now, they are one of the most played iron and wedge shaft on tour right now. These have an amazing feel, one of the best iron shafts I have ever hit. If you have any questions please message us. We can also install these, message us for price.</span></p>'),
(115, 76, 0, 39, '<p>Nippon Modus Series Wedge Shafts</p>'),
(116, 85, 0, 39, 'Nippon Modus Series Iron Shafts (3-PW)'),
(118, 75, 0, 40, '<p><span style="font-size: medium;">NEW Fujikura Speeder Evolution 3. The Evolution 3 is mid launch and spin, they were designed for the golfer looking for tour-level feel and performance, but with flighting and spin that will keep the ball in the air a bit longer. They utilize a metal composite technology, similar to the Evo 2. This allows the wall to be thinner resulting in a better feel without sacrificing the stiffness of the shaft. In our testing we have seen increased ball speed, higher launch, lower spin and best of all more distance! Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Evo 3 please ask! </span><br /><br /><span style="font-size: medium;"> Here are some reviews on the Evo 3.</span></p>\r\n<p><span style="font-size: medium;"><a title="Blog" href="https://thepeoplesclubs.com/blog/Evo3/">Our Blog</a></span></p>\r\n<p><span style="font-size: medium;"><a title="GOLFWRX What you need to know" href="http://www.golfwrx.com/408692/fujikura-speeder-evolution-iii-what-you-need-to-know/">GolfWRX</a></span></p>\r\n<p><span style="font-size: medium;"><a title="Evo 3 Spotted On Tour" href="http://www.golfwrx.com/forums/topic/1366880-new-fujikura-evolution-iii-shaft-2016-pga-championship/">Evo 3 Spotted on Tour</a></span></p>\r\n<p><span style="font-size: medium;"><a title="Evo 3 661" href="http://pluggedingolf.com/fujikura-speeder-evolution-iii-661-shaft-review/">Plugged In Golf- 661</a></span></p>\r\n<p><span style="font-size: medium;"><a title="Evo 3 757" href="http://pluggedingolf.com/fujikura-speeder-evolution-3-757-shaft-review/">Plugged In Golf- 757&nbsp;</a></span></p>'),
(119, 76, 0, 40, '<p>&lt;p&gt;&lt;span style="font-size: medium;"&gt;This is for a new Fujikura Speeder EVOLUTION 3 shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.&lt;/span&gt;&lt;/p&gt;</p>'),
(120, 85, 0, 40, 'Fujikura Speeder EVOLUTION 3'),
(121, 75, 0, 41, '<p><span style="font-size: medium;">New Mitsubishi Diamana Limited Edition D+ Shaft. This is the same shaft as being used by Tiger Woods. This shaft will be brand new and built to your specs. This will come with a tip of your choice and a grip of your choice. &nbsp;If you have any questions please ask. </span></p>'),
(122, 76, 0, 41, '<p>This is for a NEW Mitsubishi Diamana Limited Edition D+. This will come built to your specs with the tip and grip of your choice. As always everything we sell comes with a full money back guarantee.</p>'),
(123, 85, 0, 41, 'Mitsubishi Diamana Limited Edition LTD D+'),
(124, 75, 0, 42, '<p><span style="font-size: medium;">New Tour Issue Mitsubishi Diamana Tensei Shaft. We currently have the Pro Orange, Pro Blue and Pro White in stock. These shafts are getting tons of play both on and off tour. Tiger Woods, Rory McIlroy, Jason Day, Justin Rose, and several others. &nbsp;This shaft will be brand new and built to your specs. This will come with a tip of your choice and a grip of your choice. &nbsp;If you have any questions please ask. </span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><a title="GOLFWRX" href="http://www.golfwrx.com/523544/the-8-hottest-driver-shafts-of-2018-on-the-pga-tour/?utm_source=Front&amp;utm_medium=Featured_Trending&amp;utm_campaign=GolfWRX_OnSite&amp;utm_content=unused"><span style="font-size: medium;">Check out our friends at GOLFWRX for their opinions on the Tensei Orange. </span></a></p>'),
(125, 76, 0, 42, '<p>This is for a NEW Prototype Mitsubishi Tensei CK Pro Red, Orange, Blue, or White . This will come built to your specs with the tip and grip of your choice. As always everything we sell comes with a satisfaction guarantee.</p>'),
(128, 75, 0, 43, '<p><span style="font-size: medium;">NEW Graphite Design TP Shaft. These are graphite designs newest shaft. These have the new FTT Fast Taper Technology, resulting in an overall feeling of greater club head control at impact and an increase in club head speed through the swing. They are made with 50T carbon and the new Toray T1100G Graphite, for additional shaft stability, exceptional feel and precise ball control. They are mid to high launch with low spin. Some are calling these a new and improved DI. We are an authorized Graphite Design dealer, every shaft we sell is guaranteed 100% legit and comes with a full warranty and money back guarantee! This shaft will come installed in any tip of your choice as well as a grip. These are very popular shafts on tour.</span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>\r\n<p><span style="font-size: medium;"><a title="Blog!" href="https://thepeoplesclubs.com/blog/TP/">Go here to see our blog on these.&nbsp;</a></span></p>\r\n<p><span style="font-size: medium;"><a title="TP" href="http://www.golfwrx.com/407532/shaft-test-graphite-designs-new-tour-ad-tp-versus-the-famous-tour-ad-di/">Or click here to see what our friends at GOLFWRX though.&nbsp;</a></span></p>'),
(129, 76, 0, 43, '<p><span style="font-size: medium;">This is for a new Graphite Design TOUR AD TP shaft built to your specs. This will include the shaft, tip, grip and a free gift! Keep in mind everything we sell comes with a full warranty and satisfaction guarantee. </span></p>'),
(130, 85, 0, 43, 'Graphite Design TOUR AD TP'),
(131, 75, 0, 44, '<p><span style="font-size: medium;">NEW Project X HZRDUS Shaft. These have the tour graphics and are only available on tour! They are extremely popular on tour right now, they were just released a few weeks ago and are getting tons of play already. If you have any questions please message us. We only have a few of these available, please see the drop down menu for the options. </span></p>'),
(132, 76, 0, 44, '<p>This is for a NEW Tour Only Project X with a tip and grip of your choice.</p>'),
(133, 85, 0, 44, 'Tour Only Project X HZRDUS Shafts'),
(134, 75, 0, 45, '<p><span style="font-size: medium;">This is for a New Tour Issue Project X HZRDUS T1100 Shaft. These have been blowing up on tour, they were one of the hottest shafts on tour last year and we''re sure they will be again this year. These have been the number 1 shaft on tour for several weeks. They are made of the Ultra High End T1100 Toray Graphite. This new graphite results in a much better feeling shaft while still being low launching and spinning.</span></p>\r\n<p><span style="font-size: medium;">These are one of the only golf shafts that are made in the USA. The T1100 shafts are "HandCrafted" in their California manufacturing facility, which ensures the tightest of tolerances. They are finished in a sweet Mirror finish that looks amazing in person. Please email us with any questions.&nbsp;<br /></span></p>\r\n<p><span style="font-size: medium;">We now have a few of the Tour Only 85 6.5 available.&nbsp;</span></p>\r\n<p><span style="font-size: medium;"><a title="Blog!" href="https://thepeoplesclubs.com/blog/T1100/">Check out our new blog post on the T1100!</a></span></p>\r\n<p><a title="GOLFWRX" href="http://www.golfwrx.com/523544/the-8-hottest-driver-shafts-of-2018-on-the-pga-tour/?utm_source=Front&amp;utm_medium=Featured_Trending&amp;utm_campaign=GolfWRX_OnSite&amp;utm_content=unused"><span style="font-size: medium;">Check out our friends at GOLFWRX for their opinions on the T1100.</span></a></p>'),
(135, 76, 0, 45, '<p><span style="font-size: medium;">This is for a NEW Tour Only Project X HZRDUS T1100 with a tip and grip of your choice. As always everything we sell comes with a satisfaction guarantee. </span></p>'),
(136, 85, 0, 45, NULL),
(138, 75, 0, 46, '<p><span style="font-size: medium;">NEW Fujikura ATMOS Tour Spec Shaft. &nbsp;These are new for 2017, they are a revamp of the wildy successful Motore Speeder line. &nbsp;These have been picking up a ton of play on tour. &nbsp;They come in three different unique profiles. &nbsp;They are Black, Blue, and Red. The Black is low launching and spinning. The Blue is mid launch and spin. &nbsp;Then the Red is high launch and spin. &nbsp;</span></p>\r\n<p><span style="font-size: medium;">Included is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Fujikura Atmos please ask!&nbsp;</span></p>\r\n<p><br /><span style="font-size: medium;"> Here are some reviews on the Fujikura Atmos.</span></p>\r\n<p><span style="font-size: medium;"><a title="ATMOS" href="http://www.golfwrx.com/forums/topic/1427888-fujikura-atmos/">GolfWRX&nbsp;Discussion</a></span></p>\r\n<p><span style="font-size: medium;"><a title="ATMOS" href="http://www.golfwrx.com/422898/fujikura-launches-new-atmos-tour-spec-shafts-on-pga-tour/">GolfWRX Review</a></span></p>\r\n<p><a title="GOLFWRX" href="http://www.golfwrx.com/523544/the-8-hottest-driver-shafts-of-2018-on-the-pga-tour/?utm_source=Front&amp;utm_medium=Featured_Trending&amp;utm_campaign=GolfWRX_OnSite&amp;utm_content=unused"><span style="font-size: medium;">Check out our friends at GOLFWRX for their opinions on the Atmos. </span></a></p>'),
(139, 76, 0, 46, '<p><span style="font-size: medium;">This is for a new Fujikura ATMOS Tour Spec shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.</span></p>'),
(140, 85, 0, 46, 'Fujikura ATMOS Tour Spec'),
(141, 85, 0, 47, 'New Tour Issue Rifle Iron Shaft'),
(142, 75, 0, 48, '<p>NEW Fujikura Speeder Platinum. The Platinum Speeder is designed for the skilled golfer who is looking increase swing speed through lighter weight while keeping spin to a minimum. These are made of 90T carbon and Toray 1100G, one of very few shafts using this high end space grade materials. This results in a stable shaft with low spin. These shafts are getting tons of play on tour, they are currently being used by Matt Kuchar, Colt Knost, Justin Hicks, Freddie Jacobson, Scott Brown, and several others.</p>\r\n<p>Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Speeder Platinum please ask!</p>\r\n<p><br /> Here are some reviews on the Platinum Speeder.</p>\r\n<p><a title="Reviews" href="http://www.pgatour.com/equipmentreport/2016/05/23/fujikura-speeder-platinum-shaft.html">PGATOUR.com</a></p>\r\n<p>&nbsp;</p>'),
(143, 76, 0, 48, '<p>This is for a new Fujikura Platinum Speeder shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.</p>'),
(144, 85, 0, 48, 'Fujikura Platinum Speeder'),
(145, 85, 0, 49, 'Fujikura MCI Iron Shaft '),
(146, 75, 0, 49, '<p>When comparing graphite shafts with steel shafts, graphite&rsquo;s center of gravity is located on the butt side of the club which affects the ability to achieve a desirable swing balance. In order to improve this, additional materials are wound on the tip side to add weight. This creates greater balance, but also higher rigidity overall. In the new MCI (Metal Composite Irons), Metal Composite Technology was developed to combine the best attributes of steel and graphite into one revolutionary composite shaft. Increased hitting ability, even weight distribution, and individual length brings perfect flow of frequency and torque within your swing.</p>\r\n<p>We can also get the black however please note these are custom ordered from Japan and will take longer. &nbsp;Email us to discuss.&nbsp;</p>\r\n<p>This is for 1 shaft. Included in the auction is the install of this shaft in your club with a free grip. &nbsp;We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the MCIs please ask!</p>\r\n<p><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
(147, 76, 0, 49, '<p>This is for a new MCI shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.</p>'),
(148, 75, 0, 50, '<p><span style="font-size: medium;">KBS is proud to introduce the newest member of the KBS Golf Shaft Family; the KBS TOUR FLT. The KBS TOUR FLT is a Tour influenced shaft to fit the broadest range of players, from the Amateur Golfer, to a Tour Professional.\r\nOffering a lower ball flight for the 8 Iron and down clubs, and a higher ball flight for the 6 Iron and up, it accomplishes this while being longer and providing more spin, with the consistency and efficiency of more control. The installed price of $150 is for the whole set and includes grips.  For a single install it would be cheaper. </span></p>'),
(149, 76, 0, 50, '<p>This is for a set of Tour Issue KBS Tour FLT Matte Black Iron Shafts (3-PW.)</p>'),
(150, 85, 0, 50, 'KBS Tour FLT Matte Black Iron Shafts (3-PW)'),
(151, 75, 0, 51, '<p><span style="font-size: medium;">The KBS Tour Hybrid Graphite Prototype is here. Inspired and designed from the KBS Tour shaft, the most popular steel shaft in the KBS Golf Shaft line, the KBS Tour Graphite Hybrid Prototype offers KBS signature feel, but finally in a graphite shaft model.\r\nOffering performance and stability throughout the entire make of the shaft which lets the player hit more aggressive, longer, and consistent shots for hybrid clubs. KBS will be the first shaft brand to create seamless performance transition from your Graphite Hybrid shafts, to your KBS Iron and KBS Wedge shafts.</span></p>'),
(152, 76, 0, 51, '<p>This is for a KBS TOUR Graphite Hybrid Prototype built to your specs.</p>'),
(153, 85, 0, 51, 'KBS TOUR Graphite Hybrid Prototype');
INSERT INTO `catalog_product_entity_text` (`value_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(154, 75, 0, 52, '<p><span style="font-size: medium;">The KBS Tour $-Taper has finally arrived! This will be the newest steel shaft in the KBS Golf Shafts line after continually delivering the best steel shafts on the market for ten years. Head of research and development and the brain behind the best steel shafts in golf, longtime KBS designer Kim Braly wanted the KBS Tour $-Taper to provide superior feel while maintaining shot work-ability for players seeking a mid-launch and low spin shaft. The KBS Tour $-Taper shares the same bend profile as the KBS TOUR with elongated step patterns for spin, generating a stable performance throughout the swing.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: medium;">KBS is proud to offer the KBS Tour $-Taper in 2 finishes: Black PVD and Classic KBS Chrome, KBS Tour $-Taper will come in the following Flex and Weights, R 110g, R+ 115g, S 120g, S+ 125g and X 130g. And Innovated for the KBS Tour $-Taper is our first ever 360&deg; cured decal for a one of a kind look on your equipment.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: medium;">This shaft has already been adopted on Tour by some of the games biggest names and will continue to grow as the performance and word spreads throughout Golf. Finally you have, Tour Feel and Money Performance.</span></p>\r\n<p><span style="font-size: medium;">If you have any questions please message us. We can also install these.   The installed price of $150 is for the whole set and includes grips.  For a single install it would be cheaper. </span></p>'),
(155, 76, 0, 52, '<p>This is for a set of KBS $-Taper Iron Shafts (3-PW.) As always everything we sell comes with a free gift, full warranty and a satisfaction guarantee.</p>'),
(156, 85, 0, 52, 'KBS $-Taper Iron Shafts (3-PW)'),
(157, 75, 0, 53, '<p><span style="font-size: medium;">Dynamic Gold X7 golf shafts are the newest addition to the Dynamic Gold family. Based on the tour-proven design of Dynamic&nbsp;Gold, the new X7 shaft is extremely low-launching and low-spinning. Dynamic Gold X7&nbsp;is the irons shaft of choice for today&rsquo;s stronger, faster swingers who are&nbsp;seeking a low ball flINSERT INTO `catalog_product_entity_text` (`value_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(254, 75, 0, 83, '<p><span style="font-size: medium;">Drago, the newest addition from famed shaft designer Victor Afable, boasts high launch and low spin characteristics. Compared to the Raijin and SLAY, it has the stiffest bend profile of all 3 shaft lines. The butt and tip sections possess a stiffer bend profile than the 2 previously mentioned. Like the other VA shaft series, the DRAGO uses the most exotic prepreg materials in order to obtain better feel and performance. Using high modulus materials from the leading supplier of high performance campsites in Japan, VA''s unique and proprietary design for DRAGO will prove to be a winner!</span></p>\r\n<p><span style="font-size: medium;">This shaft will come built to your specs including the tip and grip of your choice. &nbsp;As always everything bought from us comes with our satisfaction guarantee.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>'),
(255, 76, 0, 83, '<p><span style="font-size: medium;">This is for a new VA Composites Drago shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.</span></p>'),
(256, 85, 0, 83, 'VA Composites Drago Shaft'),
(257, 75, 0, 84, '<p><span style="font-size: medium;">This Miura Tour Bag is available in&nbsp;both black and white. These are a premium bag made by Vessel. Inspired&nbsp;by staff professionals looking&nbsp;to make a statement on the&nbsp;golf course, this bag has all the&nbsp;premium features and benefits&nbsp;of a superior golf bag. &nbsp;Also please keep in mind with every bag purchased Vessel will donate a backpack to a child in need.&nbsp;</span></p>\r\n<ul>\r\n<li><span style="font-size: medium;">10&rdquo; top</span></li>\r\n<li><span style="font-size: medium;">6-way steel ring reinforced top</span></li>\r\n<li><span style="font-size: medium;">Total of 7 pockets including velour lined&nbsp;valuables pockets</span></li>\r\n<li><span style="font-size: medium;">Spacious belly pocket for storing</span></li>\r\n<li><span style="font-size: medium;">2 water bottle pockets</span></li>\r\n<li><span style="font-size: medium;">Single strap with single or 3-way&nbsp;connection</span></li>\r\n<li><span style="font-size: medium;">Includes all-weather rainhood</span></li>\r\n</ul>'),
(258, 76, 0, 84, '<p><span style="font-size: medium;">Miura Tour Golf Bag </span></p>'),
(259, 85, 0, 84, 'Vessel Miura Tour Golf Bag '),
(260, 75, 0, 85, '<p><span style="font-size: medium;">NEW for 2018 to our Hybrid collection is the PRO 2.0 HB. This hybrid shaft will fit most any golfer, and with its improved loading and lower torque, the performance surpasses the original. &nbsp;</span></p>\r\n<p><span style="font-size: medium;">Included is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Fujikura Atmos please ask!&nbsp;</span></p>'),
(261, 76, 0, 85, '<p><span style="font-size: medium;">This is for a New Fujikura Pro 2.0 Hybrid shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</span></p>'),
(263, 75, 0, 86, '<p>&nbsp;<span style="font-size: medium;">The new Evolution V is the most advanced model in Fujikura&rsquo;s line of iconic, tour-proven Speeder shafts, engineered with unparalleled technology and materials. In addition to a sleek aesthetic, its softer mid-to-tip section increases the launch angle for greater carry while simultaneously maintaining low torque and spin. Evolution V also boasts Outer Bias Technology, which results in smoother loading and feel.</span></p>\r\n<p><span style="font-size: medium;">Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Evo 5 please ask! </span><br /><br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
(264, 76, 0, 86, '<p><span style="font-size: medium;">This is for a new Fujikura Speeder EVOLUTION 5 shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</span></p>'),
(265, 85, 0, 86, 'Fujikura Speeder EVOLUTION 5'),
(266, 75, 0, 87, '<p><span style="font-size: medium;">Inspired by Tour player feedback, the KBS C-TAPER shaft is designed for players requiring a low piercing trajectory and superior shot control. Packed with signature KBS technology, the KBS C-TAPER shaft maximizes energy transfer, for a crisp feel, while optimizing shaft diameters in the taper and tip areas for low trajectory and spin control. Independent testing proves the C-TAPER shaft to average 5% more distance versus the market leader as well. On Tour, the KBS C-TAPER shaft is preferred by several of the world’s top players who favor shot control and crisp feel. Available in five flexes and weight ranging from 110g to 130g — The KBS C-TAPER shaft is purposed for dialing in quick tempo players.  This is for a 8 piece set, 3-PW, if you need a different set makeup just ask. The installed price of $150 is for the whole set and includes grips.  For a single install it would be cheaper.  </span></p>'),
(267, 76, 0, 87, '<p><span style="font-size: medium;">This is for a set of KBS C-Taper Iron Shafts (3-PW.)</span></p>'),
(268, 85, 0, 87, 'KBS C Taper Iron Shafts (Including LITE)'),
(269, 75, 0, 88, '<p><span style="font-size: medium;">The KBS TOUR is Kim Braly’s signature shaft and is ideal for players desiring shot versatility and mid trajectory. Incorporating unique KBS technology, the KBS TOUR maximizes energy transfer for increased shot control. The KBS TOUR offers a smooth, responsive feel and is the preferred model by several of the best golfers in the world.  This is for a 8 piece set, 3-PW, if you need a different set makeup just ask.  The installed price of $150 is for the whole set and includes grips.  For a single install it would be cheaper. </span></p>'),
(270, 76, 0, 88, '<p><span style="font-size: medium;">This is for a set of KBS Tour Iron Shafts (3-PW.)</span></p>'),
(273, 75, 0, 89, '<p><span style="font-size: medium;">10 Years ago, KBS Golf Shafts changed the way your Irons played and performed, now we are doing it AGAIN, with Graphite. Introducing the KBS TGI Tour Graphite Iron. The KBS Tour Graphite Iron is the first Graphite Shaft to play like KBS Steel with optimized weight and stiffness per player to gain maximum play-ability & performance. It is designed with the same E.I. curve as our KBS Tour Steel and is in every weight class to fit every player from Juniors to Women, to Tour Professionals. This is for a 8 piece set, 3-PW, if you need a different set makeup just ask. These are only offered in .355 however we can shim them and use them in .370 heads.  The installed price of $150 is for the whole set and includes grips.  For a single install it would be cheaper.  </span></p>'),
(274, 76, 0, 89, '<p><span style="font-size: medium;">This is for a set of KBS Tour Graphite Iron Shafts. </span></p>'),
(276, 75, 0, 90, '<p><span style="font-size: medium;">These beautiful putter shafts are sure to get the attention of everyone in your playing group.  These are only offered in .370, we can install them in your putter.   </span></p>'),
(277, 76, 0, 90, '<p><span style="font-size: medium;">This is for a KBS Matte Black Putter Shaft. </span></p>'),
(278, 85, 0, 90, 'KBS Matte Black Putter Shaft'),
(279, 75, 0, 91, '<p><span style="font-size: medium;">These beautiful KBS Tour Matte Black Wedge shafts are sure to get the attention of everyone in your playing group.  These are only offered in .355, we can install them in your wedge.   </span></p>'),
(280, 76, 0, 91, '<p><span style="font-size: medium;">This is for a KBS Tour Matte Black Wedge Shaft. </span></p>'),
(281, 85, 0, 91, 'KBS Tour Matte Black Wedge Shaft'),
(282, 75, 0, 92, '<p><span style="font-size: medium;">The Tour AD VR, like the other premium Tour AD wood shafts, utilizes premium, aerospace quality 50t carbon-fiber materials and it has a slightly higher balance point than the other current Tour AD wood shaft profiles. The Tour AD VR shaft also utilizes FTT - Fast Taper Technology, which incorporates a faster taper rate from the grip to the lower mid-section of the shaft, providing the overall feeling of greater club head control at impact and an increase in club head speed The Tour AD VR shaft profile is firm to stiff starting at the handle, medium/firm in the center section and has a firm tip to promote a mid/high launch angle and low ball spin rates. </span></p>\r\n<p><span style="font-size: medium;">The Tour AD VR also utilizes TORAYCA&reg; T1100G carbon-fiber prepreg with NANOALLOY&reg; technology in the tip section of the shaft for additional shaft stability, exceptional feel and precise ball control. </span></p>\r\n<p><span style="font-size: medium;">See a Graphite Design authorized Golf Club Fitting professional and come to the tee box ready with your new Tour AD VR wood shaft and &ldquo;Vanquish all Rivals&rdquo; from tee to green. &nbsp;The VR has already had several wins on tour. &nbsp;These will <span>definitely </span>be one of the hottest shafts this year. &nbsp;As always these will come built to your specs with a tip and grip of your choice. &nbsp;</span></p>\r\n<p><a title="Graphite Design VR" href="http://www.golfwrx.com/forums/topic/1665290-nehttp://www.golfwrx.com/forums/topic/1665290-new-tour-ad-vr/8"><span style="font-size: medium;">Check out our friends at GOLFWRX for their opinions on the&nbsp;VR.</span></a></p>'),
(283, 76, 0, 92, '<p><span style="font-size: medium;">This is for a new Graphite Design TOUR AD VR shaft built to your specs. This will include the shaft, tip, grip and a free gift! Keep in mind everything we sell comes with a full warranty and satisfaction guarantee. </span></p>'),
(284, 85, 0, 92, 'Graphite Design TOUR AD VR'),
(285, 75, 0, 93, '<p><span style="font-size: medium;">ACCRA introduces our first shaft designed specifically for the player who desires a high performance shaft which uses the highest modulus materials from Torey Japan, and Boron in the tip section that will deliver maximum stability at &ldquo;normal&rdquo; clubhead speeds. Discerning golfers who want to play golf at a high level but have seen swing speeds diminish due to age or injuries require a shaft that provides the stability of &ldquo;Tour&rdquo; shafts at a lighter weight. The J-Spec N-Series offers this. </span></p>'),
(286, 76, 0, 93, '<p><span style="font-size: medium;">This is for a new Accra Golf N Series Shaft shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.</span></p>'),
(289, 75, 0, 94, '<p><span style="font-size: medium;">The ALDILA&reg; ROGUE&reg; offers unmatched performance and consistency through the use of advanced, extremely high modulus, Graphitic Carbon Fibers that provide performance characteristics never before available in a golf shaft. Building off of the success of the ROGUE&reg; Limited Edition &ndash; which featured 125 M.S.I. carbon fiber, we are taking ROGUE&reg; to performance to another level by incorporating 130 M.S.I. carbon fiber. This will come custom built to your desired specs with a tip and grip of your choice. These are custom ordered so please allow for a little extra time, also please note that overnight shipping might be delayed.</span></p>'),
(290, 76, 0, 94, '<p><span style="font-size: medium;">This is for a custom built Aldila Rogue MSI 130 Shaft, this will come built to your specs with a tip and grip of your choice.  Everything we sell also comes with a satisfaction guarantee. </span></p>'),
(292, 75, 0, 95, '<p><span style="font-size: medium;">Like a crashing wave in the Pacific, EvenFlow&rsquo;s revolutionary &ldquo;even&rdquo; bend profile transfers shaft load more efficiently throughout the swing to create maximum energy release at impact. The result is a powerful flow of energy that feels smooth while delivering gnarly distance, making EvenFlow the ultimate complement to the Project X HZRDUS line.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">EvenFlow T1100 White uses the strongest high modulus fibers available to create the stiffest tip and lowest launching/spinning profile in the EvenFlow family. &nbsp;These will come custom built to your specs with the tip and grip of your choice.&nbsp;</span></p>\r\n<p><span style="font-size: medium;"><a href="http://www.golfwrx.com/forums/topic/1634548-project-x-t1100-even-flow-white" title="EvenFlow White ">Check out what our friends at GolfWRX have to say about the new T11100 Evenflow White.</a></span></p>\r\n<p></p>'),
(293, 76, 0, 95, '<p><span style="font-size: medium;">This is for a Project X T1100 EvenFlow White Shaft with a tip and grip of your choice. As always everything we sell comes with a satisfaction guarantee. </span></p>'),
(300, 75, 0, 98, '<p><span style="font-size: medium;">Elevate Tour focuses on complementing the "low-spin" industry trend by providing a mid-weight iron shaft that improves initial launch/spin and promotes an optimal land angle to hold more greens.  Elevate Tour features our proprietary Vibration Suppression System (VSS Pro) technology, which provides 56% vibration dampening while maintaining the critical shot feedback demanded by accomplished players.</span></p>\r\n<p><span style="font-size: medium;">If you have any questions please message us. We can also install these.  The Elevate is now also available in a Black Onyx finish.  The installed price of $150 is for the whole set and includes grips.  For a single install it would be cheaper. </span></p>'),
(301, 76, 0, 98, '<p>This is for a set of Dynamic Gold Elevate Tour Iron Shafts. As always everything we sell comes with a free gift, full warranty and a satisfaction guarantee.</p>'),
(302, 85, 0, 98, 'Dynamic Gold Elevate Tour 3-PW Iron Shafts'),
(303, 75, 0, 99, '<p><span style="font-size: medium;">These parallel tip .370 Custom LA Golf Matte Finish TP Putter Shafts can be used in any putter that uses a straight steel shaft with a standard hosel with a .370 tip. These come in a beautiful matte black finish or White.  These are offered in 135g, and 185g.</span></p>'),
(304, 76, 0, 99, 'LA Golf TP Putter Series'),
(305, 85, 0, 99, 'LA Golf TPZ Putter Shaft'),
(306, 75, 0, 100, '<p><span style="font-size: medium;">New Peoples Golf Trucker cap. This lightweight cap is made of twill with mesh back panels for maximum breathability. This will be your favorite everyday grab and go hat. The front features a retro woven patch with our logo in red white and blue that complements the rest of the cap. OSFM adjustable plastic strap for maximum comfort and durability. Better yet, get it free with the purchase of $1,000 or more.  </span></p>'),
(307, 76, 0, 100, '<p>&lt;p&gt;&lt;span style="font-size: medium;"&gt;Peoples Golf Hat /span&gt;&lt;/p&gt;</p>'),
(308, 85, 0, 100, 'Peoples Golf Hat'),
(309, 75, 0, 101, '<p><span style="font-size: medium;">We&rsquo;ve taken two our most proven, time tested tour proven profiles &ndash; Blue Board and White Board, and Mitsubishi Chemical&rsquo;s latest design and material innovations, to create the Diamana&trade; DF-Series. The Diamana&trade; DF-Series uses strategically positioned DIALEAD&trade; Pitch Fiber, and an incredibly strong hybrid prepreg that combines Mitsubishi Chemical&rsquo;s MR70 &ndash; a carbon fiber material that is 20% stronger and has 10% higher modulus than conventional carbon fibers, with boron fibers to create our newest lower launching, stiff-tip profile. </span></p>\r\n<p><span style="font-size: medium;">Strength, stability, and performance has a new name &ndash; Diamana&trade; DF-Series. &nbsp;</span><span style="font-size: medium;">If you have any questions please ask. These will come with a tip and grip of your choice.&nbsp;</span></p>'),
(310, 76, 0, 101, '<p><span style="font-size: medium;">NEW Mitsubishi DF Shaft with a tip and grip of your choice, satisfaction guarantee. </span></p>'),
(311, 85, 0, 101, 'NEW Mitsubishi Diamana DF Series Shaft'),
(312, 75, 0, 102, '<p><span style="font-size: medium;"><strong>HZRDUS Smoke Black</strong> is the next generation of HZRDUS.</span></p>\r\n<p><span style="font-size: medium;">Featuring a low-spin and low-launch profile that maintains the HZRDUS reputation, Smoke Black is designed for today''s aggressive swingers while providing new optimized material placement to promote an improved feel and an increase in playability.</span></p>\r\n<p></p>\r\n<p><span style="font-size: medium;"><strong>HZRDUS Smoke Yellow</strong> is a low launch/spin shaft that features a counterbalanced design allowing for mass to be added to the head for maximum ball speeds and higher MOI.</span></p>\r\n<p><span style="font-size: medium;">Smoke Yellow also boasts a tapered grip section and firmer mid section, when compared to the original HZRDUS Yellow, for improved stability throughout the shaft for today&rsquo;s aggressive swingers.</span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;"><span><strong>Smoke Green</strong> is the latest engineering marvel in the HZRDUS Universe. Being the stiffest HZRDUS shaft yet, Smoke Green is designed to reduce spin for the strongest swingers and is the first major shaft introduced using Hexcel&rsquo;s HexTow HM63 fiber. This allows Smoke Green to maintain maximum stability and keep up with even the fastest swings.</span></span></p>\r\n<p></p>\r\n<p><span style="font-size: medium;">These will come custom built to your specs in house with the tip and grip of your choice. We are only stocking the PVD Finish in the green, however we can order the Black Finish if you prefer it, just put something in the build notes and we will get it taken care of.&nbsp;</span></p>\r\n<p></p>\r\n<p><span style="font-size: medium;"><a href="http://www.golfwrx.com/forums/topic/1663786-new-project-x-hzrdus-smoke-shaft-2018/" title="HZRDUS Smoke">Check out what our friends at GolfWRX have to say about the new HZRDUS Smoke.</a></span></p>'),
(313, 76, 0, 102, '<p><span style="font-size: medium;">This is for a Project HZRDUS Smoke Shaft with a tip and grip of your choice. As always everything we sell comes with a satisfaction guarantee. </span></p>'),
(314, 85, 0, 102, 'Project X HZRDUS SMOKE Shaft (Black, Yellow, or GREEN!)'),
