(389, 85, 0, 141, 'Titleist TS2 8.5'),
(391, 85, 0, 142, 'Titleist TS Driver (TS4 Included) w/ Shaft of your Choice'),
(392, 75, 0, 142, '<p><span style="font-size: medium;">This is for a new Titleist TS Driver built to your specs with the shaft of your choice. This will come custom built in house by one of our trained master club builders. It will come fully built to your desired specifications and also comes with a grip of your choice.&nbsp; A headcover and wrench will also be included. If you would like to discuss a build <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a>&nbsp; The website will not take the build specs, we will email you after purchasing to obtain this info, please have the specs ready to provide or email them after purchasing.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">These are our recommended shafts for 2020.&nbsp; If you want a different shaft please email us for a quote.&nbsp; We can get pretty much anything.&nbsp; If you need a recommendation as to which shaft would best fit you <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a></span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;">Update as of 8/1 we now have TS1 and TS4 heads in stock as well as the TS2 and TS3.&nbsp;</span></p>'),
(393, 76, 0, 142, '<p><span style="font-size: medium;">Titleist Golf Club TS Driver - TS2, TS3, or TS4</span></p>'),
(394, 75, 0, 143, '<div class="txtNew" id="comp-jml55e1t" data-packed="false" data-min-height="30">\r\n<h4 class="font_4"><span style="font-size: medium;">M Type Wedges Irons&nbsp;</span></h4>\r\n</div>\r\n<div class="txtNew" id="comp-jml55e2s" data-packed="false" data-min-height="326">\r\n<p class="font_9"><span style="font-size: medium;">The M-Type forged wedges offer pinpoint accuracy and unsurpassed playability in a tour inspired shape and size. &nbsp;The 1020 Carbon Steel offers the perfect blend of performance and plenty of feedback for those all important scoring shots within 100 yards.&nbsp;</span></p>\r\n<p class="font_9"><span style="font-size: medium;">Higher initial bounce angles and added heel relief allow this wedge to be very versatile off of virtually any type of turf.&nbsp;The reduced heel to toe sole contour allows the leading edge and sole to lay very flat and is far more user-friendly than most tour type wedge designs.</span></p>\r\n<p class="font_9"><span style="font-size: medium;">These will come built to your specs with the shafts and grips of your choice which is included in the price. Graphite shafts would be slightly more. &nbsp;&nbsp;<a href="mailto:will@peoples.golf" title="email us">Email us to discuss your next build</a>.</span></p>\r\n</div>'),
(395, 76, 0, 143, '<p>This is for a New Level Golf M Type Wedge, these will come built to your specs and come with our satisfaction guarantee.</p>'),
(396, 85, 0, 143, 'New Level Golf M Type Wedge'),
(397, 75, 0, 144, '<p><span style="font-size: medium;">Catalyst is the next step in graphite iron design. Featuring our new Iso-6 material technology, Catalyst is engineered to replicate steel alloy properties over 100% better than traditional graphite laminates. This allows for an extremely stable shaft that maximizes constancy and distance control while providing the benefits of a graphite body design.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">Catalyst also features a reinforced tip section which, unlike traditional graphite, delivers torsional resistance comparable to that of steel&mdash;improving stability during turf interaction for better impact on less than perfect shots.</span></p>\r\n<p><span style="font-size: medium;">This is for 1 shaft, please indicate which shaft you want as well as what they are going in. &nbsp;We can mix and match between the weights.&nbsp;</span></p>\r\n<p><a href="http://www.golfwrx.com/forums/topic/1707286-project-x-catalyst-shafts/" title="Project X Catalyst "><span style="font-size: medium;">Check out what our friends at GolfWRX have to say about the new Project X Catalyst.</span></a></p>\r\n<p></p>'),
(398, 76, 0, 144, '<p><span style="font-size: medium;">This is for a Project X Catalyst Graphite Iron Shaft . As always everything we sell comes with a satisfaction guarantee. </span></p>'),
(399, 85, 0, 144, 'Project X Catalyst Graphite Iron Shaft '),
(400, 75, 0, 145, '<p><span style="font-size: medium;">Designed and developed by Fujikura Composites Japan, the Diamond Speeder is an ultra-premium offering as part of the Jewel Line. The Jewel line is for the golfer looking to optimize swing speed through lighter weight shafts, but keeping spin way down due to incredibly low torque. Utilizing extremely high-grade, high-strength, lightweight materials, there is no expense spared to make these the ultimate Speeder shafts. The Diamond Speeder, specifically, has the lowest torque of any shaft we&rsquo;ve ever produced. A new design technology in Diamond is the Outer Bias Layer, also in Evolution IV. Our engineers have moved the bias layer from the traditional innermost layer and put it in between straight layers (0 degree layers) which provides a much smoother loading and feel to the shaft.</span></p>\r\n<p><span style="font-size: medium;">Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Speeder Diamond please ask!</span></p>\r\n<p></p>\r\n<p></p>\r\n<p>&nbsp;</p>'),
(401, 76, 0, 145, '<p><span style="font-size: medium;">This is for a new Fujikura Diamond Speeder shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee. </span></p>'),
(402, 85, 0, 145, 'Project X Catalyst Graphite Iron Shaft '),
(404, 75, 0, 146, '<p><span style="font-size: medium;">Breakthrough Golf uses a scientifically advanced multi-material design with new geometries never used in putter shaft design before. A shaft that has the same look, solid feel and weight as traditional steel putter shafts. The Stability Shaft delivers the face squarer at impact for improved accuracy and solid feel and has a lower launch for a predictable roll, resulting in better distance control.  The install option will include installing the shaft on your putter. Simply mail it to us, we will install a new shaft and ship it back. This will also include a free loft and lie adjustment and a free lamkin deep etch grip, additional grips available for purchase.  If you need help figuring out which shaft you need please email us. </span></p>'),
(405, 76, 0, 146, '<p><span style="font-size: medium;">This is for a brand new custom installed Stability putter shaft. </span></p>'),
(406, 85, 0, 146, 'Stability Putter Shaft'),
(407, 75, 0, 147, '<p><span style="font-size: medium;">Based on the success of the LH Tournament Blade Miura Golf looked to expand its LH offering to appeal to more golfers. The CB-801 was a creation that took the design ideas and concepts of the TB and expanded the forgiveness and playability. One key feature that was incorporated was the distinct Y-Grind perfected by Miura Master Craftsman Yoshitaka Miura. A grind that started out as a concept in wedges has now become a signature feature in the Miura product line. </span></p>\r\n<p><span style="font-size: medium;">Until now, this innovation was not available to our loyal left handed golfers. The Y-Grind, although most visible on the sole and leading edge, actually encompasses many more subtle changes to the club head. This is necessary to maintain the integrity of the head, including head weight, density and overall balance. These refinements elevate the Left Handed Y-Grind irons to another level. More efficient turf interaction is made possible through the subtle leading edge and sole modifications. This includes the appropriate bounce angles on each specific irons while maintaining desired lie angles. The Miura family commitment to detail is evident in the Y-Grind, specifically at the address position. Subtle changes to the top line and toe profile work in concert with the sole grind delivering a new level of confidence to the golfer.</span></p>\r\n<p><span style="font-size: medium;">The CB-801 irons are available in 3-PW, however we can do any set make up you want. These will come built to your specs with the shafts and grips of your choice. &nbsp;<a href="mailto:will@peoples.golf">Email us</a> to discuss your next build.&nbsp;</span></p>'),
(408, 76, 0, 147, '<p><span style="font-size: medium;">This is for a set of Miura CB-801 3-PW, these will come built to your specs and come with our satisfaction guarantee. </span></p>'),
(409, 85, 0, 147, 'Miura Left Hand CB-801 3-PW '),
(410, 75, 0, 148, '<p><span style="font-size: medium;">The impact that the design of leading edge and bounce can have on the performance of an iron or wedge has not been lost on the Miura family. Master Grinder Yoshitaka Miura has created the Y Grind, which made its debut with our Series 1957 Wedges. Yoshitaka has now incorporated the Y Grind in to our most recent models, the MB-001 and the CB-57. Until now, this innovation was not available to our loyal left handed golfers. The Y Grind, although most visible on the sole and leading edge, actually encompasses many more subtle changes to the club head. This is necessary to maintain the integrity of the head, including head weight, density and overall balance.</span></p>\r\n<p><span style="font-size: medium;">These refinements elevate the Left Handed Y-Grind irons to another level. More efficient turf interaction is made possible through the subtle leading edge and sole modifications. This includes the appropriate bounce angles on each specific irons while maintaining desired lie angles. The Miura family commitment to detail is evident in the Y-Grind, specifically at the address position. Subtle changes to the top line and toe profile work in concert with the sole grind delivering a new level of confidence to the golfer.</span></p>\r\n<p><span style="font-size: medium;">The miura Tournament Blade irons are available in 4-PW. These will come built to your specs with the shafts and grips of your choice. &nbsp;<a href="mailto:will@peoples.golf">Email us</a> to discuss your next build.&nbsp;</span></p>'),
(411, 76, 0, 148, '<p>This is for a set of Miura Left Hand Tournament Blade 4-PW, these will come built to your specs and come with our satisfaction guarantee.</p>'),
(412, 85, 0, 148, 'Miura Left Hand Tournament Blade 4-PW '),
(413, 75, 0, 149, '<p><span style="font-size: medium;">The Raijin (Rie-gene) features a design utilizing multiple composite materials.   Designed using exotic 40T carbon fiber pre-preg materials from Japan coupled with a design that is unprecedented in the golf industry.   The Raijin is a very versatile shaft that fits a wide variety of players. This shaft has a slightly higher balance point which helps with better balance and swing weight control.    VA Composites is redefining the golf shaft and we are taking performance to an entirely new level!\r\n<p><span style="font-size: medium;">&nbsp;</span></p>'),
(414, 76, 0, 149, '<p><span style="font-size: medium;">This is for a new VA Composites Tour Issue Raijin Iron Shafts 3-PW of your choice built to your specs. As always everything we sell comes with a full money back guarantee.</span></p>'),
(415, 85, 0, 149, 'VA Composites Tour Issue Raijin Iron Shafts 3-PW '),
(416, 75, 0, 150, '<div class="txtNew" id="comp-jml55e1t" data-packed="false" data-min-height="30">\r\n<div class="txtNew" id="comp-jml4lnpz1" data-packed="false" data-min-height="30">\r\n<p class="font_4"><span style="font-size: medium;">This is for a set of new Taylormade P760 Irons. &nbsp;These will come built to your specs with the heads, shafts and grips of your choice. &nbsp;They will also be built to your desired specs.&nbsp;</span></p>\r\n</div>\r\n</div>\r\n<div class="txtNew" id="comp-jml55e2s" data-packed="false" data-min-height="326">\r\n<p class="font_9"><span style="font-size: medium;">These are being sold as 3-PW however we can do a different set makeup, just email us to discuss.&nbsp; &nbsp;Please allow 2 weeks for us to assemble these. &nbsp;As always everything is built in house by our staff and built to absolute best quality possible. &nbsp;&nbsp;<a href="mailto:will@peoples.golf" title="email us">Email us to discuss your next build</a>.</span></p>\r\n</div>'),
(417, 76, 0, 150, '<p>This is for a set of New Taylormade P760 Irons 3-PW, these will come built to your specs and come with our satisfaction guarantee.</p>'),
(418, 85, 0, 150, 'New Taylormade P760 Irons 3-PW '),
(419, 75, 0, 151, '<p><span style="font-size: medium;">The new Miura Tour Series Wedge provides the legendary Miura feel that golfers covet. This wedge does not chase distance, but rather the precision and control necessary for scoring. It is the first from Miura to use CNC milling for the face and grooves, allowing for ultimate spin control. The Miura Tour Wedge is designed with a hollow back shape to create a higher center of gravity. The unique distribution of weight produces a stable trajectory while still allowing the player the ability to flight the shot, if necessary. </span></p>\r\n<p><span style="font-size: medium;">Like all clubs forged by Miura, the grain structure within the club head is the tightest in the industry. This creates less dispersion on off-center hits, as well as provides control from all lies and conditions. The head design of the Tour Wedge will match any Miura model. Its size and shape is best suited for the Tournament Series Blade and the new CB-801.</span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs and will include any necessary bending, as well as the shaft and grip of your choice. &nbsp;Stamping and paint fill options available as well. &nbsp;If you have any questions please <a href="mailto:info@thepeoplesclubs.com%20" title="Email Us ">email us</a> to discuss. &nbsp;</span></p>\r\n<p><span style="font-size: medium;">'),
(420, 76, 0, 151, '<p><span style="font-size: medium;">These new Miura Tour Series Wedge will come built to your specs, and with the shaft and grip of your choice.</span></p>'),
(421, 85, 0, 151, 'Miura Left Hand Tour Series Wedge'),
(422, 75, 0, 152, '<p><span style="font-size: medium;">Introducing the Miura Golf CB-301, the longest full forged cavity back iron Miura Golf has ever produced.</span></p>\r\n<p><span style="font-size: medium;">The CB-301 takes Miura&rsquo;s world-renowned forging process and blends it seamlessly with a Tour inspired shape. The CB-301 combines the feel and playability of a player&rsquo;s iron with the forgiveness and distance to improve golfers of all skill levels.</span></p>\r\n<p><span style="font-size: medium;">The full cavity-back design is engineered with a larger sweet spot to ensure greater control and improved performance on all shots. Each club is engineered with a variable sole and cavity thickness designed to optimize center of gravity. This design technique enables the CB-301 to deliver more forgiveness while maintaining our trademark level of superior quality and feel</span></p>\r\n<p><span style="font-size: medium;">The CB-301 &ndash; the Miura model you&rsquo;ve been waiting for</span></p>\r\n<ul>\r\n<li><span style="font-size: medium;">Longest full forged cavity back iron produced by Miura Golf</span></li>\r\n<li><span style="font-size: medium;">Hand forged using Miura Golf&rsquo;s 14-step manufacturing process</span></li>\r\n<li><span style="font-size: medium;">Tour inspired shape that is slightly larger footprint than the MC-501</span></li>\r\n<li><span style="font-size: medium;">Precision-placed center of gravity location that enhances feel and performance, resulting in higher, straighter and longer shots</span></li>\r\n</ul>\r\n<p><span style="font-size: medium;">The CB-301 irons are available in 4-PW, however we can do any set make up you want. Gap Wedges are also available in the 301. These will come built to your specs with the shafts and grips of your choice. &nbsp;<a href="mailto:will@peoples.golf">Email us</a> to discuss your next build.&nbsp;</span></p>'),
(423, 76, 0, 152, '<p>This is for a set of Miura CB-301 4-PW, these will come built to your specs and come with our satisfaction guarantee.</p>'),
(424, 85, 0, 152, 'Miura CB-301 4-PW'),
(425, 75, 0, 153, '<p><span style="font-size: medium;">The new Accra TZ has been dominating on tour with several top pros now using these including Jason Day, Cameron Champ, Pat Perez, Martin Kaymer, and countless others. &nbsp;This shaft is offered in 2 distinct profiles. Utilizing the proprietary blue printing capabilities of the ACCRA S3 &ldquo;Shaft Simulation System&rdquo;, ACCRA has developed a higher launching TZ6 series version and a lower launching TZ5 series each with lower spin results than ever before.</span></p>\r\n<h2><span style="font-size: medium;">TZ5</span></h2>\r\n<p><span style="font-size: medium;">The new TZ5 series line of shafts takes all the best attributes of the past Tour Z models and incorporates the latest high modulus materials to create a smoother &ldquo;feel&rdquo; than ever before while maintaining the low launch/low spin characteristics that the Tour Z brand has been known for. You will notice a slightly smoother mid section and lower balance point to promote &ldquo;feel&rdquo; combined with a lower torque than previous Tour Z series models to maintain the low spin that Tour Z shafts are renowned for. Once again ACCRA has developed an industry leading low launching, low spinning shaft for all levels of golfers utilizing the latest in advanced composite materials to enhance performance and playability.</span></p>\r\n<h2><span style="font-size: medium;">TZ6</span></h2>\r\n<p><span style="font-size: medium;">The new TZ6 series shaft will be available in 4 different weights (45, 55, 65, &amp; 75) and a matching hybrid shafts (85H) with multiple flex options. This is a unique design that will appeal to the average golfer in the M3 and M4 flexes as a mid/high launching driver shaft that will control spin and add power with an active tip section. Where this shaft really shines is as a mid/high launching shaft in M4 and M5 flexes for the accomplished golfer. Already in the bag of 8 PGA Tour players, this is a spin killing machine that feature 2.0 torque combined with the explosive tip section. New high modulus composite materials now available enable ACCRA to maintain &ldquo;feel&rdquo; while introducing extremely low torque. Stability is achieved in the combination of ACCRA&rsquo;s proprietary design in the butt section for unparalleled strength without effecting &ldquo;feel&rdquo; and the addition of a new material technology in the tip section creating an unequaled torsional strength along with a faster recovery speed than any shaft ACCRA has ever produced.</span></p>'),
(426, 76, 0, 153, '<p><span style="font-size: medium;">This is for a new Accra Golf TZ Series Shaft shaft of your choice built to your specs. As always everything we sell comes with a full satisfaction guarantee.</span></p>'),
(427, 85, 0, 153, 'Accra Golf TZ Series Shaft'),
(428, 75, 0, 154, '<p><span style="font-size: medium;">RAIJIN&nbsp;<em>Black&nbsp;</em>features an exotic aeronautical grade 4-Axis weave prepreg material throughout the shaft. When coupled with our multi-material design, this 4-Axis prepreg enhances performance during the entire golf swing.</span></p>\r\n<p><span style="font-size: medium;">The RAIJIN&nbsp;<em>Black&nbsp;</em>should not to be compared to RAIJIN, as it boasts a completely different design pattern and performance capabilities.</span></p>\r\n<p><span style="font-size: medium;">The RAIJIN&nbsp;<em>Black&nbsp;</em>proves to have the stiffest bend profile throughout all the VA shaft series, making it better suited for players with faster tempo or players with high load. The 4-Axis material reduces shaft ovalization throughout the entire swing, allowing for a more stable and efficient shaft.</span></p>\r\n<p><span style="font-size: medium;">The RAIJIN&nbsp;<em>Black&nbsp;</em>cosmetics were inspired by a mythical dragon which is showcased in the beautiful artwork on the shaft. From the matte black graphite finish to the rose gold accents to the true performance of the shaft, the RAIJIN&nbsp;<em>Black&nbsp;</em>proves to be a work of art.</span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>'),
(429, 76, 0, 154, '<p><span style="font-size: medium;">This is for a new VA Composites Raijin Black shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.</span></p>'),
(430, 85, 0, 154, 'VA Composites Raijin Black Shaft '),
(431, 75, 0, 155, '<p><span style="font-size: medium;">The exceptionally engineered Ventus is designed to significantly tighten shot dispersion and maximize ball speed especially on off-center shots. Ventus is a Tour-inspired profile and the first to include Fujikura&rsquo;s all-new VeloCore Technology in a straight taper, ultra tip-stiff profile. Maximum energy transfer from the tip section boosts the clubhead&rsquo;s performance and a straight taper design enhances loading and feel.</span></p>\r\n<p><span style="font-size: medium;">The new Fujikura Ventus has been very well received both on and off tour. &nbsp;We hit these at the PGA Show and were very impressed. &nbsp;They are currently being used by several top pros including Branden Grace, Peter Uihlein, Michael Block, Cody Gribble, Adam Landry, Colt Knost, Sung Kang, Austin Cook, and many more.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Ventus please ask!</span></p>\r\n<p><span style="font-size: medium;">Update as of 1/26 we have several of the tour only heavier 90g and 100g shafts available for a limited time.&nbsp;</span></p>\r\n<p></p>\r\n<p></p>\r\n<p>&nbsp;</p>'),
(432, 76, 0, 155, '<p>This is for a new Fujikura Ventus shaft of your choice built to your specs. As always everything we sell comes with a full satisfaction guarantee.</p>'),
(433, 85, 0, 155, 'Fujikura Ventus Shaft (Black, Blue or Red) '),
(434, 75, 0, 156, '<p><span style="font-size: medium;">Brand new for the 2019 season, Graphite Design introduces the latest in the Tour AD premium line of hybrid golf shafts, the <em>Graphite Design Tour AD IZ &ndash; &ldquo;Into the Zone&rdquo; Hybrid</em>. Designed and manufactured at the Graphite Design Japan factory headquarters, the new <em>Tour AD IZ </em>hybrid shaft are available in 65g R2 (Lite) and R1 (Regular) flex, 75g R and S flex, 85g R, S and X flex and 95g S and X.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">The <em>Tour AD IZ Hybrid</em>, like all of the premium Tour AD shafts, utilizes premium, aerospace quality carbon-fiber materials in order to deliver the best feeling and performing shaft available to golfers.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">The <em>Tour AD IZ 65g and 75g </em>hybrid shaft has a medium stiffness starting at the handle, and firm center section and a firm tip profile to promote a mid/high launch angle and mid ball spin rates.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">The <em>Tour AD IZ 85g and 95g </em>hybrid shaft has a firm stiffness starting at the handle, and firm center section and a stiff tip profile to promote a mid-launch angle and lower ball spin rates.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs with the desired adapter and grip of your choice. We can also install these in your hybrid, this is included in the price.&nbsp;</span></p>'),
(435, 76, 0, 156, '<p>New Tour Issue Graphite Design IZ Hybrid Shaft</p>'),
(436, 85, 0, 156, 'Graphite Design IZ Hybrid '),
(437, 75, 0, 157, '<p><span style="font-size: medium;">Introducing the Miura Golf K Grind 2.0 Milled wedge, the most stable wedge from all playing conditions. The &ldquo;Original&rdquo; Miura 1957 K-Grind Wedge was one of the most iconic wedges ever made with their signature "knuckles" or fluted sole. The KG 2.0 builds off the original design adding modern day grinding and milling techniques. Hand crafted throughout the entire process the KG 2.0 maintains Miura Golf&rsquo;s trademark level of superior quality and feel. </span></p>\r\n<p><span style="font-size: medium;">The &ldquo;knuckles&rdquo; or &ldquo;flutes&rdquo; serve a specific purpose in the playability and performance of this wedge. Designed to deliver a square clubface at impact the benefits extend to all turf conditions, by reducing twisting from rough and gliding through the sand. The 2.0 features a more modern sole design with increased bounce and roll along with heal and toe relief. The face and grooves have been milled to provide increased spin on intermediate and full shots. </span></p>\r\n<p><span style="font-size: medium;">&bull; Signature &ldquo;knuckles&rdquo; or &ldquo;fluted&rdquo; sole design for stability in all turf conditions </span></p>\r\n<p><span style="font-size: medium;">&bull; Tour inspired look with Miura&rsquo;s world-renowned forged feel </span></p>\r\n<p><span style="font-size: medium;">&bull; Hand forged using Miura Golf&rsquo;s 14-step manufacturing process </span></p>\r\n<p><span style="font-size: medium;">&bull; Fully milled face and grooves adding spin on intermediate shots </span></p>\r\n<p><span style="font-size: medium;">&bull; Modern sole grind featuring added effective bounce</span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs and will include any necessary bending, as well as the shaft and grip of your choice. &nbsp;Stamping and paint fill options available as well. &nbsp;If you have any questions please <a href="mailto:info@thepeoplesclubs.com%20" title="Email Us ">email us</a> to discuss. &nbsp;</span></p>\r\n<p></p>'),
(438, 76, 0, 157, '<p><span style="font-size: medium;">These new Miura K-Grind 2.0 Wedge will come built to your specs, and with the shaft and grip of your choice.</span></p>'),
(439, 85, 0, 157, 'Miura K-Grind 2.0 Wedge'),
(440, 85, 0, 158, 'Tour Issue M5 8*'),
(441, 85, 0, 159, 'Tour Issue M5 8*'),
(443, 75, 0, 160, '<p><span style="font-size: medium;">This is for a new Tour Issue Taylormade M5 Driver built to your specs with the shaft of your choice. This will come custom built in house by one of our trained master club builders. It will come fully built to your desired specifications and also comes with a grip of your choice.&nbsp; A headcover and wrench will also be included. If you would like to discuss a build <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a>&nbsp; The website will not take the build specs, we will email you after purchasing to obtain this info, please have the specs ready to provide or email them after purchasing.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">These are our recommended shafts for 2020.&nbsp; If you want a different shaft please email us for a quote.&nbsp; We can get pretty much anything.&nbsp; If you need a recommendation as to which shaft would best fit you <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a></span></p>'),
(444, 76, 0, 160, '<p><span style="font-size: medium;">YOU ARE PURCHASING A BRAND NEW TOUR ISSUE DRIVER FULLY CUSTOMIZED WITH A SHAFT OF YOUR CHOICE. THIS CLUB WILL BE CUSTOM BUILT FOR YOU BASED ON A CONSULTATION ANALYZING YOUR SPECIFIC NEEDS.</span></p>'),
(445, 85, 0, 160, 'Tour Issue Taylormade M5 Driver w/ Shaft of your choice! '),
