(471, 85, 0, 174, 'G410 3 Wood 14.5'),
(473, 75, 0, 175, '<p><span style="font-size: medium;">This is for a new Ping G410 Fairway Wood built to your specs with the shaft of your choice. This will come custom built in house by one of our trained master club builders. It will come fully built to your desired specifications and also comes with a grip of your choice.&nbsp; A headcover and wrench will also be included. If you would like to discuss a build <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a>&nbsp; The website will not take the build specs, we will email you after purchasing to obtain this info, please have the specs ready to provide or email them after purchasing.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">These are our recommended shafts for 2020.&nbsp; If you want a different shaft please email us for a quote.&nbsp; We can get pretty much anything.&nbsp; If you need a recommendation as to which shaft would best fit you <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a></span></p>'),
(474, 76, 0, 175, '<p><span style="font-size: medium;">YOU ARE PURCHASING A BRAND NEW RETAIL DRIVER FULLY CUSTOMIZED WITH A SHAFT OF YOUR CHOICE. THIS CLUB WILL BE CUSTOM BUILT FOR YOU BASED ON A CONSULTATION ANALYZING YOUR SPECIFIC NEEDS.</span></p>'),
(475, 85, 0, 175, 'Ping G410 Fairway Wood w/ Shaft of your choice! '),
(476, 75, 0, 176, '<p><span style="font-size: medium;">After thoroughly testing the SuperSpeed Golf system we are excited to now be carrying this awesome training aid, the first in our new training aid line.&nbsp;&nbsp;&nbsp;We have these in stock and ready to ship today.&nbsp;&nbsp;These have been getting awesome results both on tour and off.&nbsp;These are currently being used on tour by Phil Mickelson, Dustin Johnson, Paul Casey, Ian Poulter, Alen Noren, Byrson DeChameau, Beau Hossler, Sam Saunders, Hideko Matsuyama, Miguel Angel Jimenez, Scott Stallings, CT Pan, Adam Hadwin, Graeme McDowell, Brian Gay and several others. As always we stand behind everything we sell with a full satisfaction.&nbsp;</span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;">"We believe that every player deserves and is capable of hitting the ball farther. Whether you are an accomplished competitive player or a weekend warrior, adding distance to your tee shots will help you lower your scores and have more fun on the golf course. Everyone wants to bomb it off the tee and take that walk to 30 yards ahead of your nearest playing companion. For many golfers this sounds far too good to be possible. With all of the gimmicks and false claims of many training aids on the market, we understand! That is one of the primary reasons that our team of expert coaches and fitness professionals at SuperSpeed Golf decided to launch this training system to the public. Our team has been working with the concepts of overspeed training for many years with our own private clients. We have found that using lighter weight clubs in specific training can help every golf increase swing speed, maximize biomechanical efficiency of the swing, improve consistency in ball striking, and reduce many common swing flaws caused by inefficient sequencing of the golf swing. We spent years determining the optimal weighting breakdown of our SuperSpeed Golf Clubs and the most effective training protocols to maximize our player&rsquo;s progress. The result is the SuperSpeed Golf Men&rsquo;s Training System. This training system is optimized for players who play a standard weight men&rsquo;s driver with an overall weight between 300 and 325 grams. This set includes the Green (light), Blue (medium), and Red (Heavy) weighted SuperSpeed Clubs. Our players will swing all three of these clubs in a light to heavy progression during our overspeed training protocols. We find that players typically gain between 5% and 8% additional swing speed over the first 4-6 weeks of regular practice. Each training session only takes about 10 minutes to complete. We recommend 3 training sessions per week for optimal results. So, if you have an additional 30 minutes a week, wouldn&rsquo;t you like to add 30 yards to your tee shots? Purchase your SuperSpeed Golf Training System today to get started!"</span></p>\r\n<p><span style="font-size: medium;"><strong>What&rsquo;s in the box:</strong></span></p>\r\n<ul>\r\n<li><span style="font-size: medium;">SuperSpeed Golf Green &ldquo;Light&rdquo; Training Club</span></li>\r\n<li><span style="font-size: medium;">SuperSpeed Golf Blue &ldquo;Medium&rdquo; Training Club</span></li>\r\n<li><span style="font-size: medium;">SuperSpeed Golf Red &ldquo;Heavy&rdquo; Training Club</span></li>\r\n<li><span style="font-size: medium;">Introduction and instruction card</span></li>\r\n</ul>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>\r\n<p><span style="font-size: medium;"><strong>Technical Specifications:</strong></span></p>\r\n<table border="1" cellpadding="2">\r\n<tbody>\r\n<tr><th><span style="font-size: medium;">Item</span></th><th><span style="font-size: medium;">Length</span></th><th><span style="font-size: medium;">Overall Weight</span></th></tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Green &ldquo;Light&rdquo; Club</span></td>\r\n<td><span style="font-size: medium;">45&Prime;</span></td>\r\n<td><span style="font-size: medium;">255 Grams</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Blue &ldquo;Medium&rdquo; Club</span></td>\r\n<td><span style="font-size: medium;">45&Prime;</span></td>\r\n<td><span style="font-size: medium;">290 Grams</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Red &ldquo;Heavy&rdquo; Club</span></td>\r\n<td><span style="font-size: medium;">45&Prime;</span></td>\r\n<td><span style="font-size: medium;">335 Grams</span><br /><br /></td>\r\n</tr>\r\n</tbody>\r\n</table>'),
(477, 76, 0, 176, '<p>Men’s SuperSpeed Golf Training System</p>'),
(478, 85, 0, 176, 'SuperSpeed Golf Training System – Men’s'),
(479, 75, 0, 177, '<p><span style="font-size: medium;">After thoroughly testing the SuperSpeed Golf system we are excited to now be carrying this awesome training aid, the first in our new training aid line.&nbsp;&nbsp;&nbsp;We have these in stock and ready to ship today.&nbsp;&nbsp;These have been getting awesome results both on tour and off.&nbsp;These are currently being used on tour by Phil Mickelson, Dustin Johnson, Paul Casey, Ian Poulter, Alen Noren, Byrson DeChameau, Beau Hossler, Sam Saunders, Hideko Matsuyama, Miguel Angel Jimenez, Scott Stallings, CT Pan, Adam Hadwin, Graeme McDowell, Brian Gay and several others. As always we stand behind everything we sell with a full satisfaction.&nbsp;</span></p>\r\n<p></p>\r\n<p><span style="font-size: medium;">"</span><span style="font-size: medium;">Generating swing speed is a common issue with many golfers in ladies&rsquo; leagues around the world.&nbsp; Lack of swing speed can result in difficulty getting the ball into the air, low trajectory shots, very short distance with every club in the bag, and a tendency for many of the club in the bag to produce shots of almost the same distance.&nbsp; This takes the fun out of golf!&nbsp; Women have great potential to create large amount of swing speed when they learn how to sequence the golf swing efficiently.&nbsp; We have found the largest gains with our female clients than any other population segment working with SuperSpeed Golf.&nbsp; This is probably why we currently have over 20 LPGA Tour Players working with the system.&nbsp; During the development of SuperSpeed Golf, we have found that using lighter weight clubs in specific training can help every golf increase swing speed, maximize biomechanical efficiency of the swing, improve consistency in ball striking, and reduce many common swing flaws caused by inefficient sequencing of the golf swing.&nbsp; We spent years determining the optimal weighting breakdown of our SuperSpeed Golf Clubs and the most effective training protocols to maximize our player&rsquo;s progress.&nbsp;&nbsp; The result is the SuperSpeed Golf Women&rsquo;s Training System.&nbsp; This training system is optimized for players who play a lightweight driver with an overall weight between 275 and 305 grams.&nbsp; This set includes the Yellow (superlight), Green (light), and Blue (medium) weighted SuperSpeed Clubs.&nbsp; Our players will swing all three of these clubs in a light to heavy progression during our overspeed training protocols.&nbsp; We find that players typically gain between 5% and 8% additional swing speed over the first 4-6 weeks of regular practice.&nbsp; Each training session only takes about 10 minutes to complete.&nbsp; We recommend 3 training sessions per week for optimal results.&nbsp; Add overspeed training with The SuperSpeed Golf Training System to your routine today and start creating beautiful, high, and long golf shots!"</span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;">What&rsquo;s in the box:</span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<ul>\r\n<li><span style="font-size: medium;">SuperSpeed Golf Yellow &ldquo;Superlight&rdquo; Training Club</span></li>\r\n<li><span style="font-size: medium;">SuperSpeed Golf Green &ldquo;Light&rdquo; Training Club</span></li>\r\n<li><span style="font-size: medium;">SuperSpeed Golf Blue &ldquo;Medium&rdquo; Training Club</span></li>\r\n<li><span style="font-size: medium;">Introduction and instruction card</span></li>\r\n</ul>\r\n<p><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;"><strong>Technical Specifications:</strong></span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<table border="1" cellpadding="2">\r\n<tbody>\r\n<tr><th><span style="font-size: medium;">Item</span></th><th><span style="font-size: medium;">Length</span></th><th><span style="font-size: medium;">Overall Weight</span></th></tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Yellow &ldquo;Superlight&rdquo; Club</span></td>\r\n<td><span style="font-size: medium;">45&Prime;</span></td>\r\n<td><span style="font-size: medium;">225 Grams</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Green &ldquo;Light&rdquo; Club</span></td>\r\n<td><span style="font-size: medium;">45&Prime;</span></td>\r\n<td><span style="font-size: medium;">255 Grams</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Blue &ldquo;Medium&rdquo; Club</span></td>\r\n<td><span style="font-size: medium;">45&Prime;</span></td>\r\n<td><span style="font-size: medium;">290 Grams</span><br /><br /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style="font-size: medium;"></span></p>'),
(480, 76, 0, 177, '<p>Ladies SuperSpeed Golf Training System</p>'),
(481, 85, 0, 177, NULL),
(483, 75, 0, 178, '<p><span style="font-size: medium;">After thoroughly testing the SuperSpeed Golf system we are excited to now be carrying this awesome training aid, the first in our new training aid line.&nbsp;&nbsp;&nbsp;We have these in stock and ready to ship today.&nbsp;&nbsp;These have been getting awesome results both on tour and off.&nbsp;These are currently being used on tour by Phil Mickelson, Dustin Johnson, Paul Casey, Ian Poulter, Alen Noren, Byrson DeChameau, Beau Hossler, Sam Saunders, Hideko Matsuyama, Miguel Angel Jimenez, Scott Stallings, CT Pan, Adam Hadwin, Graeme McDowell, Brian Gay and several others. As always we stand behind everything we sell with a full satisfaction.&nbsp;</span></p>\r\n<p></p>\r\n<p><span style="font-size: medium;">"</span><span style="font-size: medium;">It is a true fact that as our bodies age it becomes increasingly difficult to create a powerful and consistent golf swing. We are in the market to help curb this trend by offering a simple and easy to use training system to help you regain range of motion, stability, and power. This will help you hit the ball farther, higher, and more consistently than you thought possible. Join many Champions Tour players who have found great success with the SuperSpeed Golf Training System. Our team has been working with the concepts of overspeed training for many years with our own private clients. We have found that using lighter weight clubs in specific training can help every golf increase swing speed, maximize biomechanical efficiency of the swing, improve consistency in ball striking, and reduce many common swing flaws caused by inefficient sequencing of the golf swing. With our senior population specifically, we have found that adding SuperSpeed Golf has had a great effect in helping players improve range of motion, stability, and power in their swings. This has helped some players add over 30 yards to their drives and begin to be able to hit mid and long irons with confidence. We have spent years determining the optimal weighting breakdown of our SuperSpeed Golf Clubs and the most effective training protocols to maximize our player&rsquo;s progress. The result is the SuperSpeed Golf Men&rsquo;s Training System. This training system is optimized for players who play a standard weight men&rsquo;s driver with an overall weight between 275 and 300 grams. This set includes the Yellow (Superlight), Green (light), Blue (medium), weighted SuperSpeed Clubs. Our players will swing all three of these clubs in a light to heavy progression during our overspeed training protocols. We find that players typically gain between 5% and 8% additional swing speed over the first 4-6 weeks of regular practice. Each training session only takes about 10 minutes to complete. We recommend 3 training sessions per week for optimal results. So, if you have an additional 30 minutes a week, wouldn&rsquo;t you like to add 30 yards to your tee shots? Purchase your SuperSpeed Golf Training System today to get started!"</span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;"><strong>What&rsquo;s in the box:</strong></span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<ul>\r\n<li><span style="font-size: medium;">SuperSpeed Golf Yellow &ldquo;SuperLight&rdquo; Training Club</span></li>\r\n<li><span style="font-size: medium;">SuperSpeed Golf Green &ldquo;Light&rdquo; Training Club</span></li>\r\n<li><span style="font-size: medium;">SuperSpeed Golf Blue &ldquo;Medium&rdquo; Training Club</span></li>\r\n<li><span style="font-size: medium;">Introduction and instruction card</span></li>\r\n</ul>\r\n<p><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;"><strong>Technical Specifications:</strong></span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<table border="1" cellpadding="2">\r\n<tbody>\r\n<tr><th><span style="font-size: medium;">Item</span></th><th><span style="font-size: medium;">Length</span></th><th><span style="font-size: medium;">Overall Weight</span></th></tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Yellow &ldquo;Superlight&rdquo; Club</span></td>\r\n<td><span style="font-size: medium;">45&Prime;</span></td>\r\n<td><span style="font-size: medium;">225 Grams</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Green &ldquo;Light&rdquo; Club</span></td>\r\n<td><span style="font-size: medium;">45&Prime;</span></td>\r\n<td><span style="font-size: medium;">255 Grams</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Blue &ldquo;Medium&rdquo; Club</span></td>\r\n<td><span style="font-size: medium;">45&Prime;</span></td>\r\n<td><span style="font-size: medium;">290 Grams</span><br /><br /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style="font-size: medium;"></span></p>'),
(484, 76, 0, 178, '<p>Senior SuperSpeed Golf Training System</p>'),
(486, 75, 0, 179, '<p><span style="font-size: medium;">After thoroughly testing the SuperSpeed Golf system we are excited to now be carrying this awesome training aid, the first in our new training aid line.&nbsp;&nbsp;&nbsp;We have these in stock and ready to ship today.&nbsp;&nbsp;These have been getting awesome results both on tour and off.&nbsp;These are currently being used on tour by Phil Mickelson, Dustin Johnson, Paul Casey, Ian Poulter, Alen Noren, Byrson DeChameau, Beau Hossler, Sam Saunders, Hideko Matsuyama, Miguel Angel Jimenez, Scott Stallings, CT Pan, Adam Hadwin, Graeme McDowell, Brian Gay and several others. As always we stand behind everything we sell with a full satisfaction.&nbsp;</span></p>\r\n<p></p>\r\n<p><span style="font-size: medium;">"We believe that a major cornerstone is playing high level competitive golf is distance derived from swing speed. Many collegiate programs these days place a huge premium on recruiting players who have more power. The reasons are pretty obvious. Players with more swing speed have the potential to shoot much lower scores as the rest of their games develop. Players that make it to college without up to par power statistics tend to struggle and grind through rounds much more than those than can bomb it down the fairway and take advantage of many more scoring opportunities. Our team at SuperSpeed Golf has seen this happen time and time again with many of our players who have gone on to have successful collegiate careers. Integrating the concepts of overspeed training with these players has helped them get a competitive advantage over the players they are competing against for collegiate scholarships. During the development of SuperSpeed Golf, we have found that using lighter weight clubs in specific training can help every golf increase swing speed, maximize biomechanical efficiency of the swing, improve consistency in ball striking, and reduce many common swing flaws caused by inefficient sequencing of the golf swing. We spent years determining the optimal weighting breakdown of our SuperSpeed Golf Clubs and the most effective training protocols to maximize our player&rsquo;s progress. The result is the SuperSpeed Golf Junior Training System. This training system is optimized for players who play a lightweight driver with an overall weight between 270 and 300 grams. This set includes the Yellow (superlight), Green (light), and Blue (medium) weighted SuperSpeed Clubs. Our players will swing all three of these clubs in a light to heavy progression during our overspeed training protocols. We find that players typically gain between 5% and 8% additional swing speed over the first 4-6 weeks of regular practice. Each training session only takes about 10 minutes to complete. We recommend 3 training sessions per week for optimal results. Adding overpseed training to your swing and physical programs will surely help you gain speed and an even greater edge over the competition!"</span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;"><strong>What&rsquo;s in the box:</strong></span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<ul>\r\n<li><span style="font-size: medium;">SuperSpeed Golf Yellow &ldquo;Superlight&rdquo; Training Club</span></li>\r\n<li><span style="font-size: medium;">SuperSpeed Golf Green &ldquo;Light&rdquo; Training Club</span></li>\r\n<li><span style="font-size: medium;">SuperSpeed Golf Blue &ldquo;Medium&rdquo; Training Club</span></li>\r\n<li><span style="font-size: medium;">Introduction and instruction card</span></li>\r\n</ul>\r\n<p><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;"><strong>Technical Specifications:</strong></span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<table border="1" cellpadding="2">\r\n<tbody>\r\n<tr><th><span style="font-size: medium;">Item</span></th><th><span style="font-size: medium;">Length</span></th><th><span style="font-size: medium;">Overall Weight</span></th></tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Yellow &ldquo;Superlight&rdquo; Club</span></td>\r\n<td><span style="font-size: medium;">41&Prime;</span></td>\r\n<td><span style="font-size: medium;">220 Grams</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Green &ldquo;Light&rdquo; Club</span></td>\r\n<td><span style="font-size: medium;">41&Prime;</span></td>\r\n<td><span style="font-size: medium;">250 Grams</span></td>\r\n</tr>\r\n<tr>\r\n<td><span style="font-size: medium;">Blue &ldquo;Medium&rdquo; Club</span></td>\r\n<td><span style="font-size: medium;">41&Prime;</span></td>\r\n<td><span style="font-size: medium;">285 Grams</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style="font-size: medium;"></span></p>'),
(487, 76, 0, 179, '<p>Junior SuperSpeed Golf Training System</p>'),
(489, 75, 0, 180, '<p><span style="font-size: medium;">Flexfit Delta is a revolutionary cap that is the lighter, sleeker, smarter and more comfortable choice. It fuses panels with a seamless, stitch-free finish and it couples a lightweight visor fabrication with a new 3-Layer multifunction sweatband for sweat absorption, stain prevention and quick drying. There&rsquo;s even patent-pending stain block tech that prevents sweat staining on the cap&rsquo;s crown. It also features a water repellent functionality. New lightweight, hard buckram.&nbsp;Full Miura logo on front of hat and signature Miura M on back.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">92% Polyester / 8% Spandex</span></p>\r\n<p><span style="font-size: medium;">Sizes:</span></p>\r\n<p><span style="font-size: medium;">S/M (6 3/4&rdquo; &ndash; 7 1/4&rdquo;)</span></p>\r\n<p><span style="font-size: medium;">L/XL (7 1/8&rdquo; &ndash; 7 5/8&rdquo;)</span></p>'),
(490, 76, 0, 180, '<p>Miura FlexFit Golf Hat</p>'),
(491, 85, 0, 180, 'Miura FlexFit Golf Hat '),
(492, 75, 0, 181, '<p><span style="font-size: medium;">Now available from TPC is the newly redesigned Miura Baby Blade. TPC is one of the only places with these gorgeous irons. &nbsp;</span><span style="font-size: medium;">These will come built to your specs in house by one our trained master club builders. &nbsp;They will come with the shafts and grips of your choice. &nbsp;</span></p>'),
(493, 76, 0, 181, '<p><span style="font-size: medium;">Miura Baby Blade 3-PW Irons with shafts and grips of your choice</span></p>'),
(494, 85, 0, 181, 'Miura Baby Blade 3-PW'),
(495, 75, 0, 182, '<p><span style="font-size: medium;">The combination of art and design is what truly makes the VYLYN (Vil-lain) stand out among the rest.</span></p>\r\n<p><span style="font-size: medium;">Inspired by pop-artists Andy Warhol and Roy Lichtenstein, the VYLYN showcases the most eye-catching cosmetics in golf. Beneath the iconic artwork, lies layers of high modulus composite material making VYLYN one of the most advanced composite shafts in the market. The material is hand laid in consistent and multiple directions in order to control torque and bend profile. The result is better feel and higher performance.</span></p>\r\n<p><span style="font-size: medium;">The VYLYN&rsquo;s bend profile is softer in the butt section of the shaft, while stiffer in the mid and tip sections. This results in low spin with mid-high launch. A player with an average load and smooth swing could benefit from playing the VYLYN.</span></p>\r\n<p><span style="font-size: medium;">But really, who doesn&rsquo;t want to PLAY THE VILLIAN?</span></p>\r\n<p><span style="font-size: medium;">These will come built in house to your specifications&nbsp;and will come with the adapter and grip of your choice.&nbsp;</span></p>'),
(496, 76, 0, 182, '<p><span style="font-size: medium;">This is for a new VA Composites Vylyn shaft of your choice built to your specs. As always everything we sell comes with a full money back guarantee.</span></p>'),
(497, 85, 0, 182, 'VA Composites Vylyn Shaft '),
(498, 75, 0, 183, '<p><span style="font-size: medium;">We&rsquo;ve taken our tour proven, time tested Red Board profile and enhanced it using Mitsubishi Chemical''s latest design and material innovations, to create the next generation Diamana&trade; RF-Series. Strategically positioned DIALEAD&trade; Pitch Fiber, MR70 and boron fiber infused hybrid prepreg deliver unmatched strength, stability and performance from this higher launching profile.</span></p>\r\n<p></p>\r\n<p><span style="font-size: medium;">The Diamana&trade; RF-Series represents the next generation version of MCA GOLF&rsquo;s signature &ldquo;active&rdquo; bend profile. The new RF-Series, like its most recent predecessor the Diamana&trade; R-Series, incorporates high-strength DIALEAD&trade; Pitch Fiber by Mitsubishi Chemical into the butt-section of the shaft, adding unprecedented strength and control during shaft loading and unloading.</span></p>\r\n<p></p>\r\n<p><span style="font-size: medium;">The new Diamana&trade; RF-Series incorporates for the first time a new hybrid prepreg developed by the engineers at Mitsubishi Chemical. This new prepreg combines boron fiber and Mitsubishi Chemical&rsquo;s latest carbon fiber innovation MR70. Mitsubishi Chemical&rsquo;s MR70 by is 20% stronger and has 10% higher modulus than conventional carbon fibers. Strategically positioned in the tip-section of the shaft this hybrid prepreg provides unprecedented strength and stability at impact.</span></p>\r\n<p><span style="font-size: medium;">If you have any questions please ask. These will come with a tip and grip of your choice.&nbsp;</span></p>'),
(499, 76, 0, 183, '<p>NEW Mitsubishi RF Shaft with a tip and grip of your choice, satisfaction guarantee.</p>'),
(500, 85, 0, 183, 'NEW Mitsubishi Diamana RF Series Shaft'),
(501, 75, 0, 184, '<p><span style="font-size: medium;">This is for a new Tour Issue Taylormade M5 Head. We currently have all three lofts available. The Tour heads are hand picked for tour use, specs measured, COR tested and approved, then finally hot melted. These have been getting tons of play on tour this year with several top pros using them including Tiger Woods, Rory McIlroy, Justin Rose, Dustin Johnson and several others. Feedback on the M5 has been very good. Head covers and tour adapters are available for purchase. Hot Melt is included in this price. If you would like to hand pick the specs your head or have any questions please <a title="Email Us" href="mailto:will@peoples.golf">email us</a>. <a title="https://thepeoplesclubs.com/tour-issue-taylormade-m5-driver-w-shaft-of-your-choice.html">Shafted options are available as well. </a></span></p>'),
(502, 76, 0, 184, '<p>This for a NEW Tour Issue Taylormade M5 Head. As always everything we sell comes with a satisfaction guarantee.</p>'),
(503, 85, 0, 184, 'NEW Tour Issue Taylormade M5 Driver Head'),
(504, 75, 0, 185, '<p>This is for one dozen 2019 Titleist Pro V1 golf balls. Best of all these have our Peoples Golf logo! Shipping is free as always, email us with any questions.</p>'),
(505, 76, 0, 185, '<p>New Dozen of "Peoples Clubs" ProV1</p>'),
(506, 85, 0, 185, 'New 2019 Dozen of "Peoples Golf" Titleist ProV1 '),
(507, 75, 0, 186, '<p>This is for one dozen 2019 Titleist AVX golf balls. Best of all these have our Peoples Golf logo! Shipping is free as always, email us with any questions.</p>'),
(508, 76, 0, 186, '<p>New Dozen of "Peoples Clubs" AVX</p>'),
(509, 85, 0, 186, 'New 2019 Dozen of "Peoples Golf" Titleist AVX'),
(510, 75, 0, 187, '<p><span style="font-size: medium;">The Milled Tour Wedge High Bounce (HB) delivers the legendary soft feel golfers covet. The renowned Miura forging process produces a grain structure within the head that is the tightest in the industry. </span></p>\r\n<p><span style="font-size: medium;">The wedge does not pursue distance like other clubs, but rather the precision and control necessary for scoring. The tour inspired head shape confidently aligns the golfer allowing for pinpoint accuracy. &nbsp;The Tour Wedge HB boasts a wider sole that tapers from toe to heel. This design allows for a more effective bounce along the middle of the sole. The added C Grind (heel and toe relief) and camber (front to back relief) increases playability and forgiveness. </span></p>\r\n<p><span style="font-size: medium;">The head design of the Tour Wedge HB will match with any of Miura''s iron models. Lofts are available in 50&deg;-62&deg; in 2 degree increments to configure the perfect set.</span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs and will include any necessary bending, as well as the shaft and grip of your choice. &nbsp;Stamping and paint fill options available as well. &nbsp;If you have any questions please <a href="mailto:info@thepeoplesclubs.com%20" title="Email Us ">email us</a> to discuss. &nbsp;</span></p>\r\n<p></p>'),
(511, 76, 0, 187, '<p><span style="font-size: medium;">These new Miura Tour Series HB Wedge will come built to your specs, and with the shaft and grip of your choice.</span></p>'),
(512, 85, 0, 187, 'Miura Tour Series HB Wedge'),
(513, 85, 0, 188, 'National Custom Works Wedge'),
(514, 75, 0, 188, '<p><span style="font-size: medium;">These remarkable National Custom Works Wedges are forged in Japan then hand ground by Jeff McCoy, finally these are built to spec in house at TPC. These were given an extremely versatile DS Grind. These are offered in 51,53,55,57, and 59.  They will come built to specs with the shaft and grip of your choice. Please <a href="mailto:will@peoples.golf%20" title="Email Us ">email us</a> with any questions. </span></p>'),
(515, 76, 0, 188, '<p>National Custom Works Wedge - Jeff McCoy</p>'),
(516, 75, 0, 189, '<p><span style="font-size: medium;">One Size Fits All Snapback.  Adjustable + Flexfit® Technology. Classic shape. Matching plastic snap & undervisor. Hard buckram. Moisture-absorbent elastic sweatband. Premium wool blend.  We have these in both Black with Gold or Black with White.  Pictured is the black with gold. </span></p>'),
(517, 76, 0, 189, '<p>Miura FlexFit 110 Snapback</p>'),
(518, 85, 0, 189, 'Miura FlexFit 110 Snapback'),
(519, 75, 0, 190, '<p><span style="font-size: medium;">This is for a New Limited Edition set of Project X Blackout 4-PW Shafts. These were just released and Peoples Golf is the first to have them.  We have these in the LZ and the regular PX.  The LZ shafts come in 5.5, 6.0, or 6.5. The regular PX come in 5.5, 6.0, 6.5, and 7.0. \r\n\r\nIf you need these installed please let us know and we will get you a price. We are an authorized True Temper Performance Fitting Center, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the new Project X Blackout shafts please ask! </span></p>'),
(520, 76, 0, 190, '<p>&lt;p&gt;&lt;span style="font-size: medium;"&gt;Project X Blackout Iron Shafts, custom installed options available as well. &lt;/span&gt;&lt;/p&gt;</p>'),
(521, 85, 0, 190, 'Project X Blackout Iron Shafts (LZ Included)'),
(522, 75, 0, 191, '<p><span style="font-size: medium;">New Custom Built Titleist TS Hybrid. &nbsp;This can be either head and any loft, we will custom build this with the shaft of your choice. This will also come fully built to your desired specs. We can add some more hot melt if you would like, just ask. This will come with a headcover and wrench (if needed please ask.) &nbsp;As always everything we sell is 100% legit and comes with a satisfaction guarantee. </span></p>'),
(523, 76, 0, 191, '<p><span style="font-size: medium;">This is for a NEW CUSTOM BUILT TITLEIST TS HYBRID .  As always everything comes with a satisfaction guarantee.</span></p>'),
(524, 85, 0, 191, 'Custom Built Titleist TS Hybrid'),
(525, 75, 0, 192, '<p class="font_4"><span style="font-size: medium;">This is for a set of new Titleist T Series Irons. &nbsp;These will come built to your specs with the heads, shafts and grips of your choice. &nbsp;We can do any of the T Series sets, T100, T200, or T300. We can also do any shaft and grip you want. They will also be built to your desired specs.&nbsp;</span></p>\r\n<p class="font_9"><span style="font-size: medium;">These are being sold as 3-PW however we can do a different set makeup, just email us to discuss.&nbsp; &nbsp;Please allow 2 weeks for us to assemble these. &nbsp;As always everything is built in house by our staff and built to absolute best quality possible. &nbsp;&nbsp;<a href="mailto:will@peoples.golf" title="email us">Email us to discuss your next build</a>.</span></p>'),
(526, 76, 0, 192, '<p>This is for a set of New Titleist T Series Irons 3-PW, these will come built to your specs and come with our satisfaction guarantee.</p>'),
(527, 85, 0, 192, 'New Titleist T Series Irons 3-PW '),
(528, 75, 0, 193, '<p><span style="font-size: medium;">The Tour AD XC shaft profile is soft in the butt section, stiff in the center section and has a stiff tip to promote low/mid launch angle and low spin with the ball. The Tour AD XC also utilizes the brand new TORAYCA&reg; M40X carbon-fiber pre-preg in the Mid to Tip Section of the shaft as well as the TORAYCA&reg; T1100G carbon-fiber pre-preg with NANOALLOY&reg; technology in the tip section of the shaft for unrivaled shaft stability and precise ball control without the loss of the exceptional feel that Graphite Design shafts are so well known for. </span></p>\r\n<p><span style="font-size: medium;">These will <span>definitely </span>be one of the hottest shafts this year. &nbsp;As always these will come built to your specs with a tip and grip of your choice. &nbsp;</span></p>\r\n<p><a href="https://forums.golfwrx.com/discussion/1785235/new-graphite-design-tour-ad-xc-shafts-august-2019" title="Graphite Design XC"><span style="font-size: medium;">Check out our friends at GOLFWRX for their opinions on the XC.</span></a></p>'),
(529, 76, 0, 193, '<p><span style="font-size: medium;">This is for a new Graphite Design TOUR AD XC shaft built to your specs. This will include the shaft, tip, grip and a free gift! Keep in mind everything we sell comes with a full warranty and satisfaction guarantee. </span></p>'),
(530, 85, 0, 193, 'Graphite Design TOUR AD XC'),
(531, 75, 0, 194, '\r\n<p><span style="font-size: medium;">Diamana&trade; ZF-Series takes the signature &lsquo;smooth&rsquo; bend profile Diamana&trade; BF-Series and pushes it in just the right places. Diamana&trade; ZF shafts feature moderately stronger, more stable butt and tip sections with a slightly softer and more active middle section. This produces a shaft that is incredibly solid during shaft loading and unloading, and at impact, but with smoother energy transfer and easier acceleration throughout the swing. The Diamana&trade; ZF-Series will also offer the first-ever 40g Diamana&trade; Fourth Generation Series shaft option. Diamana&trade; ZF-Series are perfect for any player looking to increase clubhead acceleration while maintaining stability and control through impact.</span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;">Like all of their Diamana&trade; Fourth Generation Series predecessors, Diamana&trade; ZF shafts owe their carefully calibrated stiffness and stability to two unique technologies: MR70 carbon fiber material, and Boron fiber.</span></p>\r\n<p><span style="font-size: medium;">If you have any questions please ask. These will come with a tip and grip of your choice.&nbsp;</span></p>'),
(532, 76, 0, 194, '<p>&lt;p&gt;&lt;span style="font-size: medium;"&gt;NEW Mitsubishi ZF Shaft with a tip and grip of your choice, satisfaction guarantee.&lt;/span&gt;&lt;/p&gt;</p>'),
(533, 85, 0, 194, 'Mitsubishi Diamana ZF Series Shaft'),
(534, 75, 0, 195, '<p><span style="font-size: medium;">Feel as relaxed as your lifestyle in this enzyme washed cotton jersey t-shirt for the ultimate comfort. 100% Cotton. Black T-Shirt. T-Shirt manufactured by New Level Apparel.</span></p>\r\n<ul data-rte-list="default">\r\n<li>\r\n<h3><span style="font-size: medium;">RIB-KNIT CREW NECK.</span></h3>\r\n</li>\r\n<li>\r\n<h3><span style="font-size: medium;">SHORT SLEEVES.</span></h3>\r\n</li>\r\n<li>\r\n<h3><span style="font-size: medium;">VYLYN LOGO GRAPHIC ACROSS FRONT.</span></h3>\r\n</li>\r\n<li>\r\n<h3><span style="font-size: medium;">SUPER-SOFT, 100% COTTON TEE</span></h3>\r\n</li>\r\n</ul>'),
(535, 76, 0, 195, '<p>Vylyn Graphic T-Shirt</p>'),
(536, 85, 0, 195, 'Vylyn Graphic T-Shirt'),
(537, 75, 0, 196, '<p><span style="font-size: medium;">New Custom Built Taylormade P790 UDI. &nbsp;This will come custom built to your specs with the shaft and grip of your choice. This will also come fully built to your desired specs. These have been getting incredible feedback. &nbsp;As always everything we sell is 100% legit and comes with a satisfaction guarantee. </span></p>'),
(538, 76, 0, 196, '<p><span style="font-size: medium;">This is for a New Custom Built Taylormade P790 2 UDI.  As always everything comes with a satisfaction guarantee.</span></p>'),
(539, 85, 0, 196, 'Custom Built Taylormade P790 2 UDI '),
(540, 75, 0, 197, '<p><span style="font-size: medium;">Now available from TPC is the new Miura MB 101. The MB-101 incorporates the best characteristics of early Miura designs and models. The subtle refinements to the sole allow the club to travel effortlessly through the turf. The sole width and face thickness have been optimized (from our MB-001) allowing for heightened feel and feedback. &nbsp;</span><span style="font-size: medium;">These will come built to your specs in house by one our trained master club builders. &nbsp;These will also come with the shafts and grips of your choice. &nbsp;</span></p>\r\n<p><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;">As of 6/15/20 we now have 2 irons available as well.&nbsp;</span></p>'),
(541, 76, 0, 197, '<p><span style="font-size: medium;">Miura MB-101 3-PW Irons with shafts and grips of your choice</span></p>'),
(542, 85, 0, 197, 'Miura MB-101 '),
(543, 75, 0, 198, '<div class="txtNew" id="comp-jml55e1t" data-packed="false" data-min-height="30">\r\n<div class="txtNew" id="comp-jml4lnpz1" data-packed="false" data-min-height="30">\r\n<p class="font_4"><span style="font-size: medium;">This is for a set of new Mizuno MP 20 Irons. &nbsp;These will come built to your specs with the heads, shafts and grips of your choice. &nbsp;We can do the HMB or MMC as well.&nbsp;</span></p>\r\n</div>\r\n</div>\r\n<div class="txtNew" id="comp-jml55e2s" data-packed="false" data-min-height="326">\r\n<p class="font_9"><span style="font-size: medium;">These are being sold as 3-PW however we can do a different set makeup, just email us to discuss.&nbsp; &nbsp;Please allow 2 weeks for us to assemble these. &nbsp;As always everything is built in house by our staff and built to absolute best quality possible. &nbsp;&nbsp;<a href="mailto:will@peoples.golf" title="email us">Email us to discuss your next build</a>.</span></p>\r\n</div>'),
(544, 76, 0, 198, '<p>This is for a set of New Mizuno MP 20 Irons 3-PW, these will come built to your specs and come with our satisfaction guarantee.</p>'),
(545, 85, 0, 198, 'Mizuno MP 20 Irons 3-PW '),
(546, 75, 0, 199, '<p>&nbsp;<span style="font-size: medium;">The all-new Speeder Evolution VI continues the cadence of high-performance, premium shafts engineered by Fujikura Japan. Developed on the foundation and heritage of the Speeder Evolution Series, Evolution VI incorporates the latest materials and construction practices available with the advanced learnings from its predecessors. Evo VI is based on the profile of Evo IV, offers exceptional speed and stability for longer and straighter shots off the tee. Evo VI features a low-mid launch and spin that fits perfectly between Evo IV and Evo V.</span></p>\r\n<p><span style="font-size: medium;">Included in the auction is the install of this shaft in your club with a free grip. Or we can install it in a tip of your choice. We have all of the tips in stock. We are an authorized Fujikura dealer, every shaft we sell is custom fit for you and comes with a full lifetime warranty. If you have any questions on the Evo 5 please ask! </span><br /><br /><br /></p>'),
(547, 76, 0, 199, '<p><span style="font-size: medium;">This is for a new Fujikura Speeder EVOLUTION 6 shaft of your choice built to your specs. As always everything we sell comes with a satisfaction guarantee.</span></p>'),
(548, 85, 0, 199, 'Fujikura Speeder EVOLUTION 6'),
(549, 75, 0, 200, '<p>The Peoples Clubs is now offering Stainless Steel Tempercraft Water Bottles. These are a premium water bottle with an insulated double wall thats vacuum sealed. These will keep your drink cold for the entire day, they also feature "Peoples Golf" logo. Best of all they are BPA Free and Condensation Free. They also come with a lifetime warranty. We currently have these in black, white, red, and Turquoise.</p>'),
(550, 76, 0, 200, '<p>New "Peoples Golf" TemperCraft Water Bottle</p>'),
(551, 85, 0, 200, '"Peoples Golf" TemperCraft 22oz Water Bottle'),
(552, 75, 0, 201, '<p><span style="font-size: medium;"><span>Born from more than 30-years of composite shaft mastery, the new MMT&nbsp;Taper Iron&nbsp;utilizes a patent pending Metal Mesh Technology (MMT)&nbsp;to redefine the possibilities for feel and performance in a composite iron shaft. A unique metal mesh &ndash; made from individually braided strands of 304 Stainless Steel &ndash;&nbsp;is integrated into the shaft&rsquo;s prepreg layers towards the tip. This improves density and stability, while also allowing for thinner overall composite wall construction. Together this yields a finely tuned, highly responsive shaft that still provides the consistent launch and spin control needed for effective iron play.</span>&nbsp;We have these in both taper and parallel. Installation options are available as well.  The price of $150 is for a full iron set installation. &nbsp;</span></p>'),
(553, 76, 0, 201, '<p>This is for a new Mitsubishi MMT Iron Shaft Set, this will come built to your specs and also comes with our satisfaction guarantee.</p>'),
(554, 85, 0, 201, 'Mitsubishi MMT Graphite Iron Shaft Set'),
(555, 75, 0, 202, '<p><span style="font-size: medium;">The LH TB-901 has a modified toe profile with a subtle shift in weight from toe to heel, allowing the player to more easily square up the club head at impact. Yoshitaka&rsquo;s infamous &ldquo;Y&rdquo; Grind has allowed Miura to deliver two additional offerings to the left-handed golfer.</span></p>\r\n<p><span style="font-size: medium;">These will come built to your specs with the shafts and grips of your choice. &nbsp;<a href="mailto:will@peoples.golf">Email us</a> to discuss your next build.&nbsp;</span></p>'),
(556, 76, 0, 202, '<p>This is for a set of Miura Left Hand Tournament Blade TB-901 4-PW, these will come built to your specs and come with our satisfaction guarantee.</p>'),
(557, 85, 0, 202, 'Miura Left Hand Tournament Blade TB-901 3-PW '),
(558, 75, 0, 203, '<p><span style="font-size: medium;">Vessel&rsquo;s #1 bestseller upgraded in a new 2.0 version. New special features added with carbon fiber legs, all waterproof zippers, interchangeable straps, carbon fiber towel ring, and genuine leather handles.</span></p>\r\n<p><span style="font-size: medium;"><strong>Materials:</strong></span><br /><span style="font-size: medium;">Microsuede Backed Synthetic Leather</span><br /><span style="font-size: medium;">Known for its durability, abrasion and heat resistance, and is easy to clean.</span></p>\r\n<p><span style="font-size: medium;"><strong>Top size:</strong></span><br /><span style="font-size: medium;">6-way with 3 full-length dividers &ndash; 8.5&Prime; x 6.75&Prime;</span></p>\r\n<p><span style="font-size: medium;"><strong>Weight:</strong></span><br /><span style="font-size: medium;">5.75 lbs/2.6 kg</span></p>\r\n<p><span style="font-size: medium;"><strong>Dimensions:</strong></span><br /><span style="font-size: medium;">34.5&Prime;H x 13&Prime;L x 12&Prime;W</span></p>\r\n<p><span style="font-size: medium;"><strong>Features:</strong></span><br /><span style="font-size: medium;">&bull; Cooler pocket</span><br /><span style="font-size: medium;">&bull; Velour lined valuables pocket</span><br /><span style="font-size: medium;">&bull; Large garment pocket</span><br /><span style="font-size: medium;">&bull; Valuables pocket with lock</span><br /><span style="font-size: medium;">&bull; Magnetic tee pocket</span><br /><span style="font-size: medium;">&bull; Ball pocket</span><br /><span style="font-size: medium;">&bull; Double equilibrium strap</span><br /><span style="font-size: medium;">&bull; Rotator stand technology base</span><br /><span style="font-size: medium;">&bull; Towel ring</span><br /><span style="font-size: medium;">&bull; Umbrella holder</span><br /><span style="font-size: medium;">&bull; Premium YKK zippers with genuine leather pulls</span><br /><span style="font-size: medium;">&bull; All-weather rain hood</span><br /><span style="font-size: medium;">&bull; Pen and tee holder</span></p>'),
(559, 76, 0, 203, '<p>Vessel Miura Stand Golf Bag</p>'),
(560, 85, 0, 203, 'Vessel Miura Stand Golf Bag'),
(561, 75, 0, 204, '<p class="p1"><span style="font-size: medium;">An all-new carry bag built with premium nylon twill for maximum durability with minimum weight. With a Four-way top configuration, premium YKK water-resistant zippers and lightweight carbon fiber legs</span></p>\r\n<p><span style="font-size: medium;"><strong>Materials:</strong></span><br /><span style="font-size: medium;">Premium VSL Nylon / Durable TPU Backing for Weather Resistance</span></p>\r\n<p><span style="font-size: medium;"><strong>Top size:</strong></span><br /><span style="font-size: medium;">4-way full-length dividers &ndash; 8&Prime; x 6.25&Prime;</span></p>\r\n<p><span style="font-size: medium;"><strong>Weight:</strong></span><br /><span style="font-size: medium;">4.25 lbs/1.9 kg</span></p>\r\n<p><span style="font-size: medium;"><strong>Dimensions:</strong></span><br /><span style="font-size: medium;">34.75&Prime;H x 13&Prime;L x 12&Prime;W</span></p>\r\n<p><span style="font-size: medium;"><strong>Features:</strong></span><br /><span style="font-size: medium;">&bull; Ultra lightweight rip-stock nylon</span><br /><span style="font-size: medium;">&bull; 4-point adjustable strap</span><br /><span style="font-size: medium;">&bull; Patented Rotator Stand technology allows maximum stability</span><br /><span style="font-size: medium;">&bull; Premium carbon fiber legs</span><br /><span style="font-size: medium;">&bull; Nylon rain hood</span><br /><span style="font-size: medium;">&bull; Premium water-resistant zippers</span><br /><span style="font-size: medium;">&bull; Pen holder</span></p>'),
(562, 76, 0, 204, '<p>Vessel Miura Lite Stand Golf Bag</p>'),
(563, 85, 0, 204, 'Vessel Miura Lite Stand Golf Bag ');
INSERT INTO `catalog_product_entity_text` (`value_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(564, 75, 0, 205, '<p><span style="font-size: medium;">Vessel&rsquo;s #1 bestseller upgraded in a new 2.0 version. New special features added with carbon fiber legs, all waterproof zippers, interchangeable straps, carbon fiber towel ring, and genuine leather handles. &nbsp;These also have our Peoples Golf logo on the front pocket.&nbsp;</span></p>\r\n<p><span style="font-size: medium;"><strong>Materials:</strong></span><br /><span style="font-size: medium;">Microsuede Backed Synthetic Leather</span><br /><span style="font-size: medium;">Known for its durability, abrasion and heat resistance, and is easy to clean.</span></p>\r\n<p><span style="font-size: medium;"><strong>Top size:</strong></span><br /><span style="font-size: medium;">6-way with 3 full-length dividers &ndash; 8.5&Prime; x 6.75&Prime;</span></p>\r\n<p><span style="font-size: medium;"><strong>Weight:</strong></span><br /><span style="font-size: medium;">5.75 lbs/2.6 kg</span></p>\r\n<p><span style="font-size: medium;"><strong>Dimensions:</strong></span><br /><span style="font-size: medium;">34.5&Prime;H x 13&Prime;L x 12&Prime;W</span></p>\r\n<p><span style="font-size: medium;"><strong>Features:</strong></span><br /><span style="font-size: medium;">&bull; Cooler pocket</span><br /><span style="font-size: medium;">&bull; Velour lined valuables pocket</span><br /><span style="font-size: medium;">&bull; Large garment pocket</span><br /><span style="font-size: medium;">&bull; Valuables pocket with lock</span><br /><span style="font-size: medium;">&bull; Magnetic tee pocket</span><br /><span style="font-size: medium;">&bull; Ball pocket</span><br /><span style="font-size: medium;">&bull; Double equilibrium strap</span><br /><span style="font-size: medium;">&bull; Rotator stand technology base</span><br /><span style="font-size: medium;">&bull; Towel ring</span><br /><span style="font-size: medium;">&bull; Umbrella holder</span><br /><span style="font-size: medium;">&bull; Premium YKK zippers with genuine leather pulls</span><br /><span style="font-size: medium;">&bull; All-weather rain hood</span><br /><span style="font-size: medium;">&bull; Pen and tee holder</span></p>'),
(565, 76, 0, 205, '<p>Peoples Golf Vessel Stand Golf Bag</p>'),
(566, 85, 0, 205, 'Peoples Golf Vessel Stand 2.0 Golf Bag '),
(567, 75, 0, 206, '<p><span style="font-size: medium;">Introducing the new Stability Tour, a putter shaft with a tour-preferred feel and sleeker look. &nbsp;Stability Tour is the result of feedback from the best golfers and coaches in the world and offers the same state-of-the-art performance as the Original Stability Shaft.</span></p>\r\n<p><span style="font-size: medium;">Just like the original stability these will balance the same as a traditional steel shaft which means it won''t affect your putters swing weight. The stability tour features a smaller sleeker stability tube as well as a black shaft tip just like our popular&nbsp;<a href="https://tourstockputters.com/collections/shafts/products/stability-putter-shafts" rel="noopener noreferrer" title="Stability Blackout" target="_blank">stability blackout shafts</a>.&nbsp;</span></p>\r\n<p><span style="font-size: medium;">As always, we can install this&nbsp;shaft on your putter. Simply mail it to us, we will install a new shaft and ship it back. The installed option will also include a free loft and lie adjustment and a free lamkin deep etch grip, additional grips available for purchase. &nbsp;If you need help figuring out which shaft you need please&nbsp;<a href="mailto:will@peoples.golf%20" title="Email Us ">email us</a>.</span></p>'),
(568, 76, 0, 206, '<p>&lt;p&gt;&lt;span style="font-size: medium;"&gt;This is for a brand new custom installed Stability Tour putter shaft. &lt;/span&gt;&lt;/p&gt;</p>'),
(569, 85, 0, 206, 'Stability Tour Putter Shaft'),
(570, 75, 0, 207, '<p><span style="font-size: medium;">NEW TOUR ISSUE TAYLORMADE M5 Tour 10.5 w/ Fujikura Ventus Black 7X. This is new never used. These are extremely rare and very popular on tour right now.  This is shafted with a Fujikura Ventus Black 7X. &nbsp;These tour heads are hand picked for tour use, based on better specs or a hotter face. Finally hot melted on the tour van. Almost every pro has already changed over to these. No headcover included with this one. The specs are 45", D2, 60, 10.8, .4 open, Tour Velvet. If you need a different lofted head or a different weight or flex shaft just let us know.  As always we are more than willing to accommodate the needs of our customers. We have all of the new 2019 heads available so if you would like to discuss a custom build <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a> As always everything we sell is 100% legit and comes with a satisfaction guarantee. </span></p>'),
(571, 76, 0, 207, '<p><span style="font-size: medium;">This is for a NEW TOUR ISSUE TAYLORMADE M5 10.5 w/ Fujikura Black Ventus 7X.  As always everything comes with a satisfaction guarantee.</span></p>'),
(572, 85, 0, 207, 'TOUR ISSUE TAYLORMADE M5 10.5 TOUR w/ Fujikura Ventus Black 7X'),
(573, 75, 0, 208, '<p><span style="font-size: medium;">NEW TOUR ISSUE TAYLORMADE M5 Tour 10.5 w/ T1100 65 6.5TX. This is new never used. These are extremely rare and very popular on tour right now.  This is shafted with a Project X HZRDUS T1100. &nbsp;These tour heads are hand picked for tour use, based on better specs or a hotter face. Finally hot melted on the tour van. Almost every pro has already changed over to these. No headcover included with this one. The specs are 45.5", D2, 59.7, 10.1, .75 open, W/B Multi Grip. If you need a different lofted head or a different weight or flex shaft just let us know.  As always we are more than willing to accommodate the needs of our customers. We have all of the new 2019 heads available so if you would like to discuss a custom build <a href="mailto:will@peoples.golf" title="Email Us ">please email us.</a> As always everything we sell is 100% legit and comes with a satisfaction guarantee. </span></p>'),
(574, 76, 0, 208, '<p><span style="font-size: medium;">This is for a NEW TOUR ISSUE TAYLORMADE M5 10.5 w/ HZRDUS T1100 65 6.5.  As always everything comes with a satisfaction guarantee.</span></p>'),
(575, 85, 0, 208, 'TOUR ISSUE TAYLORMADE M5 10.5 TOUR w/ Project X HZRDUS T1100 65TX'),
(576, 75, 0, 209, '<p class="font_4"><span style="font-size: medium;">This is for a set of new Titleist 620 Series Irons. &nbsp;These will come built to your specs with the heads, shafts and grips of your choice. &nbsp;We can do any of the 620 Series, CB or MB, or we can do a combo set. We can also do any shaft and grip you want. They will also be built to your desired specs.&nbsp;</span></p>\r\n</div>\r\n</div>\r\n<div class="txtNew" id="comp-jml55e2s" data-packed="false" data-min-height="326">\r\n<p class="font_9"><span style="font-size: medium;">These are being sold as 3-PW however we can do a different set makeup, just email us to discuss.&nbsp; &nbsp;Please allow 2 weeks for us to assemble these. &nbsp;As always everything is built in house by our staff and built to absolute best quality possible. &nbsp;&nbsp;<a href="mailto:will@peoples.golf" title="email us">Email us to discuss your next build</a>.</span></p>\r\n<p class="font_9"><span style="font-size: medium;"></span></p>\r\n<p class="font_9"><span style="font-size: medium;"></span></p>\r\n<p><span style="font-size: medium;">The new 620 MB irons stay true to everything players have come to trust from this classic model, with distinct refinements that make them better than ever.</span></p>\r\n<p class="font_9"><span style="font-size: medium;"></span></p>\r\n<ul>\r\n<li><span style="font-size: medium;">Reduced offset for the ultimate player&rsquo;s look</span></li>\r\n<li><span style="font-size: medium;">Progressive blade length for optimized play throughout the set</span></li>\r\n<li><span style="font-size: medium;">Tour-refined sole for improved turf interaction</span></li>\r\n</ul>\r\n<p><span style="font-size: medium;">The new 620 CB irons stay true to everything players have come to trust from this classic model, with distinct refinements that make them better than ever.</span></p>\r\n<ul>\r\n<li><span style="font-size: medium;">Reduced offset and topline for the ultimate player&rsquo;s look</span></li>\r\n<li><span style="font-size: medium;">Progressive blade length for optimized play throughout the set</span></li>\r\n<li><span style="font-size: medium;">Co-forged tungsten in 3- and 4-iron for improved balance</span></li>\r\n<li><span style="font-size: medium;">Tour-refined sole for improved turf interaction</span></li>\r\n</ul>\r\n<p class="font_9"><span style="font-size: medium;"></span></p>\r\n</div>'),
(577, 76, 0, 209, '<p>This is for a set of New Titleist 620 Series Irons 3-PW, these will come built to your specs and come with our satisfaction guarantee.</p>'),
(578, 85, 0, 209, 'Titleist 620 Series Irons 3-PW'),
