(1, 'Will''s Deals', 'wills_deals', '<div id="mc_embed_signup"><form id="mc-embedded-subscribe-form" class="validate" action="//thepeoplesclubs.us4.list-manage.com/subscribe/post?u=2007582be60ef26ac84788cb6&amp;id=73dcb8b928" method="post" name="mc-embedded-subscribe-form" target="_blank">\r\n<div id="mc_embed_signup_scroll">\r\n<h2 style="text-align: left;"><span style="color: #000000;">Sign Up for Will''s Deals Here!</span></h2>\r\n<div class="indicates-required" style="text-align: left;"><span style="color: #000000;"><span class="asterisk">*</span> indicates required</span></div>\r\n<div class="mc-field-group" style="text-align: left;"><span style="color: #000000;"><label for="mce-EMAIL">Email Address <span class="asterisk">*</span> </label> <input id="mce-EMAIL" class="required email" name="EMAIL" type="text" value=""></span></div>\r\n<div class="mc-field-group" style="text-align: left;"><span style="color: #000000;"><label for="mce-FNAME">First Name </label> <input id="mce-FNAME" name="FNAME" type="text" value=""></span></div>\r\n<div class="mc-field-group" style="text-align: left;"><span style="color: #000000;"><label for="mce-LNAME">Last Name </label> <input id="mce-LNAME" name="LNAME" type="text" value=""></span></div>\r\n<div id="mce-responses" class="clear" style="text-align: left;"><span style="color: #000000;">&nbsp;</span></div>\r\n<span style="color: #000000;"><!-- real people should not fill this in and expect good things - do not remove this or risk form bot signups--></span>\r\n<div style="position: absolute; left: -5000px; text-align: left;"><span style="color: #000000;"><input name="b_2007582be60ef26ac84788cb6_73dcb8b928" type="text" value=""></span></div>\r\n<div style="text-align: left;"><span style="color: #000000;"><input id="mc-embedded-subscribe" class="button" name="subscribe" type="submit" value="Subscribe"></span></div>\r\n</div>\r\n</form></div>\r\n<p><span style="color: #000000;"><!--End mc_embed_signup--></span></p>\r\n<p style="text-align: left;"><span style="font-size: medium;"><strong>7/13/20 - To purchase these specials or if you have any questions please &nbsp;email us:&nbsp;<a href="mailto:will@peoples.golf">will@peoples.golf</a></strong></span></p>\r\n<div>\r\n<div style="text-align: center;"><strong><span style="font-size: x-large;">&nbsp;</span></strong></div>\r\n<div><span style="font-size: x-large;">July Special- FREE SUPER SPEED Training System with any order over $1,000!!!&nbsp;</span></div>\r\n<div><a title="WRX PULLS" href="https://forums.golfwrx.com/discussion/1766333/shaft-clear-out-2019-part-2/p1"><span style="font-size: x-large;">&nbsp;</span></a></div>\r\n<br>\r\n<div>&nbsp;</div>\r\n<div><span style="font-size: x-large;"><strong>Will’s Deals!!!&nbsp;</strong></span></div>\r\n<div><a title="Email Us" href="mailto:will@peoples.golf"><span style="font-size: medium;">New Tour Issue Taylormade SIM Max 3/19 Hybrid Head- $325</span></a></div>\r\n<div><a title="Email Us" href="mailto:will@peoples.golf"><span style="font-size: medium;">New Custom Built Taylormade P790 3i w/ MMT 105 S Utility- $300</span></a></div>\r\n<div><a title="Mint Taylormade SIM Driver" href="https://thepeoplesclubs.com/simmax10-5vaproto.html"><span style="font-size: medium;">Mint Tour Issue Taylormade SIM Max 10.5 w/ VA Raijin 75S- $899.99</span></a></div>\r\n<div>&nbsp;</div>\r\n<div><span style="font-size: medium;"><a title="Callaway Mavrik Triple Diamond" href="https://thepeoplesclubs.com/callaway-mavrik-driver-w-shaft-of-your-choice.html">Callaway Mavrik Triple Diamond Now Available</a>(LAST FEW!!!)</span></div>\r\n<div><a title="Fujikura Rope Hat " href="https://thepeoplesclubs.com/fujikura-rope-hat.html"><span style="font-size: medium;">Fujikura Rope Hat- $55 (LAST FEW)</span></a></div>\r\n<div><a title="LA Golf TPZ" href="https://thepeoplesclubs.com/la-tpputter.html"><span style="font-size: medium;">LA Golf TPZ Putter Shafts Now Available</span></a></div>\r\n<div><a title="Tensei AV Raw" href="https://thepeoplesclubs.com/mitsubishi-tensei-av-raw.html"><span style="font-size: medium;">Mitsubishi Tensei AV RAW Now Available</span></a></div>\r\n<div><span style="font-size: medium;"><a title="Tour Issue SIM Driver" href="https://thepeoplesclubs.com/sim10-5-tensei-60s.html">New Tour Issue Taylormade SIM 10.5 Driver w/ Tensei Pro White 60S- $1,100</a></span></div>\r\n<div><span style="font-size: medium;"><a title="Tour Issue SIM Driver" href="https://thepeoplesclubs.com/sim10-5-t1100white65x.html">New Tour Issue Taylormade SIM 10.5 Driver w/ Project X T1100 White 65X- $1,100</a></span></div>\r\n<div><span style="font-size: medium;"><a title="Tour Issue SIM Driver" href="https://thepeoplesclubs.com/sim9-ventus6s.html">New Tour Issue Taylormade SIM 9.0 Driver w/ Fujikura Ventus Blue 6S- $1,100</a></span></div>\r\n<div><a title="Miura MB-101" href="https://thepeoplesclubs.com/miura-mb101.html"><span style="font-size: medium;">Miura MB-101 2 irons Now Available</span></a></div>\r\n<div><a title="TI Taylormade SIM" href="https://thepeoplesclubs.com/tm-ti-sim-driver-w-shaft-of-your-choice.html"><span style="font-size: medium;">Tour Issue Taylormade SIM Drivers NOW BACK IN STOCK!</span></a></div>\r\n<div><span style="font-size: medium;"><a title="VA Composites Nemesys " href="https://thepeoplesclubs.com/vanemesys.html">New VA Composites Nemesys Shaft (NOW BACK IN STOCK!!!)</a></span></div>\r\n<div><span style="font-size: medium;"><a title="Custom Built Honma TR20 Driver " href="https://thepeoplesclubs.com/honma-tr20-driver-w-shaft-of-your-choice.html">Custom Built Honma TR 20 Drivers Now Available!</a>&nbsp;</span></div>\r\n<div>\r\n<div>\r\n<div><a title="Miura Baby Blades!" href="https://thepeoplesclubs.com/miura-baby-blade.html"><span style="font-size: medium;">Miura Baby Blades Now Back In Stock!</span></a></div>\r\n<div><span style="font-size: medium;"><a title="Miura TC " href="https://thepeoplesclubs.com/miura-tc201.html">New Custom Built Miura TC-201 Now Available!</a><