Grind 2.0" href="https://thepeoplesclubs.com/miura-kgrind2-0.html">New Custom Built Miura K Grind 2.0 Wedge w/ Shaft of your choice- $300</a></span></div>\r\n<div><a title="Miura High Bounce " href="https://thepeoplesclubs.com/miura-hb.html"><span style="font-size: medium;">New Custom Built Miura High Bounce Wedge w/ Shaft of your choice- $300</span></a></div>\r\n</div>\r\n<div><span style="font-size: medium;"><a title="Miura Tour Wedge" href="https://thepeoplesclubs.com/miura-tour-wedge-series.html">New Custom Built Miura Tour Wedge Series w/ Shaft of your choice- $300 each</a></span></div>\r\n<div><span style="font-size: medium;"><a title="Miura LEFT HAND Tour Wedge" href="https://thepeoplesclubs.com/miura-tour-wedge-series-lh.html">New Custom Built LEFT HAND Miura Tour Wedge Series w/ Shaft of your choice- $300 each</a></span></div>\r\n<div><a title="Miura Stand 2.0 Bag " href="https://thepeoplesclubs.com/miurastandbag2-0.html"><span style="font-size: medium;"><strong><strong><strong><strong>New Miura Stand 2.0 Bag- $425</strong></strong></strong></strong></span></a></div>\r\n<div><a title="Miura Lite Stand Bag " href="https://thepeoplesclubs.com/miuralitestandbag.html?"><span style="font-size: medium;"><strong><strong><strong><strong>New Miura Lite Stand Bag- $375</strong></strong></strong></strong></span></a></div>\r\n<div><span style="font-size: medium;"><a title="Miura Tour Bag" href="https://thepeoplesclubs.com/miuratourbag.html">New Miura Vessel Tour Bag- Email for Special Pric</a><a title="Miura Tour Bag" href="https://thepeoplesclubs.com/miuratourbag.html">e</a></span></div>\r\n<div><span style="font-size: medium;"><a title="Miura Hat" href="https://thepeoplesclubs.com/miuragolfhat.html">New Miura Golf Hat- $35</a></span></div>\r\n<div><a title="Miura Flex Fit " href="https://thepeoplesclubs.com/miuraflexfitgolfhat.html"><span style="font-size: medium;">New Miura Flex Fit Hats- $40</span></a></div>\r\n<div><a title="Miura Aussie Hat" href="https://thepeoplesclubs.com/miura-aussie-hat.html"><span style="font-size: medium;">Miura Aussie Hat- $40</span></a></div>\r\n<div><a title="Miura Flex Fit Snap Back" href="https://thepeoplesclubs.com/miura-flexfit-110-snapback.html"><span style="font-size: medium;">Miura Flex Fit 110 Snap Back- $40</span></a></div>\r\n<div><a title="Miura Flex Fit 110P " href="https://thepeoplesclubs.com/miura-flexfit-110p.html"><span style="font-size: medium;">Miura Flex Fit 110P- $40</span></a></div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><span style="font-size: x-large;"><strong>Putters</strong></span></div>\r\n<div><span style="font-size: medium;"><a href="https://tourstockputters.com">See Tour Stock Putters for our full collection of tour issue and limited edition putters.</a></span></div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div><span style="font-size: medium;">&nbsp;</span></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<div><span style="font-size: x-large;"><strong>Retail&nbsp;</strong></span></div>\r\n<div><span style="font-size: medium;">We just listed the Taylormade P790 UDI 2i, Titleist T Series Irons, Titleist 620 Series Irons, Callaway Epic Flash Triple Diamond, Cobra F9 Drivers and Fairways, Taylormade M5 and M6 Drivers and Fairways, Callaway Epic Flash Drivers and Fairways, Miura CB-301 and so much more. &nbsp;Check them out&nbsp;<a href="http://thepeoplesclubs.us4.list-manage.com/track/click?u=2007582be60ef26ac84788cb6&amp;id=e6d828d53b&amp;e=8df746937e">Here</a>.</span></div>\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n<p><br><br></p>\r\n<p><span style="font-size: x-large;"><strong>Shafts</strong></span><br><span style="font-size: medium;">We have all of the shafts from Fujikura, VA Composites, Graphite Design, Matrix, Accra, True Temper, KBS, UST Mamiya, Mitsubishi, Nippon, Oban, Veylix, and much more...&nbsp; Check them out&nbsp;<a href="https://thepeoplesclubs.com/tour-shafts.html">Here</a>.&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: x-large;"><strong>Tips</strong></span><br><span style="font-size: medium;">2014-2016 TM Tip- $30</span><br><span style="font-size: medium;">2017-2019 TM Tip- $30</span><br><span style="font-size: medium;">2014-2019 Tour Taylormade Tip- $30</span><br><span style="font-size: medium;">Callaway 2014-2019 Tip- $30</span><br><span style="font-size: medium;">Titleist Driver- $30</span><br><span style="font-size: medium;">Titleist Fairway- $30</span><br><span style="font-size: medium;">Titleist Hybrid- $30</span><br><span style="font-size: medium;">Ping- $30</span><br><span style="font-size: medium;">Everything else available upon request.&nbsp;</span></p>\r\n<table id="backgroundTable" style="width: 100%; height: 100%;" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table id="backgroundTable" style="width: 100%; height: 100%;" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table id="templateContainer" style="width: 600px;" border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table id="templateBody" style="width: 600px;" border="0">\r\n<tbody>\r\n<tr>\r\n<td class="bodyContent">\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '2020-07-13 19:23:08', '2020-07-13 19:23:08', 1),
(2, 'About Us', 'About', '<div class="content-row">\r\n<h1><strong>About</strong> Us</h1>\r\n<p style="font-family: ''Open Sans''; font-size: 15px; font-weight: 400; color: #4a505e; line-height: 2;">The Peoples Club Shop is a full service online golf store. We specialize in custom built tour issue clubs that give our customers every advantage possible. Owner Will Peoples was an avid golfer growing up and turned his passion into a business. After personally experiencing the advantages of tour issue clubs, Will wanted to bring that same advantage to the weekend golfer, not just the tour players.</p>\r\n<h1>&nbsp;</h1>\r\n<center>\r\n<h3>At Peoples Golf, our mission is to inspire golfers to become great by equipping them with #onlythebest clubs available.</h3>\r\n</center></div>\r\n<div class="content-row" style="padding: 50px 0 60px;">\r\n<p style="font-family: ''Open Sans''; font-size: 15px; font-weight: 400; color: #4a505e; line-height: 2; max-width: 660px; text-align: center; margin: 0 auto;">The Peoples Clubs was founded in 2008 and since inception, have had the opportunity to build countless clubs for pros, collegiate golfers, aspiring pros, and everyday hacks just like us! TPC takes pride in providing #onlythebest tour quality services to everyone.</p>\r\n</div>\r\n<div class="content-row fullwidth-row" style="background-color: #f1f1f1; position: relative; min-height: 450px;">\r\n<div class="fullwidth-half-bg" style="background: url(''{{media url="wysiwyg/build_facility_tpc.jpg"}}'') center no-repeat; background-size: cover;">&nbsp;</div>\r\n<div class="container">\r\n<div class="row">\r\n<div class="offset-lg-6 col-lg-6" style="padding-top: 70px; padding-bottom: 70px;">\r\n<h2>OUR HISTORY</h2>\r\n<div class="history-accordion">\r\n<ul>\r\n<li class="active">\r\n<div class="history-title">2007</div>\r\n<div class="history-content" style="display: block;">TPC owner, Will Peoples, started building clubs in his Garage. Mostly at first, for just friends and family.</div>\r\n</li>\r\n<li>\r\n<div class="history-title">2009</div>\r\n<div class="history-content" style="display: none;">Started selling Tour Issue Clubs online, mostly through word of mouth.</div>\r\n</li>\r\n<li>\r\n<div class="history-title">2013</div>\r\n<div class="history-content" style="display: none;">ThePeoplesClubs.com launched. Our first eCommerce store was live and online.</div>\r\n</li>\r\n<li>\r\n<div class="history-title">2014</div>\r\n<div class="history-content" style="display: none;">Moved into our current location which houses not only The Peoples Clubs and Tour Stock Putters <strong>but our state of the art build facility!</strong></div>\r\n</li>\r\n<li>\r\n<div class="history-title">2015</div>\r\n<div class="history-content" style="display: none;">Branched out to start selling retail clubs and shafts, not just tour issue products</div>\r\n</li>\r\n<li>\r\n<div class="history-title">2017</div>\r\n<div class="history-content" style="display: none;">Paired with Tour Stock Putters to bring you everything from tour clubs, shafts and accessories to one of a kind putters.</div>\r\n</li>\r\n<li>\r\n<div class="history-title">2019</div>\r\n<div class="history-content" style="display: none;">Rebranded as <a href="https://peoples.golf">Peoples Golf</a>.</div>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="content-row custom-support" style="padding: 60px 0 30px;">\r\n<h2 style="margin-bottom: 40px;">OUR PROMISE</h2>\r\n<p style="font-family: ''Open Sans''; font-size: 15px; font-weight: 400; color: #4a505e; line-height: 2;">The Peoples Clubs takes pride in having satisfied customers and will do whatever it takes to ensure every customer is happy. TPC is well known and well respected throughout the entire golf community. You might have seen The Peoples Clubs featured on GolfWRX, Global Golf’s Blog, The Hackers Paradise or several other online forums and Blogs. TPC have built well over 60,000 clubs and have tons of satisfied customers.</p>\r\n</div>\r\n<div class="content-row fullwidth-row" style="background-color: #f3f3f3; padding: 57px 0;">\r\n<div class="container">\r\n<h2 style="margin-bottom: 20px;">OUR TEAM</h2>\r\n<div id="member-slider-about" class="owl-carousel owl-theme">\r\n<div class="item">\r\n<div class="team-member"><img src="{{media url="wysiwyg/will_tpc_headshot.jpg"}}" alt="">\r\n<h5>Will Peoples</h5>\r\nCEO and Founder</div>\r\n</div>\r\n<div class="item">\r\n<div class="team-member"><img src="{{media url="wysiwyg/glen_tpc_headshot.jpg"}}" alt="">\r\n<h5>Glenn Birchfield</h5>\r\nBuild Shop Manager</div>\r\n</div>\r\n<div class="item">\r\n<div class="team-member"><img src="{{media url="wysiwyg/tpc_headshot_2.jpg"}}" alt="">\r\n<h5>Jake Frizzell</h5>\r\nAdministrative Assistant/Builder</div>\r\n</div>\r\n<div class="item">\r\n<div class="team-member"><img src="{{media url="wysiwyg/tpc_headshot_1.jpg"}}" alt="">\r\n<h5>Jon Brooks</h5>\r\nPacking Specialist</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<style type="text/css"><!--\r\n.top-container >.breadcrumbs {\r\n    border-bottom: 1px solid #ececec;\r\n    padding-bottom: 8px;\r\n}\r\n.fullwidth-half-bg {\r\n    width: 100%;\r\n    min-height: 450px;\r\n}\r\n@media (min-width: 992px) {\r\n    .fullwidth-half-bg {\r\n        width: 50%;\r\n        width: calc(50% - 30px);\r\n        height: 100%;\r\n        position: absolute;\r\n        left: 0;\r\n        top: 0;\r\n    }\r\n}\r\n.content-row h2 {\r\n    font-size: 16px;\r\n    font-family: ''Oswald'';\r\n    color: #282d3b;\r\n    font-weight: 700;\r\n    line-height: 1;\r\n    margin-bottom: 30px;\r\n}\r\n.history-accordion > ul {\r\n    list-style: none;\r\n    padding: 0;\r\n    margin: 0;\r\n}\r\n.history-accordion .history-title {\r\n    font-family: ''Oswald'';\r\n    font-size: 14px;\r\n    font-weight: 700;\r\n    color: #282d3b;\r\n    padding: 15px 0;\r\n    border-bottom: 1px solid #e4e4e4;\r\n    position: relative;\r\n    cursor: pointer;\r\n}\r\n.history-accordion li.active .history-title {\r\n    color: #7aa93c;\r\n    border-color: #7aa93c;\r\n}\r\n.history-accordion .history-title:after {\r\n    content: "\\e873";\r\n    font-family: ''porto'';\r\n    font-size: 10px;\r\n    line-height: 20px;\r\n    width: 20px;\r\n    text-align: center;\r\n    display: block;\r\n    position: absolute;\r\n    right: 20px;\r\n    top: 16px;\r\n    color: #7f8284;\r\n}\r\n.history-accordion li.active .history-title:after {\r\n    color: #7aa93c;\r\n    content: "\\e874";\r\n}\r\n.history-accordion .history-content {\r\n    font-size: 14px;\r\n    font-weight: 400;\r\n    line-height: 2;\r\n    color: #4a505e;\r\n    padding: 20px 0;\r\n}\r\n.custom-support div.content {\r\n    padding-bottom: 20px;\r\n    margin-left: 90px;\r\n}\r\n.custom-support div.content>h2 {\r\n    font-family: ''Open Sans'';\r\n    font-size: 15px;\r\n    font-weight: 700;\r\n    color:#2b2b2d;\r\n    text-transform: uppercase;\r\n    line-height: 22px;\r\n    margin-bottom: 4px;\r\n}\r\n.custom-support div.content>p {\r\n    font-size: 14px;\r\n    color: #4a505e;\r\n    letter-spacing: 0.01em;\r\n    line-height: 27px;\r\n}\r\n.team-member span {\r\n    display: block;\r\n    font-size: 14px;\r\n    color: #8c8e94;\r\n    margin-bottom: 10px;\r\n}\r\n.team-member h5 {\r\n    font-size: 14px;\r\n    font-weight: 700;\r\n    color: #282d3b;\r\n    margin: 25px 0 5px;\r\n}\r\n.team-member img {\r\n    width: 200px;\r\n}\r\n.team-member {\r\n    background-color: #fff;\r\n    padding: 25px 0;\r\n    text-align: center;\r\n}\r\n#member-slider-about {\r\n    margin: 0 -15px;\r\n}\r\n#member-slider-about .item {\r\n    padding: 15px;\r\n}\r\n#member-slider-about .owl-controls .owl-page.active span, #member-slider-about .owl-controls.clickable .owl-page:hover span {\r\n    background-color: #696969;\r\n}\r\n#member-slider-about .owl-controls .owl-page span {\r\n    background-color: #d1d1d1;\r\n    width: 12px;\r\n    height: 12px;\r\n    margin: 5px;\r\n}\r\n.main-container, .col-main {\r\n    padding-bottom: 0;\r\n}\r\n--></style>', '2020-07-13 19:26:05', '2020-07-13 19:26:05', 1),
(3, 'Footer Links - Products', 'flproducts', '<ul>\r\n<li>Accessories</li>\r\n<li>Clubs</li>\r\n<li>Retail</li>\r\n<li>Shafts</li>\r\n<li>Putters</li>\r\n</ul>', '2020-07-13 19:41:52', '2020-07-13 19:41:52', 1),
(4, 'Disclaimer', 'disclaimer', '<p>DISCLAIMER: THE PEOPLES CLUBS IS NOT AFFILIATED WITH OR SPONSORED IN ANY WAY BY ANY CLUB MANUFACTURER. IT IS ITS OWN SEPARATE ENTITY SPECIALIZING IN THE RESALE AND CUSTOMIZATION OF HIGH END GOLF CLUBS. ANY TRADEMARKS USED BY THE PEOPLES CLUBS ON THIS WEBSITE OR OTHERWISE ARE PURELY FOR NAMING AND IDENTIFICATION PURPOSES ONLY AND SHOULD NOT BE VIEWED AS AN ENDORSEMENT OF THE PEOPLES CLUBS BY ANY CLUB MANUFACTURER.</p>', '2020-07-13 20:05:04', '2020-07-13 20:05:04', 1);
