="0" id="backgroundTable" style="width: 100%; height: 100%;">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table border="0" id="templateContainer" style="width: 600px;">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table border="0" id="templateBody" style="width: 600px;">\r\n<tbody>\r\n<tr>\r\n<td class="bodyContent">\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', '2020-07-13 19:16:53', '2020-07-13 19:17:20', 1, 0, NULL, '', '', NULL, NULL, NULL, NULL, ''),
(6, 'About', '1column', '', '', 'aboutus', '', '<div class="content-row">\r\n<h1><strong>About</strong> Us</h1>\r\n<p style="font-family: ''Open Sans''; font-size: 15px; font-weight: 400; color: #4a505e; line-height: 2;">The Peoples Club Shop is a full service online golf store. We specialize in custom built tour issue clubs that give our customers every advantage possible. Owner Will Peoples was an avid golfer growing up and turned his passion into a business. After personally experiencing the advantages of tour issue clubs, Will wanted to bring that same advantage to the weekend golfer, not just the tour players.</p>\r\n<h1><br /><center>\r\n<h3>At Peoples Golf, our mission is to inspire golfers to become great by equipping them with #onlythebest clubs available.</h3>\r\n</center></h1>\r\n</div>\r\n<div class="content-row" style="padding: 50px 0 60px;">\r\n<p style="font-family: ''Open Sans''; font-size: 15px; font-weight: 400; color: #4a505e; line-height: 2; max-width: 660px; text-align: center; margin: 0 auto;">The Peoples Clubs was founded in 2008 and since inception, have had the opportunity to build countless clubs for pros, collegiate golfers, aspiring pros, and everyday hacks just like us! TPC takes pride in providing #onlythebest tour quality services to everyone.</p>\r\n</div>\r\n<div class="content-row fullwidth-row" style="background-color: #f1f1f1; position: relative; min-height: 450px;">\r\n<div class="fullwidth-half-bg" style="background: url(''{{media url="wysiwyg/build_facility_tpc.jpg"}}'') center no-repeat; background-size: cover;"></div>\r\n<div class="container">\r\n<div class="row">\r\n<div class="offset-lg-6 col-lg-6" style="padding-top: 70px; padding-bottom: 70px;">\r\n<h2>OUR HISTORY</h2>\r\n<div class="history-accordion">\r\n<ul>\r\n<li class="active">\r\n<div class="history-title">2007</div>\r\n<div class="history-content" style="display: block;">TPC owner, Will Peoples, started building clubs in his Garage. Mostly at first, for just friends and family.</div>\r\n</li>\r\n<li>\r\n<div class="history-title">2009</div>\r\n<div class="history-content" style="display: none;">Started selling Tour Issue Clubs online, mostly through word of mouth.</div>\r\n</li>\r\n<li>\r\n<div class="history-title">2013</div>\r\n<div class="history-content" style="display: none;">ThePeoplesClubs.com launched. Our first eCommerce store was live and online.</div>\r\n</li>\r\n<li>\r\n<div class="history-title">2014</div>\r\n<div class="history-content" style="display: none;">Moved into our current location which houses not only The Peoples Clubs and Tour Stock Putters <strong>but our state of the art build facility!</strong></div>\r\n</li>\r\n<li>\r\n<div class="history-title">2015</div>\r\n<div class="history-content" style="display: none;">Branched out to start selling retail clubs and shafts, not just tour issue products</div>\r\n</li>\r\n<li>\r\n<div class="history-title">2017</div>\r\n<div class="history-content" style="display: none;">Paired with Tour Stock Putters to bring you everything from tour clubs, shafts and accessories to one of a kind putters.</div>\r\n</li>\r\n<li>\r\n<div class="history-title">2019</div>\r\n<div class="history-content" style="display: none;">Rebranded as <a href="https://peoples.golf">Peoples Golf</a>.</div>\r\n</li>\r\n</ul>\r\n</div>\r\n<script type="text/javascript">// <![CDATA[\r\n                    jQuery(function($){\r\n                        $(document).ready(function(){\r\n                            $(".history-accordion .history-title").off("click").on("click",function(){\r\n                                if(!$(this).parent().hasClass("active")) {\r\n                                    $(this).parent().parent().children("li.active").children(".history-content").slideUp();\r\n                                    $(this).parent().parent().children("li.active").removeClass("active");\r\n                                    $(this).parent().addClass("active");\r\n                                    $(this).parent().children(".history-content").slideDown();\r\n                                } else {\r\n                                    $(this).parent().removeClass("active");\r\n                                    $(this).parent().children(".history-content").slideUp();\r\n                                }\r\n                            });\r\n                        });\r\n                    });\r\n\r\n// ]]></script>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="content-row custom-support" style="padding: 60px 0 30px;">\r\n<h2 style="margin-bottom: 40px;">OUR PROMISE</h2>\r\n<p style="font-family: ''Open Sans''; font-size: 15px; font-weight: 400; color: #4a505e; line-height: 2;">The Peoples Clubs takes pride in having satisfied customers and will do whatever it takes to ensure every customer is happy. TPC is well known and well respected throughout the entire golf community. You might have seen The Peoples Clubs featured on GolfWRX, Global Golf’s Blog, The Hackers Paradise or several other online forums and Blogs. TPC have built well over 60,000 clubs and have tons of satisfied customers. </p>\r\n</div>\r\n<div class="content-row fullwidth-row" style="background-color: #f3f3f3; padding: 57px 0;">\r\n<div class="container">\r\n<h2 style="margin-bottom: 20px;">OUR TEAM</h2>\r\n<div class="owl-carousel owl-theme" id="member-slider-about">\r\n<div class="item">\r\n<div class="team-member"><img alt="" src="{{media url="wysiwyg/will_tpc_headshot.jpg"}}" />\r\n<h5>Will Peoples</h5>\r\n<span>CEO and Founder</span></div>\r\n</div>\r\n<div class="item">\r\n<div class="team-member"><img alt="" src="{{media url="wysiwyg/glen_tpc_headshot.jpg"}}" />\r\n<h5>Glenn Birchfield</h5>\r\n<span>Build Shop Manager</span></div>\r\n</div>\r\n<div class="item">\r\n<div class="team-member"><img alt="" src="{{media url="wysiwyg/tpc_headshot_2.jpg"}}" />\r\n<h5>Jake Frizzell</h5>\r\n<span>Administrative Assistant/Builder</span></div>\r\n</div>\r\n<div class="item">\r\n<div class="team-member"><img alt="" src="{{media url="wysiwyg/tpc_headshot_1.jpg"}}" />\r\n<h5>Jon Brooks</h5>\r\n<span>Packing Specialist</span></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<script type="text/javascript">// <![CDATA[\r\n        jQuery(function($){\r\n            $("#member-slider-about").owlCarousel({\r\n                lazyLoad: true,\r\n                itemsCustom: [ [0, 2], [320, 1], [480, 2], [640, 3], [768, 3], [992, 4], [1200, 4] ],\r\n                responsiveRefreshRate: 50,\r\n                slideSpeed: 200,\r\n                paginationSpeed: 500,\r\n                scrollPerPage: false,\r\n                stopOnHover: true,\r\n                rewindNav: true,\r\n                rewindSpeed: 600,\r\n                pagination: true,\r\n                navigation: false,\r\n                autoPlay: true\r\n            });\r\n        });\r\n\r\n// ]]></script>\r\n</div>\r\n<style type="text/css"><!--\r\n.top-container >.breadcrumbs {\r\n    border-bottom: 1px solid #ececec;\r\n    padding-bottom: 8px;\r\n}\r\n.fullwidth-half-bg {\r\n    width: 100%;\r\n    min-height: 450px;\r\n}\r\n@media (min-width: 992px) {\r\n    .fullwidth-half-bg {\r\n        width: 50%;\r\n        width: calc(50% - 30px);\r\n        height: 100%;\r\n        position: absolute;\r\n        left: 0;\r\n        top: 0;\r\n    }\r\n}\r\n.content-row h2 {\r\n    font-size: 16px;\r\n    font-family: ''Oswald'';\r\n    color: #282d3b;\r\n    font-weight: 700;\r\n    line-height: 1;\r\n    margin-bottom: 30px;\r\n}\r\n.history-accordion > ul {\r\n    list-style: none;\r\n    padding: 0;\r\n    margin: 0;\r\n}\r\n.history-accordion .history-title {\r\n    font-family: ''Oswald'';\r\n    font-size: 14px;\r\n    font-weight: 700;\r\n    color: #282d3b;\r\n    padding: 15px 0;\r\n    border-bottom: 1px solid #e4e4e4;\r\n    position: relative;\r\n    cursor: pointer;\r\n}\r\n.history-accordion li.active .history-title {\r\n    color: #7aa93c;\r\n    border-color: #7aa93c;\r\n}\r\n.history-accordion .history-title:after {\r\n    content: "\\e873";\r\n    font-family: ''porto'';\r\n    font-size: 10px;\r\n    line-height: 20px;\r\n    width: 20px;\r\n    text-align: center;\r\n    display: block;\r\n    position: absolute;\r\n    right: 20px;\r\n    top: 16px;\r\n    color: #7f8284;\r\n}\r\n.history-accordion li.active .history-title:after {\r\n    color: #7aa93c;\r\n    content: "\\e874";\r\n}\r\n.history-accordion .history-content {\r\n    font-size: 14px;\r\n    font-weight: 400;\r\n    line-height: 2;\r\n    color: #4a505e;\r\n    padding: 20px 0;\r\n}\r\n.custom-support div.content {\r\n    padding-bottom: 20px;\r\n    margin-left: 90px;\r\n}\r\n.custom-support div.content>h2 {\r\n    font-family: ''Open Sans'';\r\n    font-size: 15px;\r\n    font-weight: 700;\r\n    color:#2b2b2d;\r\n    text-transform: uppercase;\r\n    line-height: 22px;\r\n    margin-bottom: 4px;\r\n}\r\n.custom-support div.content>p {\r\n    font-size: 14px;\r\n    color: #4a505e;\r\n    letter-spacing: 0.01em;\r\n    line-height: 27px;\r\n}\r\n.team-member span {\r\n    display: block;\r\n    font-size: 14px;\r\n    color: #8c8e94;\r\n    margin-bottom: 10px;\r\n}\r\n.team-member h5 {\r\n    font-size: 14px;\r\n    font-weight: 700;\r\n    color: #282d3b;\r\n    margin: 25px 0 5px;\r\n}\r\n.team-member img {\r\n    width: 200px;\r\n}\r\n.team-member {\r\n    background-color: #fff;\r\n    padding: 25px 0;\r\n    text-align: center;\r\n}\r\n#member-slider-about {\r\n    margin: 0 -15px;\r\n}\r\n#member-slider-about .item {\r\n    padding: 15px;\r\n}\r\n#member-slider-about .owl-controls .owl-page.active span, #member-slider-about .owl-controls.clickable .owl-page:hover span {\r\n    background-color: #696969;\r\n}\r\n#member-slider-about .owl-controls .owl-page span {\r\n    background-color: #d1d1d1;\r\n    width: 12px;\r\n    height: 12px;\r\n    margin: 5px;\r\n}\r\n.main-container, .col-main {\r\n    padding-bottom: 0;\r\n}\r\n--></style>\r\n', 